(24, 68, 'https://www.facebook.com/RakshaBihaniPhotography', '', '1351054887'),
(25, 75, '', 'I Love to Click', '1351057145'),
(26, 70, 'i am a human being, hence i walk on my feet, to work, to find food to eat, during which i see and enjoy, to a level that i find walking a great fun, which make me feel better than animals, cause i am able to talk about it, just because i am...a human being', '', '1351057231'),
(27, 83, 'LOVES LIFE AND LIVES LIFE.... ;)', '', '1351060899'),
(28, 82, 'http://www.facebook.com/pages/Hamerred/152012814884760', '', '1351064134'),
(29, 5, 'Rooted and living to live, not survive! In love with books, music and all that is creatively inspiring.', 'In creative side of my day!', '1351066208'),
(30, 96, '', '', '1351072237'),
(31, 103, '', '', '1351075322'),
(32, 120, 'Cynic', '', '1351086782'),
(33, 125, 'I am a simple girl.. Who likes going out, wasting money on herself. I like to behave like a child. I like making things more interesting and beautiful.', '', '1351089064'),
(34, 132, '', '', '1351090578'),
(35, 147, '', '', '1351105000'),
(36, 155, 'Provides information in and around Kakinada city.\nProvides free business listing for kakinada business people.\nCheck http://kakinada.co for more information.\nLike Us on Facebook:\nhttps://www.facebook.com/Kakinada.co\nAlso join in the group :\nhttps://www.facebook.com/groups/kakinada.co', '', '1351128543'),
(37, 198, 'I am a technology freak and like silence the most...\nWanna do something in the field of science..\nPhotography is just a hobby of mine..', '', '1351229091'),
(38, 213, 'a cool nd friendly in nature...', '', '1351186395'),
(39, 224, 'White as snow , Swift as wind \nclear as water , what so matter \n\nlove to be loved :)', 'Welcome .................!', '1351203512'),
(40, 236, '', 'Be yourself..', '1351228958'),
(41, 219, 'i am just simple living person... with high ambitions... i get frustrated easily... short tempered... and somehow creative... persuing architecture...', '', '1351232170'),
