(46, 290, 'jst done with studies for a bit ...have fun clickin pics and writin if eva in the mood to....', 'gettin started..:P', '1351791261'),
(47, 298, '', ':)', '1351509037'),
(48, 302, 'A simpleton who is complexly in love with herself :D (and obsessed with smileys) ;)', 'Here I am ;)', '1351529462'),
(49, 315, 'I am fun loving person and professional Travel consultant. I love travelling, photography and writing. I travel to learn, click to express and write to impart my experience to the world. I love to help people in any way possible.', 'Ideate the world in your own way..!!!', '1351751237'),
(50, 8, '', 'The king of beast', '1351792900'),
(51, 320, '', '', '1351856086'),
(52, 325, 'yo !!i''m really chilled adventures and philosophic 15year old..i want to be the best in the world at what i do.i want change the world and be written in the history text books of the future kids. In simple words i want to be searched on GOOGLE rather than FACEBOOK.', '', '1351972434'),
(53, 48, 'Loves surprises, love life. Reason why I smile is the faith that God has created few more unique human beings like me.Another reason for my smile are the mystique scenic places, food on my plate :P, clothes discovered by early men and being a mystery to the people. :)', 'Tired giving exams. :P', '1351985299'),
(54, 333, '', 'I''m here... :)', '1352059406'),
(55, 338, 'Journalism student. Pop culture addict. Social media buff. Foodie. Amateur cook. Writer at Youth Ink', '', '1352102545'),
(56, 336, 'I am somebody. I am me. I like being me. And I need nobody to make me somebody.', '', '1352111932'),
(57, 344, 'Wouldn''t say I was special. I prefer to think of myself as a limited edition!\n\nI always hated writing ''Myself'' in school and same goes here.. But to sum it up in a few (lot of) words - Love to spend time looking in the mirror, absolutely love to shop, love long drives and walks on the beach, love to watch the rain, love watching movies, love Bollywood, love travelling (only to exotic locations :-)', '', '1352119710'),
(58, 349, 'I love nature and want to capture its strory with my picture..', '', '1352134931'),
(59, 350, '', '', '1352137528'),
(60, 353, 'Innocent Freak!!', '', '1352206522'),
