(62, 228, '', '', '1356894637'),
(63, 391, 'M pursuing BCA from Birla Inst. Tech. , Jaipur..(Final Year)\nI love photography..i even click some..\nmy deep interest is in editing pictures, giving effects to them..\n\nwhat ever I will post here is of my own.. Clicked by me and edited by me..\n\nyou can follow my page on Facebook. The link is:\n\nwww.facebook.com/editfun\n\n\nFeedback is valuable', '', '1357456703'),
