(20, 302, 'I would make the saying "as you sow, so shall you reap" a little more practical for people to feel it happen :P', 'As sunlight is to a sunflower...... ;)', 'Coconut water :p', 'The CAMERA... presses that "Re-play" button at the back of your head bringing back memories of some of the best moment''s you had in life... :)', 'Garfield :D'),
