(22, 315, 'I would make PHOTOGRAPHY as #1 profession and make the WORLD travel with my COMPANY.', '', '', '', ''),
(23, 290, 'would enjoy all the privileges..:P', 'anything that displays many emotions effortlesly...sumthin that comes from within...', 'nothing at the moment...some untimely drinks..', 'Camera and a mobile phne...', 'will have to direct and produce it i guess...'),
