(28, 344, 'I''d make junkies suffer for their actions, I''d make cutting trees impossible, I''d make politicians disappear cluelessly who took bribes. I''ll come up with something more in a few more days.', 'Silent words.', 'Iced tea.', 'Pens and cameras', ''),
