(74, 153, 3, 'I love the play of colours here... And the way you chose your angle. The depth in the subject speaks a million words. Great stuff Raj.\n\nA good attempt at writing too. But am sure that can improve and you can express better. :)', '1351841331'),
(75, 154, 3, 'The idea is to hear you out. You don''t need to be an outstanding writer. But we''d just like to know more about what made this picture come to life, your experience and what was on your mind at that point in time. \n\nCreativity is about communicating through every cell of your body. Pictures speak... more. And the world out there is ready to hear too. All you need to do is... express more. :)', '1351841513'),
