(1, 0, 'piclogs/picture.jpg', 'Sample Piclog', 12, 'Picture this... thoughtfully so!', '<p>It was a usual Saturday morning; a drive to my workplace,\r\nthe Sun blazing in all its glory, the world moving around swiftly, mounting\r\ndecibel levels â€“ everything that possibly could take center stage, and thatâ€™s\r\nwhen a thought â€“ a bug â€“ crossed my mindâ€¦ and everything came to a standstill.</p><p><br></p><p>The first word that Iâ€™d used to describe this thought was\r\nâ€œimpractical!â€ I, quite predictably, locked the thought in an old rusted trunk\r\nand pushed it to a remote corner of my mind. At that point in time, it seemed\r\nlogical to avoid a thought that seemed ludicrous. But I could sense how this\r\nbug was trying to escape from that pitch-black ruthless environment. It didnâ€™t\r\nreally botherme\r\ninitially. It was a moment of pride; I could get rid of a weed to find the\r\nultimate solace. It was an unmatched moment that could not reflect in a web of\r\na zillion words.&nbsp;</p><p><br></p><p>But somewhere I could still smell the existence of that\r\nthought on the active side of my mind. Itâ€™s like marijuana that leaves its\r\nremains, a relationship that leaves its pain, a life that leaves its nameâ€¦ for\r\ntime to come.&nbsp;But I was reluctant to accept the fact that the left-over of a\r\nthought is, sometimes, stronger than its mere existence. It was a perception\r\nthat ruled out common-sense, reality and belief; it was an illusion.</p><p><br></p><p>All this occurred in split seconds. I wasnâ€™t really\r\nvindicated. But I, somewhere deep down inside, knew that this is how it was\r\nmeant to be. Sometimes we end up taking a decision without thinking; we look\r\nback to analyze, and feel that weâ€™d have taken a similar call even if we had\r\nthe luxury of time. Thatâ€™s exactly what happened with this thought that, I\r\nfelt, didnâ€™t deserve my attention.</p><p><br></p><p>The efforts of the bug to garner the lime-light continued. I\r\nfelt that there was a war of sorts taking place in my mind. My heart pitched-in\r\nto make peace but was overshadowed. I looked back and saw that the bug was\r\nsettled. I rushed to look for the bug; it was breathless, struggling for life.\r\nI reached out to lend my hand and bring it back to life. Thatâ€™s when I realized\r\nthat the thought could leave me; but I couldnâ€™t. Before I could think further,\r\nit took over my world, and now, I was what the thought was â€“ alive.</p>', 'Publish to Self', '1343394167', 'piclogs/picture_thumb.jpg', 'picture_this_thoughtfully_so_'),
(58, 1, 'piclogs/resize_1350993916.jpg', 'Ravikanth Katkam', 8, 'Can you say your ABCs?', '<strong>Can you say your ABCs?&nbsp;</strong><div><strong><em>â€œABCs of BLANK</em>â€</strong>or<strong>â€œ<em>BLANK From A to Zâ€</em></strong></div><div><strong><em><br></em></strong></div><div>This convention works great if you have twenty-six steps or points to make. Itâ€™s even better if you have a different word for each letter. Of course, the letters Q, X and Z can be difficult but a little creative license and you can fudge it. Even better it provides a great list structure.</div>', 'Publish to All', '1350994152', 'piclogs/resize_1350993916.jpg', 'can_you_say_your_abcs_'),
(59, 7, 'piclogs/resize_1351007309.jpg', 'Google', 6, 'Dare To Dream!', '<p>Dreams are an outcrop of the kind of life you desire to\nlead. Dreams can drive you and can make you skip over obstacles. When you allow\nyour dreams to drag you, they unleash an original force that can overpower any\nbarrier in your path. To unleash this power, though, your dreams must be clear\nand defined. A fuzzy future has small pulling power. Well structured and well\ndefined dreams are not fuzzy. Desires are fuzzy. To really accomplish your\ndreams, to really have your future plans pull you ahead, your dreams must be\nvivid. </p>\n\n<p>Think of the people who climb the Mount Everest, How did\nthey get it completed? Carrying one dayâ€™s supply of food and water is tough\njob. Can you imagine carrying all of your worldly goods with you, mile after\nmile, day after day? These people had big dreams. They had objective. They\ndidnâ€™t focus on the adversity of getting up the mountain. Mentality, they were\nalready on the other sideâ€”their bodies just hadnâ€™t got them there up till now! </p>\n\n<p>Despite all of their trouble and struggles, those who made\nit to the other side had a single dream: to reach the land of incessant\nsunshine and extraordinary wealth. Their dreams were stronger than the problem\nin their way. </p>\n\n<p>To achieve big success in life you will have to dare to dream\nbig, your dream should be bigger and based on that set your targets and achieve\nit.</p>', 'Publish to All', '1351009140', 'piclogs/thumb_1351007309.jpg', 'dare_to_dream_'),
(4, 2, 'piclogs/resize_1350046054.jpg', 'sharath', 7, 'ONe FINe Blue MOOn DAy', '<br>One fine night this site is going to be launched.', 'Publish to All', '1350046167', 'piclogs/resize_1350046054.jpg', 'one_fine_blue_moon_day'),
(23, 4, 'piclogs/resize_1350319943.jpg', 'Google', 12, 'Success & Happiness?', '<p>Success is not the key to happiness.\nHappiness is the key to success. If you love what you are doing, you will be\nsuccessful"- Albert Schweitzer</p>\n\n<p>It might seem silly for a 25-year-old\nto define what success is, but I can explain what in life I am working towards.</p>\n\n<p>Overall, I believe that you know you\nhave achieved success when you reach the end of your life and you have no\nregrets, no qualms or grudges. In psychology they refer to this as "ego\nintegrity." It''s probably safe to say that all people work towards this sort\nof end.This doesn''t mean that you can''t make mistakes in your life. Basically,\nhowever, you should have done enough over your lifetime to be at peace with\nyourself in the end. This can mean a number of different things depending on\nthe person. To some it means owning a multi-million dollar business, for others\nit could be protecting an old House for other generations to see. It could be\nmaking something for others down the line or for yourself alone. For me success\nis the former; I want to do something that will last. I want to succeed in\nbeing happy and it would make me happy to have a legacy. Personally I find\nhappiness in purpose, so I consider that success for me is achieving what I''ve\nset out to do.</p>\n\n<p>Is it that success means doing what\nmakes you happy or that you''re happy when you''re successful? I''m leaning toward\nthe first response.</p>\n\n<p>I wonder if one''s idea of success\nchanges if they never really meet their goals. I''m not really sure why I''m\nwriting this but I think it''s interesting to analyze these things, especially\nearly in life when my life has hardly even really started.</p>', 'Publish to All', '1350322126', 'piclogs/resize_1350319943.jpg', 'success_happiness_'),
(16, 9, 'piclogs/resize_1350131131.jpg', 'www.inc.com', 5, 'The phobia of joblessness!!!', '<p>The fear of being jobless is one of my greatest fears. And\nthere have been quite a few instances where I had to come face to face with\nthis fear. In fact this happens in every job that I take up. In six years of my\ncareer, Iâ€™ve been more jobless than employed. Now, itâ€™s more than a phobia;\nitâ€™s a way of life.</p><p><br></p>\n\n<p>I am accustomed to quitting jobs so often that you''ll find\none document always ready with me - my resignation letter. Iâ€˜ve got it in\ndifferent formats and styles. A typed soft copy is in the drafts of my email, a hard copy in\nmy car, another copy in my laptop case, and a hand-written copy in my diary.\nAnother benefit of quitting so often is that I have improved on my skills of\nwriting a resignation letter. Now, Iâ€™m so good at writing resignation letters\nthat most colleagues ask me to write it for them. In fact, I plan to take this\nup as a business opportunity, and start charging them for every letter I write.\nIf people today consider me to be a decent writer, it''s only because of my\nexperience in writing this document. </p>\n\n<p><br></p><p>For me, being jobless might be a way of life but for many\nitâ€™s a great fear. A fear thatâ€™s difficult to overcome. But how does it feel\nwhen you know that you''re soon going to lose your job? Well, personally I feel\nbeing jobless is an achievement; not many people can do that. Unfortunately,\nIâ€™m the only one who thinks so. I feel itâ€™s the society that injects this fear\ninto unemployed people. Ironically, when youâ€™re employed, no one bothers to\nknow where youâ€™re working or how much you are earning. But the moment you are\njobless, these questions follow you like your shadow. The phobia of being\njobless however starts from the day you start assuming that youâ€™re not going to\nlast in your current organization for long. The assumption slowly transforms\ninto a firm belief. And the final nail in the coffin is when you actually get\nan official intimation from you immediate boss that your services are not a\nvalue-addition to the organization. Hence, youâ€™d have to leave. One of my\nex-bosses had a nice way to put this across to me. He said, â€œYouâ€™ve been\nworking too hard from so many days. I think you should take a sabbatical!!â€</p>\n\n<p><br></p><p> Come to think of it, the <i>fear</i> of being jobless, is a lot more than <i>actually</i> being jobless. With me the issue is not about getting\nanother job. Itâ€™s my mind that wanders thinking of ways to while away my time\nwhen am doing nothing. I have mastered the art of doing nothing to an extent\nwhere I continue to do that even when am employed. One day I was discussing\nwith my senior, how important my contribution to the organization was. â€œThis\nplace doesnâ€™t value my contribution. I think I should not come to work for a\nfew days. Only then these people will understand my worth.â€ To which my senior\nreplied, â€œDon''t even think of doing that.â€ In a commanding tone I asked, â€œWhy?â€ To which\nhe replied, â€œIf you donâ€™t come to work for a few days, people will get to know\nthat they can manage things better when youâ€™re not around. Also, that it works\nto the organizationâ€™s advantage.â€ </p>\n\n<p><br></p><p>Another fear thatâ€™s related to the fear of being jobless is\nthe fear of being broke. But for me, itâ€™s my friends who face the effects of me\nbeing jobless, and live in this fear. Their monthly budget shoots up. The\neffect is so strong that it actually travels and creeps into their love lives.\nThey cook up stories to avoid their dates. If you think theyâ€™re highly\naccommodating, youâ€™re mistaken; I am demanding. The situation now isâ€¦ they pray\nfor my employment more than I do. They look out for various job opportunities\nfor me. Sometimes, even if am employed at that point in time. Itâ€™s like hoping for the best and preparing for the worst.</p><div><br></div>\n\nThe first thing to find its place in a\nto-be-jobless or a currently jobless personâ€™s mind is frustration. I know a\ncouple whose marriage was at stake when the husband was terminated. Frustration prevailed in him, as he would be locked up at home the\nentire day, and the wife would return late in the night. Frustration paved the\nway for insecurity, suspicion, self-pity, and finally, a role-reversal. The\nhusband would then ask his wife questions that generally women ask. Where was\nshe? What took her so long? Is she into an extra-marital affair? Is she seeking\na divorce? The wife decided to answer only the last question; the answer was\npositive!&nbsp;<div><br></div><div>In a scenario like this where the husband is behaving like a woman,\ndivorce is inevitable. As we all know two women (because a man behaving like a\nwoman is as good, rather as bad, as a woman) canâ€™t live peacefully under one\nroof.</div>', 'Publish to All', '1350131140', 'piclogs/resize_1350131131.jpg', 'the_phobia_of_joblessness_'),
(14, 9, 'piclogs/resize_1350128384.jpg', 'Raj Mohapatra', 6, 'Women - Weirdly Wired!!', '<p>When I discussed this subject with my boss, he said heâ€™s got loads to contribute. During this discussion, I mentioned that in the next chapter, weâ€™ll get into women. Pat he replied, â€œIâ€™m all set to get into one!â€ Thatâ€™s how my boss reacts to various situations; heâ€™s generally at his humorous best.</p><p><br></p><p>In my initial years of growing up, I witnessed the battle of the sexes from a birdâ€™s eye view. This always made me wonder why itâ€™s so difficult for us men to relate to what women think (well, if they ever do that is hypothetical though). Basically, we are all wired in a different way. But when it comes to women, theyâ€™re weirdly wired. Rational thinking is not a part of their living at all. They donâ€™t have to be foolish to create humour. Itâ€™s just there. I hope Iâ€™m not shutting doors on potential partners. Whatâ€™s worse is that Iâ€™m single. Come to think of it, at times, I feel this attitude towards the opposite sex is responsible for me being single from so long.</p><p><br></p><p>These species are so strange that sometimes even they canâ€™t figure out what they say. Incidentally, this reminds me, my ex-girlfriend once told me, â€œYou say it best when you say nothing at all.â€ The famous Ronan Keating track from the movie<em> Notting Hill</em>. My immediate reaction was, â€œBut baby, when I say nothing at all, you complain that I donâ€™t talk or message or call. I donâ€™t care for you, donâ€™t love you et al.â€œ And she actually started thinking how contradicting she was. â€œBut this song suits you best,â€ I said in my heart. I&nbsp;couldn''t&nbsp;say it aloud for obvious reasons.</p><p><br></p><p>Women live in this strange world of self-obsession; a world where attention is of utmost importance. Itâ€™s something that they canâ€™t do without. What goes without saying is that men always land up in trouble due to this obsession of theirs. You donâ€™t give them attention; youâ€™ll be in the pits. And if you give it more than required theyâ€™ll start suspecting you. But every woman craves for attention from any Tom, Dick and Harry. What they donâ€™t understand isâ€¦ the attention they get. more often than not, is only from the second one!</p><p><br></p><p>Apart from being showered with attention, they also love to talk, be flattered, pampered, showered with lots of expensive gifts, etc. But whatâ€™s strange is their fondness for jumping. They just love to jump. Whether itâ€™s on conclusions, offers, and sale or even on men in bed!</p><p><br></p><p>In fact their fondness for jumping knows no boundaries. A doting husband (I know they donâ€™t exist but being a man Iâ€™m bound to show them in good light... <i>sometimes</i>) was once questioned by his doting wife (I know even they donâ€™t exist. But being a man who loves to love women, Iâ€™m bound to show them in good light at least once), â€œHoneyâ€¦ Where were you last night?â€ The poor husband replied, â€œI was with my secretaryâ€¦â€ Even before he could finish the sentence, the wife pictured him sleeping with her, and reacted accordingly. Well, the poor guy was with his secretary and other staff in the office trying to finish some important official work.</p><p><br></p><p>However, one thing that couldnâ€™t find itself among the weaker sex is logic. Even a life-time spent with various women will leave you with one question â€“ Now, how did that come into the picture? We all know what they say is more often than not hilarious, but because we love being in themâ€¦ err â€¦ I meant with them, we have to shut our trap. Ultimately, we have to practice control. Either control on our laughter or control on being aroused in their presence. I would stick to the former one.</p><p><br></p><p>With logic missing in them, you can neither understand women nor satisfy them. You can even satisfy God one day but you canâ€™t even come close to doing that if youâ€™re dealing with a woman (bedroom might be an exception for some though). The questions they have in mind might have two answers, but their reaction for any answer is one. Incidentally, my ex-girlfriend once asked me, â€œHoney, are you two-timing me?â€ I thought saying â€œyesâ€ would be injurious to my health. So to save myself a great deal of health hazards, I said, â€œNo sweetheart, not at all.â€ The very next moment, she yelled on top of her voice, â€œTHEN WHAT MAKES YOU NOT GIVE ME ENOUGH TIME??â€ What happened next, will find a place in my next Piclog.</p><p><br></p><p>While thereâ€™s so much to talk about their nature, itâ€™s also the way some of them carry themselves thatâ€™s amusing. We understand that oneâ€™s physical appearance, to a great extent, is not in oneâ€™s hands. But what we do with it, and how we project ourselves is definitely in our hands. For instance, they say, â€œflaunt it, if youâ€™ve got itâ€. But some women continue to flaunt even if theyâ€™ve not. Some remind us of the famous <em>Yo Momma</em> quote â€“ <em>Yo mommaâ€™s so fat, she has to wear two watches because sheâ€™s always in two different time zones.</em> In fact, sayings like <em>â€œBeauty is in the eyes of the beholder,â€ â€More than the physical beauty, one should be beautiful from within,â€</em> are some of the most abused sayings. Women use them as an excuse to hog and bloat<em>.</em></p><p><br></p><p>While some women are rotundly-challenged (an attempt to describe something thatâ€™s round in shape) and weird, there are others who are scrawny and scruffy. A colleague of mine is so skinny that she could give complex to a matchstick. But again, Iâ€™d like to believe, itâ€™s not her fault. Whatâ€™s amusing is her body language and dressing sense that got her a prominent place in this chapter. She would wear low cut neck lines, and had this habit of covering the neckline every time a guy would walk up to her to talk. And I still wonder what she used hide!<em></em></p><p><br></p><p>Itâ€™s not about taking a dig at women; itâ€™s about their mere existence. They always claim that they are a cursed lot because of the various cycles (read PMS) they have to go through. The fact however, isâ€¦ itâ€™s that men suffer equally. All the frustration is vented out on us; like we are responsible for this state of theirs. Whatâ€™s more, they even expect sympathy in return. And to add to our woes, we are surrounded by many women. And each one of them goes through these cycles on different days of the month. Basically, itâ€™s a bigger woe to us than to them individually. We struggle all days of a month, and all months of a year with some woman whoâ€™s there to make our life difficult during her cycle. Sometimes, I wish, it wouldâ€™ve been better if all of them had it at the same time and for the same duration. We men would get at least get three weeks in a month to live in peace!</p><p><br></p><p>The way to a manâ€™s heart is through his stomach. But a way to a womanâ€™s heart is through her ears. Bitch about another woman she hates (youâ€™ll have too many options here), and sheâ€™s all yours. Incidentally, itâ€™s also the way out. Just compliment and say good things about the same woman. I wonder why men are so simple to deal with. Beer, sex and a little money, our life is full.</p><br>When we talk about creativity, I think women are the most creative lot. Some men might debate this. Women however, are so creative because itâ€™s them who create all the problems that exist on the planet! Their creativity in the bedroom as well can justify them being creative lot. Another example of them being creative is their creativity in expressions. The expression on a womanâ€™s face rarely matches her statement. I once asked a friend of mine, â€œDo you like the man you just met, and spoke with for an hour?â€ She was all excited, and got all pink as she was blushing a lot. With a twinkle in her eyes she said, â€œThat man! Heâ€™s such a pervert.â€ I was in a fix whether I should go by her expression or by her statement. Basically, attention is all they need to go ga ga over a man. Ainâ€™t they creative?', 'Publish to Self', '1350128483', 'piclogs/thumb_1350128384.jpg', 'women_weirdly_wired_'),
