(18, 11, 'piclogs/resize_1350148934.jpg', 'www.google.com', 6, 'An Introduction: An Introspection', '<font>\n\n</font><p><strong>I dedicate this entry to Mr Layne Staley.</strong> <strong>May his soul rest in\npeace.</strong></p><font>\n\n</font><p>Thereâ€™s a constant struggle between my love for music and the\nhelplessness of not being able to do anything in that direction. Those who\ncanâ€™t do, write, I suppose. But itâ€™s not all bad. By writing, I want to reach\nout to those people who listen to a song, buy that album, download the\ndiscography, own a vinyl, all in memory of that moment when the music mattered.\nI bet, among these people, there are many who go through the same emotion I am\nright now â€“ that feeling of regret, the feeling of owning a guitar and not knowing\nhow to play it, the feeling of having a voice and not having a microphone to\nsing into. But none of that matters, as long as I have an ear and the sound of\nmusic blowing into it.</p><font>\n\n</font><p>Music, such a weird thing. What is music to me is noise to another, what\nis music for someone else is absolute garbage in my opinion, but this doesnâ€™t\nstop me from respecting these artists, because they all had something I never\ndid. The guts to stand up for my passion. It is because of subjectivity that\nthe kind of music I worship is sometimes unacceptable and almost always\nmisconstrued by most of the people Iâ€™ve come across in my life. </p><font>\n\n</font><p>I grew up listening to what my sisters listened to. There was a whole\nwide range of what they were into. Whatever was â€œhepâ€ at the time was what they\nlistened to. Whether it was the Spice Girls or Bon Jovi, MC Hammer or Roxette,\nMadonna or Kenny G. It was all there where my sisters and I used to sit. As I\ngrew up from a five or six year old to a twenty four year old, there have been\nchanges of all sorts. Through each of these changes, there is one thing that remained\nconstant. My love for music. Music is not a hobby, itâ€™s a way of life. The kind\nof music you listen to defines the kind of person you are.</p><font>\n\n</font>', 'Publish to Self', '1350149713', 'piclogs/thumb_1350148934.jpg', 'an_introduction_an_introspection'),
(19, 7, 'piclogs/resize_1350224910.jpg', 'ME!', 6, 'The Time Machine!', '<p> â€œWe all have our\ntime machines. Some take us back, they''re called memories. Some take us\nforward, they''re called dreams.â€ - Jeremy Irons</p>', 'Publish to All', '1350227682', 'piclogs/thumb_1350224910.jpg', 'the_time_machine_'),
(22, 4, 'piclogs/resize_1350303225.jpg', 'Google', 15, 'Rahul Dravid - The Cricketing Genius!', '<p>Rahul Dravid, the name which is synonymous with decency and decorum of the highest order even in the most testing conditions. In a career which spanned more than 16 years of international cricket before confining now only to IPL, this extraordinary gentleman''s imposing record might well reflect the true spirit of the game too. There was not a single instance which triggered off a serious debate questioning his integrity and dignity on the cricket field in his illustrious career. One of the best cricketing heroes India could ever produce. He is an epitome of class and sensibility. There has never been an instance that Dravid was accused for his ill behaviour with his team mates or violating any rules of the game. I still havenâ€™t found anyone who can hit a square cut boundary like he does. He is a true inspiration to any youngster who wants to make a career in the cricketing world. Like Sachin quotedâ€ There can never be a 2<sup>nd</sup> Rahul Dravidâ€ .He is truly a class apart from the people we have and an unsung hero in the Indian cricket whose contribution has gone unnoticed most of the times. Im proud to be born in the Era of indian cricket where I grew up watching a legend like him.</p><p><br></p><p>This is a small tribute from one of the most ardent fan he could ever get.</p>', 'Publish to All', '1350303547', 'piclogs/resize_1350303225.jpg', 'rahul_dravid_the_cricketing_genius_'),
(25, 2, 'piclogs/resize_1350386732.jpg', 'sharath', 10, 'Rome wasn''t built in a day', '<p>Rome\nwasn''t built in a day, so as this Piclog network...</p>\n\n<p>If we check most popular\nnetworking sites like facebook and twitter''s evolution, we see that those were\nprimarily neglected later people got used it and now they are addicted to them.\nBut Piclog isn''t that kind. It is a unique kind of networking with no such\nsilly entertainments. It only provokes the creativity within us. Donâ€™t believe\nthen why donâ€™t you try it by yourself. Add a creative work which is created by\nyou and make some followers and check out the suggestions and explanations for\nyour Piclog. Piclog:- picking a log of words to describe and quote a creative\nthought. That is the meaning I got for Piclog.</p>\n\n<p></p>', 'Publish to All', '1350386994', 'piclogs/thumb_1350386732.jpg', 'rome_wasn_t_built_in_a_day'),
(26, 10, 'piclogs/resize_1350390352.jpg', 'Google', 6, 'Karma', 'Karma in Indian religions is the concept of "action" or "deed", understood as that which causes the entire cycle of cause and effect originating in ancient India.<div>Karma is not punishment or retribution but simply an extended expression or consequence of natural acts. Karma means "deed" or "act" and more broadly names the universal principle of cause and effect, action and reaction, that governs all life.</div><div>&nbsp;The effects experienced are also able to be mitigated by actions and are not necessarily fated. That is to say, a particular action now is not binding to some particular, pre-determined future experience or reaction, it is not a simple, one-to-one correspondence of reward or punishment.</div><div>Karma is not fate, for humans act with free will creating their own destiny. According to the Vedas, if one sows goodness, one will reap goodness; if one sows evil, one will reap evil.</div><div>Karma refers to the totality of our actions and their concomitant reactions in this and previous lives, all of which determines our future. The conquest of karma lies in intelligent action and dispassionate response.</div>', 'Publish to All', '1350390569', 'piclogs/thumb_1350390352.jpg', 'karma'),
(28, 1, 'piclogs/resize_1350392202.jpg', 'Ravikanth Katkam', 7, 'World''s Oldest Living Tree', 'The world''s oldest recorded tree is a 9,550 year old spruce in the Dalarna province of Sweden. The spruce tree has shown to be a tenacious survivor that has endured by growing between erect trees and smaller bushes in pace with the dramatic climate changes over time', 'Publish to All', '1350392254', 'piclogs/thumb_1350392202.jpg', 'world_s_oldest_living_tree'),
(31, 1, 'piclogs/resize_1350465004.jpg', 'Ravikanth Katkam', 8, 'When we limit ourselves with low expectations', 'When we limit ourselves with low expectations, the growth of the tree of happiness ceases. The power of growth, of improvement, the power to overcome all stagnation and break through every obstacle and transform a barren wasteland into a verdant field--that unstoppable power of hope resides right within your own heart.', 'Publish to All', '1350465130', 'piclogs/thumb_1350465004.jpg', 'when_we_limit_ourselves_with_low_expectations'),
(32, 1, 'piclogs/resize_1350465218.jpg', 'Ravikanth Katkam', 8, 'Power of goals', '"A man without a goal is like a ship without a rudder."- Thomas Carlyle<div><br></div><div><strong>Goals + Choices + Commitment = Your Results</strong></div><div><strong><br></strong></div><div><strong>5 strategies for success:</strong></div><div><strong><br></strong></div><div><strongstyle="color: rgb(44,="" 44,="" 44);="" font-family:="" arial,="" helvetica,="" sans-serif;="" font-size:="" 12px;="" line-height:="" 15px;="" "="">1. Write Down Your Goals</strongstyle="color:></div><div><strongstyle="color: rgb(44,="" 44,="" 44);="" font-family:="" arial,="" helvetica,="" sans-serif;="" font-size:="" 12px;="" line-height:="" 15px;="" "="">2. Craft Clear-Cut Goals That Add Meaning to Your Life</strongstyle="color:></div><div><strongstyle="color: rgb(44,="" 44,="" 44);="" font-family:="" arial,="" helvetica,="" sans-serif;="" font-size:="" 12px;="" line-height:="" 15px;="" "=""><strongstyle="color: rgb(44,="" 44,="" 44);="" font-family:="" arial,="" helvetica,="" sans-serif;="" font-size:="" 12px;="" line-height:="" 15px;="" "="">3. Pursue a Goal that is a Tier One Priority</strongstyle="color:></strongstyle="color:></div><div><strongstyle="color: rgb(44,="" 44,="" 44);="" font-family:="" arial,="" helvetica,="" sans-serif;="" font-size:="" 12px;="" line-height:="" 15px;="" "=""><strongstyle="color: rgb(44,="" 44,="" 44);="" font-family:="" arial,="" helvetica,="" sans-serif;="" font-size:="" 12px;="" line-height:="" 15px;="" "="">4. Take Small Steps</strongstyle="color:></strongstyle="color:></div><div><strongstyle="color: rgb(44,="" 44,="" 44);="" font-family:="" arial,="" helvetica,="" sans-serif;="" font-size:="" 12px;="" line-height:="" 15px;="" "=""><strongstyle="color: rgb(44,="" 44,="" 44);="" font-family:="" arial,="" helvetica,="" sans-serif;="" font-size:="" 12px;="" line-height:="" 15px;="" "="">5. Set a Target Date</strongstyle="color:></strongstyle="color:></div>', 'Publish to All', '1350465413', 'piclogs/thumb_1350465218.jpg', 'power_of_goals'),
(33, 1, 'piclogs/resize_1350465503.jpg', 'Ravikanth Katkam', 8, 'Reasons Why Some People Fail While Others Succeed', 'Success in any endeavour does not happen by chance. It happens through the application of sound principles and purposeful actions. Successful people think and act like a child. I donâ€™t mean though that they act childish or immature. When I say theyâ€™re like a child, they have significant curiosity and thirst for learning.<div><br></div><div>"Try not to become a man of success, but rather try to become a man of value" - Albert Einstein</div>', 'Publish to All', '1350465647', 'piclogs/resize_1350465503.jpg', 'reasons_why_some_people_fail_while_others_succeed'),
(41, 10, 'piclogs/resize_1350735103.jpg', 'Google', 7, 'Taal Volcano ', '<u>Taal Volcano, Batangas, Philippines</u><div><br></div><div><p></p><p></p><p></p><p>One need not be an experienced mountaineer to trek Taal Volcano, mainly for three reasons: the trail is so easy; the volcano is quite small; and lastly, you can ride a horse from ground zero to the top.</p><p>Famous for being the smallest active volcano in the world, Taal Volcano is actually a volcano within a lake (which used to be an old crater) within an island of Luzon, Philippines. Bounded by the provinces of Cavite and Batangas, it is just around 60 kilometers south-southeast of Metropolitan Manila.</p><p><br></p><p></p><p>Volcanologists described it as a small volcanic island, called as Volcano Island, located within a 20 x 30 kilometer lake-filled complex caldera called Taal Lake (Lake Bonbon), which was tagged as one of the great volcano-tectonic depressions of the world. Due to its proximity to highly populated areas, Taal is one of 16 â€œDecade Volcanoesâ€ that have been identified by the volcanology community as presenting large potential hazards to population centers.</p><p>But despite the danger it possess, Taal Volcano has its unique charm. A trek to its old crater is a different adventure that is worth the all the danger and exhaustion.</p><p></p><br></div><p></p><p><br></p><p></p>', 'Publish to All', '1350736725', 'piclogs/thumb_1350735103.jpg', 'taal_volcano_'),
(35, 10, 'piclogs/resize_1350558255.jpg', 'Google', 6, 'Understanding', 'Peace cannot be kept by force; it can only be achieved by understanding.<div><br>Peace cannot be achieved through violence, it can only be attained through understanding.<br><br></div><div>Understanding (also called intellection) is a psychological process related to an abstract or physical object, such as a person, situation, or message whereby one is able to think about it and use concepts to deal adequately with that object. Understanding is a relation between the knower and an object of understanding. Understanding implies abilities and dispositions with respect to an object of knowledge sufficient to support intelligent behavior.</div>', 'Publish to All', '1350559578', 'piclogs/resize_1350558255.jpg', 'understanding'),
(36, 10, 'piclogs/resize_1350560353.jpg', 'Ramesh ', 12, 'A Telmple in Thanjavur', '<h3><span style="font-weight: normal;">Brihadeswara Temple in Thanjavur&nbsp;</span></h3><h3><span style="font-weight: normal;">(Tamil Nadu)</span></h3><div><span style="font-weight: normal;"><br></span></div><div><span style="font-weight: normal;">Brihadeswara, Lord Shiva temple was built by the Cholas, constructed solely of granite, cholas built more than 70 temples in Thanjavur, in the year 2010 this temple turned 1000 years old.</span></div><div><span style="font-weight: normal;"><br></span></div><div><p><font>The temple also boasts what is considered as India''s largest ''Nandi'', the bull which Lord Shiva rides, located in front of the temple tower.</font></p><p><font>The inner sanctum houses rare paintings, which were not discovered until a few decades ago. However, access to the paintings is restricted as they are in a very fragile state.</font></p></div><div><br></div><div>The Archaeological Survey of India has also taken up renovation work, while the Tamil Nadu Tourism Development Corporation has launched a virtual tour of key destinations in the state with special focus on the Big Temple to enable the locals and those overseas to have a "real kind of experience" of the tourism potential of the state, one of the most preferred tourist destinations in the country.</div><div><span style="font-weight: normal;"><br></span></div><div><p><br></p></div>', 'Publish to All', '1350561388', 'piclogs/resize_1350560353.jpg', 'a_telmple_in_thanjavur'),
(37, 10, 'piclogs/resize_1350563085.jpg', 'Ramesh', 2, 'Kanyakumari', '<div>Kanniyakumari is a town on the southern most tip of the main land of India, in the state of Tamil Nadu. It is also known as Cape Comorin.</div><div><br></div><div>Kanyakumari takes its name from the Hindu goddess Kanyakumari (also called Kumari Amman). Her temple stands on the seashore, where the Arabian Sea and the Bay of Bengal meet the Indian Ocean. 1931 Travancore census records the rule of Villavarayar kings for 800 years, and the stone engravings at Bhagavathi Amman Temple asserts it was built by Bharathar kings as a sign of reverence to the sea goddess. In his work on ancient India, Ptolemy had identified Kanyakumari (Cape of Comorin) along with the Gulf of Mannar as a center for pearl fishery. He also identifies Korkai, a place to the east of Kanyakumari as an emporium of pearl trade.</div><div><br></div>This picture was taken near a Small town of Kanyakumari, where two seas and an ocean meet, The Bay of bengal, The Arabian Sea, and The Indian Ocean.<div><br></div><div><br></div>', 'Publish to All', '1350563658', 'piclogs/resize_1350563085.jpg', 'kanyakumari'),
(38, 10, 'piclogs/resize_1350564032.jpg', 'Ramesh', 12, 'Hope of Light  in the Dark', '<dt></dt><dt>Hope begins in the dark, the stubborn hope that if you just show up and try to do the right thing, the dawn will come. You wait and watch and work: You don''t give up.</dt><dt><br></dt><dt><br></dt><dt>-Anne Lamott</dt>', 'Publish to All', '1350564566', 'piclogs/thumb_1350564032.jpg', 'hope_of_light_in_the_dark'),
(39, 10, 'piclogs/resize_1350565522.jpg', 'Ramesh', 7, 'Birds', 'I took this picture near Osman Sagar also known as Gandipet in Hyderabad, when i was trying my new lens.<div><br></div><div><div>Lesson Learned: while taking the picture of Birds, most important thing is to be&nbsp;patience, one wrong step and you miss the best shot.</div></div>', 'Publish to All', '1350566662', 'piclogs/resize_1350565522.jpg', 'birds'),
(42, 10, 'piclogs/resize_1350786144.jpg', 'Wikipedia', 12, 'Award winning prize', 'Picture Taken a photographer - Kevin Carter<div><br></div><div>In March 1993, while on a trip to Sudan, Carter was preparing to photograph a starving toddler trying to reach a feeding center when a vulture landed nearby. Carter reported to taking the picture, because it was his "job title", and leaving. He came under criticism for failing to help the girl:</div>The St. Petersburg Times in Florida said this of Carter: "The man adjusting his lens to take just the right frame of her suffering, might just as well be a predator, another vulture on the scene."Sold to the New York Times, the photograph first appeared on 26 March 1993 and was carried in many other newspapers around the world. Hundreds of people contacted the Times to ask the fate of the girl. The paper reported that it was unknown whether she had managed to reach the feeding center. In 1994, the photograph won the Pulitzer Prize for Feature Photography.', 'Publish to All', '1350786339', 'piclogs/thumb_1350786144.jpg', 'award_winning_prize'),
(43, 10, 'piclogs/resize_1350831528.jpg', 'Google', 6, 'Inspiration', '<div>Nicholas James Vujicic was born on 4th December 1982 is a Serbian Australian evangelist and motivational speaker born with tetra-amelia syndrome, a rare disorder characterised by the absence of all four limbs.&nbsp;</div><div><br></div><div>As a child, he struggled mentally and emotionally as well as physically, but eventually came to terms with his disability and, at the age of seventeen, started his own non-profit organisation, Life Without Limbs. Nick presents motivational speeches worldwide, on life with a disability, hope and finding meaning in life. He also speaks about his belief that God can use any willing heart to do his work and that God is big enough to overcome any and all disabilities.</div><div><br></div><div><br></div>', 'Publish to All', '1350831989', 'piclogs/thumb_1350831528.jpg', 'inspiration'),
(44, 10, 'piclogs/resize_1350832065.jpg', 'Google', 3, 'Ikea', 'There is a new product in IKEA Catalogue: a light bulb. Extra efficient and extra durable.&nbsp;<div><br></div><div><br></div><div>This creative print advertisement was made by JWT Agency.</div><div><br></div><div>Credits goes to Mariusz Pitura (Creative Director) and Bartosz Palasek (Art Director )&nbsp;</div>', 'Publish to All', '1350836479', 'piclogs/thumb_1350832065.jpg', 'ikea'),
(45, 4, 'piclogs/resize_1350887275.jpg', 'Shutterstock', 3, 'Client Servicing - Boon or Bane?', '<p>My idea\nof advertising has changed over a period of time ever since i started my career\nin client servicing, 2008. The clients have gotten better, so are my\nexperiences in handling them. I wonder how people from different walks of life\nshare the same thought process! I always felt no two people can think alike but\nto my surprise - CLIENTS do! Few things are exactly common between them and\nthat being - "Iam always\nright" and â€œi wont take anyone else''s opinionâ€. I would never give up in\nputting my point across though they take it or not. It''s purely for self\nsatisfaction that i would not want to regret later for not saying what i\nbelieved in. Client servicing is one of the most crucial profile in the\nadvertising industry which mostly sets the difference between various agencies.\nI get to hear alot of client experiences with various agencies &amp; media\nprofessional with regards to their attitude and style of working. It is\ndifficult to please everyone at all point of time. There needs to be this right\nkind of comfort zone between the client servicing manager and the client to get\n the desired output. It''s a normal human\ntendency of not opening up to people\nwhom we aren''t very comfortable with. With regards to the advertising business,\nits very important that these two people gel with for the smooth functioning of\nthe entire work cycle.Every interaction, be it over telephone or in person\nneeds to be taken with utmost attention as it will leave something to take\nback, learn and improve. Trust me, gaining a client''s confidence is worth a\nbillion and sustaining is a TASK! A client servicing manager is the SPOC between\nthe Agency and the client and plays a vital role in striking the right balance!</p>', 'Publish to All', '1350887457', 'piclogs/resize_1350887275.jpg', 'client_servicing_boon_or_bane_'),
(46, 10, 'piclogs/resize_1350905169.jpg', 'Google', 11, 'Jolly Buoy Island', 'Jolly Buoy Island, Port Blair<div><br></div><div>Jolly buoy island is very famous for under water corals and the pristine clear beach. At&nbsp;Jolly Buoy you will get to see corals (red, blue, sponge corals etc). Also you will be able to see life within these corals (particularly zebra fish). There is another island called<b>&nbsp;</b>Red Skin Island<b>, </b>this place is one hour journey from Wandoor beach. Snorkeling and scuba diving are available here.</div>To reach Jolly buoy island people have to come to Wandoor beach. This is located in Mahatma Gandhi National Park. Wandoor beach is 30 Kms from Port Blair by road. This route is same for visiting Red Skin island also. Both Jolly buoy and Red skin are located at Mahatma Gandhi National park. &nbsp;Jolly buoy is a No Plastic zone.&nbsp;<div><br><div><br></div></div>', 'Publish to All', '1350905806', 'piclogs/thumb_1350905169.jpg', 'jolly_buoy_island'),
(47, 2, 'piclogs/resize_1350906875.jpg', 'Sharath chandra', 3, 'Igniting my skills', '<p>This is a piece of art,\nWhich I made it to inspire picloggers and to elevate myself in the world of\npiclog. some explain with words and some with pictures. But I want to try both\nso I got this for you all. Let me know how you feel about this pic and explain\nit in your own words. Click, connect, blog, browse etc., are such simple words\nwhich make great impact while we implement them. This picture isnâ€™t of words,\nbut it is an expression of Piclog itself. It is rolling fast to make a bash with\na combination of words and pictures. So, whatâ€™s your point about my PICâ€¦?</p>', 'Publish to All', '1350907740', 'piclogs/thumb_1350906875.jpg', 'igniting_my_skills'),
(48, 24, 'piclogs/resize_1350908559.jpg', 'Anonymous', 7, 'Tulips!', '<font face="comic sans ms">The brightness in those t</font>ulips could brighten up your day!<br>', 'Publish to All', '1350908799', 'piclogs/resize_1350908559.jpg', 'tulips_'),
(49, 10, 'piclogs/resize_1350908551.jpg', 'Google', 5, 'Evolution of Apple Logo', 'Apple''s first logo, designed by Ron Wayne, depicts Sir Isaac Newton sitting under an apple tree,<div><br></div><div>It was almost immediately replaced by Rob Janoff''s "rainbow Apple", the now-familiar rainbow-colored silhouette of an apple with a bite taken out of it. Janoff presented Jobs with several different monochromatic themes for the "bitten" logo, and Jobs immediately took a liking to it, While Jobs liked the logo, he insisted it be in color to humanize the company.</div><div>The logo was designed with a bite so that it would not be confused as another fruit. The colored stripes were conceived to make the logo more accessible, and to represent the fact the Apple II could generate graphics in color.</div><div>&nbsp;This logo is often erroneously referred to as a tribute to Alan Turing, with the bite mark a reference to his method of suicide. Both Janoff and Apple deny any homage to Turing in the design of the logo.<br><br></div><div>Steve Jobs and Steve Wozniak were Beatles fans, but Apple Inc. had trademark issues with Apple Corps Ltd., a multimedia company started by The Beatles in 1967, involving their name and logo. This resulted in a series of lawsuits and tension between the two companies. These issues ended with settling of their most recent lawsuit in 2007.</div>', 'Publish to All', '1350909089', 'piclogs/thumb_1350908551.jpg', 'evolution_of_apple_logo');
INSERT INTO `upload_piclog` (`upid`, `uid`, `picture`, `courtesy`, `category_id`, `title`, `write_up`, `publish`, `timestamp`, `thumb`, `piclog_url`) VALUES
(50, 10, 'piclogs/resize_1350909385.jpg', 'Google', 12, 'Silicon Valley', 'Silicon Valley is the southern region of the San Francisco Bay Area in Northern California in the United States. The region, whose name derives from the Santa Clara Valley in which it is centered, is home to many of the world''s largest technology corporations as well as thousands of small startups.<div>Despite the development of other high-tech economic centers throughout the United States and the world, Silicon Valley continues to be the leading hub for high-tech innovation and development, accounting for one-third (1/3) of all of the venture capital investment in the United States.</div><div>Some of the notable companies in Silicon Valley are "Apple Inc", "Adobe Systems", "Cisco Systems", "Google", "HP", "Intel" and many more,<br><br></div><div>Notable Universities in Silicon Valley are "Stanford University", "University of California", "Carnegie Mellon University", etc.<br></div>', 'Publish to All', '1350910099', 'piclogs/thumb_1350909385.jpg', 'silicon_valley'),
(51, 10, 'piclogs/resize_1350910350.jpg', 'FPA Australia', 10, 'Smoking', 'Smoking is one of the leading causes of preventable death globally,<div>&nbsp;Male and female smokers lose an average of 13.2 and 14.5 years of life, respectively.</div><div>&nbsp;At least half of all lifelong smokers die earlier as a result of smoking.&nbsp;</div><div>The risk of dying from lung cancer before age 85 is 22.1% for a male smoker and 11.9% for a female current smoker, in the absence of competing causes of death.&nbsp;</div><div>The corresponding estimates for lifelong nonsmokers are a 1.1% probability of dying from lung cancer before age 85 for a man of European descent, and a 0.8% probability for a woman. Smoking one cigarette a day results in a risk of heart disease that is halfway between that of a smoker and a non-smoker</div>', 'Publish to All', '1350911264', 'piclogs/thumb_1350910350.jpg', 'smoking'),
(52, 10, 'piclogs/resize_1350912098.jpg', 'Google', 11, 'Travel out of the space', '<div>The world''s first commercial spaceline. Virgin Galactic team is working hard to make access to space orders of magnitude more affordable, frequent, and safe than ever before.&nbsp;</div><div><br></div>Virgin Galactic is a company within Richard Branson''s "Virgin Group", which plans to provide sub-orbital spaceflights to space tourists, suborbital launches for space science missions and orbital launches of small satellites. Further in the future Virgin Galactic hopes to offer orbital human spaceflights as well. Virgin Galactic''s spacecraft are launched from a large aeroplane, giving the spacecraft more initial speed and altitude than if it was launched from the ground.<div><br></div><div>Price of the Ticket is $200,000</div>', 'Publish to All', '1350913115', 'piclogs/thumb_1350912098.jpg', 'travel_out_of_the_space'),
(53, 4, 'piclogs/resize_1350911666.jpg', 'Shutterstock', 6, 'Yesterday, Tomorrow & TODAY!', '<p><font face="helvetica">Living in the present moment can be\nchallenging for many of us and the interesting thing is that not too many\npeople understand that.</font></p><p><br><font face="helvetica"> </font></p><p><font face="helvetica">â€œ<em>The\nsecret of health for both mind and body is not to mourn for the past, not to\nworry about the future, or not to anticipate troubles, but to live in the\npresent moment wisely and earnestlyâ€</em> -Buddha</font></p>\n\n<p><font face="helvetica"><br></font></p>\n\n<p><font face="helvetica">Today I want to share with you a piclog about the power of the\npresent moment and why is it so important to train our minds to stay focussed on TODAY - There are two days in every week\nabout which we should not worry.<br>\nTwo days which should be kept free\nfrom fear and apprehension.</font></p>\n\n<p><font face="helvetica">One of these days is yesterday with\nits mistakes and cares,</font></p>\n\n<p><font face="helvetica">Its faults and blunders, Its aches and pains.</font></p>\n\n<p><font face="helvetica">yesterday has passed\nforever beyond our control.</font></p>\n\n<p><font face="helvetica">All the money in the world cannot bring back yesterday.<br></font></p>\n\n<p><font face="helvetica">We cannot undo a single act we performed.</font></p>\n\n<p><font face="helvetica">We cannot erase a single word we\nsaid, <br></font></p><p><font face="helvetica">Yesterday is gone.</font></p>\n\n<p><font face="helvetica">The other day we should not worry about is tomorrow.</font></p>\n\n<p><font face="helvetica">With its possible adversities, Its burdens,</font></p>\n\n<p><font face="helvetica">Its large promise and poor performance.</font></p>\n\n<p><font face="helvetica">Tomorrow is also\nbeyond our immediate control.</font></p>\n\n<p><font face="helvetica">Tomorrowâ€˜s sun will rise,\neither in splendor or behind a mask of clouds,</font></p>\n\n<p><font face="helvetica">but it will rise.</font></p>\n\n<p><font face="helvetica">Until it does, we have no stake in Tomorrow, for it is yet unborn.</font></p>\n\n<p><font face="helvetica">This just leaves only one day . . . TODAY.</font></p>\n\n<p><font face="helvetica">Any person can fight the battles of just one day.</font></p>\n\n<p><font face="helvetica">It is not the experience of TODAY that drives people\nmad.</font></p>\n\n<p><font face="helvetica">It is the guilt or bitterness for\nsomething which happened yesterday.</font></p>\n\n<p><font face="helvetica">and the dread of what tomorrow may bring.</font></p>\n\n<p><font face="helvetica"><br></font></p><p><font face="helvetica">Let us therefore Live but one day at a time!</font></p>', 'Publish to All', '1350913613', 'piclogs/thumb_1350911666.jpg', 'yesterday_tomorrow_today_'),
(54, 10, 'piclogs/resize_1350941624.jpg', 'National Geographic', 11, 'River House', 'A house in the middle of the Drina River near the town of Bajina Basta, Serbia.<div><br></div><div>The long exposure and autumn colors make for a beautiful scene, but, of course, itâ€™s the house that captures my imagination. I want to know more about this dwelling with the little red kayak: Does someone live there, ferrying provisions from the shore?</div>', 'Publish to All', '1350941641', 'piclogs/thumb_1350941624.jpg', 'river_house'),
(55, 10, 'piclogs/resize_1350976449.jpg', 'National Geographic', 7, 'Fire Tornado', 'Fire Tornado or Fire Devil or Fire Whirl, is a phenomenon, rarely captured on camera in which a fire under certain conditions (depending on air temperature and currents) acquires a vertical vorticity and forms a whirl, or tornado like vertically oriented rotating column of air.<div><br></div><div>Most of the largest fire tornados are spawned from wildfires. They form when a warm updraft and convergence from the wildfire are present. They are usually 10-50 meters tall, a few meters wide, and last only a few minutes. However, some can be more than a kilometer tall, contain winds over 160 km/h, and persist for more than 20 minutes.</div>Fire whirls can uproot trees up to 15&nbsp;meters&nbsp;(49 ft) tall. These can also aid the ''spotting'' ability of wildfires to propagate and start new fires.Visually impressive fire whirls may be encountered during dry wind gusts at the annual Burning Man festival in Nevada''s Black Rock Desert, late on Saturday or Sunday evening during the burning of The Man or Temple, respectively', 'Publish to All', '1350976822', 'piclogs/thumb_1350976449.jpg', 'fire_tornado'),
