(233, 4, 'piclogs/resize_1362171174.jpg', 'Google', 6, 'A conflict within! ', '<brstyle="font-family: arial;="" font-size:="" small;"=""><blockquote><font>Well always wondered if i wanted to achieve excellence or work towards perfection. Hmm, here are a few real life instances that i have mentioned to understand the difference between the two important routes of living one''s life, in this case being MY LIFE!</font><font><br></font><font><font>Perfectionism is the individual''s belief that he or she must be perfect to be acceptable. Perfectionism is black and white with grey areas. Anything other than perfect is failure. Perfectionism is an attitude, not necessarily a behavior. In other words, two people can engage in the same behavior such as trying to win a Olympic gold metal who can be pursuing excellence and other is demanding perfection. The difference lies in the thought process about the goal or behavior not in the goal or behavior itself.</font>The pursuit of excellence is the desire to attain a goal of excellence, to achieve at a high level, to be the best that one can be but without the demand attached to the goal or desire. Pursuing excellence may require tremendous effort and focus as well other attributes.</font><font><br></font><font>The perfectionist criticizes him or herself for failure and mistakes often very harshly: "I''m so lazy and stupid." I often have this inner conflict with "Would you say that to someone you love? Then, don''t say it to yourself." However, the pursuer of excellence is willing to examine his or her performance and personal vulnerabilities so as to improve. Yet, this examination is conducted in a gentle way without harsh labels or comments.</font><font>The pursuer of excellence sees others as partners in the achievement of their goals. They view advice as constructive criticism and seek it out. Whereas, the perfectionist views others as potential critics and fear blame from others. As a result, they avoid feedback and their world tends to be viewed more competitively and rationally which then reinforces the view of danger from others. For instance, if someone states, "I think if you took this stance when swinging the club you could hit it farther" they would see the statement as criticism saying that they can''t play golf whereas the pursuer of excellence would welcome the suggestion and act upon it.</font><font><br></font><font>The pursuer of excellence desires to risk failure because of the benefits that occur from taking a risk. He or she is able to do this because failure isn''t personalized and annoying as a result. However, the perfectionist prefers to avoid failure and therefore often performs at a lower level than he or she is capable. They will often report "I know I''m capable of more. I''m just afraid to try." Their need to avoid failure is due to the high cost of failure to their self-esteem: "If I fail, I am a miserable failure." Whereas, the pursuer of excellence believes "I was willing to take a risk and try something that most people aren''t even willing to try. So, no matter what the outcome is, I feel successful because I challenged myself."</font><font><br></font><font>So the question remains - Excellence or Perfection?!</font><font><br></font></blockquote></brstyle="font-family:>', 'Publish to All', '1362171303', 'piclogs/resize_1362171174.jpg', 'a_conflict_within_'),
(57, 10, 'piclogs/resize_1350986500.png', 'National Geographic', 9, 'Rescue ', 'In the African bush of Kenya, sometimes the great circle of life can be disrupted because humans do something like dig for a well. Sure, this act doesnâ€™t intend to pose a threat on the wildlife â€” until a baby elephant accidentally falls into one.<br>According to Adventure Journal and TreeHugger, a baby elephant did fall into a manmade well in Kenyaâ€™s Amboseli National Park. Fortunately a rescue squad from the Amboseli Trust came onto the scene to aid in the elephant calfâ€™s misfortune â€” but not without having to confront and chase away the concerned mother, who didnâ€™t seem to know that the humans were there to help, not harm:After the ordeal, the calf gets reunited with its mother. Hopefully, theyâ€™ll remember that not all people pose a threat to their kind â€” especially if they recognize the Amboseli trucks. This should be the case, because, as they say, an elephant never forgets.', 'Publish to All', '1350987524', 'piclogs/thumb_1350986500.png', 'rescue_'),
(60, 27, 'piclogs/resize_1351012604.jpg', 'Google search', 6, 'Deceptive Toys', '<p><font face="trebuchet ms">Unperceived by the naked eyes,<br>Their mysterious purpose unfold.<br>Affecting our everyday lives,<br>Immense significance they hold.</font></p><p></p><p><font face="trebuchet ms"><br></font></p><p><font face="trebuchet ms">Replicas of the adult world,<br>Subtly are these amusement devices designed.<br>Confining innocent minds,<br>They illucidate gender roles that have been assigned.</font></p><p></p><p><font face="trebuchet ms"><br></font></p><p><font face="trebuchet ms">She is a confined being,<br>Amidst four walls.<br>Cooking and grooming were ingrained in her,<br>With kitchen sets and Barbie dolls.</font></p><p></p><p><font face="trebuchet ms"><br></font></p><p><font face="trebuchet ms">Alternatively, his dreams have always been sky high,<br>Fluttering with aeroplanes,</font></p><p><font face="trebuchet ms">Great freedom they signify.</font></p><p></p><p><font face="trebuchet ms"><br></font></p><p><font face="trebuchet ms">This is the cryptic meaning that they imply.<br>Thereby they cease to be mere toys.</font></p>', 'Publish to All', '1351013027', 'piclogs/resize_1351012604.jpg', 'deceptive_toys'),
(61, 7, 'piclogs/resize_1351015401.jpg', 'ME!', 11, 'Beaches!', 'I have always loved the beach. The smell of the salty water, the wind in my face, the gentle roar of the waves all combine to create a sense of peace and calm.', 'Publish to All', '1351017016', 'piclogs/thumb_1351015401.jpg', 'beaches_'),
(62, 32, 'piclogs/resize_1351017438.jpg', 'God', 9, 'Fantastic Four', 'The very year we had awesome&nbsp;barbecue&nbsp;night.Those were the days of innocence before Thailand happened!! :)', 'Publish to All', '1351017648', 'piclogs/resize_1351017438.jpg', 'fantastic_four'),
(63, 28, 'piclogs/resize_1351017424.jpg', 'Life n Friends', 6, 'Imagine Life Without Friends', '<font face="comic sans ms">They make you do those stupid things which you have never thought that you can do in your life.Show us the mirror when we are dreaming high and also boost our spirit high whenever you are felling low.So cherish every moment in life with your special friends,don''t know whether these moments will come back again or where these friends will go in the flow of their life.</font>', 'Publish to All', '1351018034', 'piclogs/resize_1351017424.jpg', 'imagine_life_without_friends'),
(64, 31, 'piclogs/resize_1351018687.jpg', 'City Freaks (Suresh)', 11, 'Morning shot at Nandhi hills', 'Early morning at nandhi hills,<br>the clouds touch the ground on the hill and can have a view above the clouds from the top most point of the hill..... <br>', 'Publish to All', '1351018861', 'piclogs/resize_1351018687.jpg', 'morning_shot_at_nandhi_hills'),
(65, 28, 'piclogs/resize_1351019297.jpg', 'Day Dreaming', 6, 'Its Good To Dream', '<font face="comic sans ms">Even though we know whatever we use to think &nbsp;in a single day,not all is gonna be done but still there is a hope,hope to make things better and try to make our life simpler by new creative ideas.Even i use to think to do something big every single day, but i could not finish it in the end of the day still it never break be in that way i had stopped dreaming something big.So thinking something big is not bad at all,it help you to move on in life by setting the missiles of your dedication towards your goals.</font>', 'Publish to All', '1351019427', 'piclogs/thumb_1351019297.jpg', 'its_good_to_dream'),
(66, 28, 'piclogs/resize_1351020652.jpg', 'Tracking in McLeodganj', 11, 'Spend Some Time With Nature', '<font face="comic sans ms">Its always feels good when you free yourself from the beeping of your cellphone and random popping mails.Give a break to your life and take a walk with nature.</font>', 'Publish to All', '1351020664', 'piclogs/resize_1351020652.jpg', 'spend_some_time_with_nature'),
(67, 28, 'piclogs/resize_1351021252.jpg', 'Peace with love', 7, 'Love Is Black And White', '<font face="comic sans ms">Wonderful people are carefully created by God, wonderful moments are fully planned by God, wonderful friends are carefully gifted by God.</font>', 'Publish to All', '1351021582', 'piclogs/resize_1351021252.jpg', 'love_is_black_and_white'),
(144, 302, 'piclogs/resize_1351525993.jpg', 'google', 8, 'Lady In The Deep', '<p><strong><em>As I look into the water</em></strong></p>\n\n<p><strong><em>I see her standing there.</em></strong></p>\n\n<p><strong><em>So still, so serene;</em></strong></p>\n\n<p><strong><em>Yet she is, trying hard to care.</em></strong></p><p><strong><em><br></em></strong></p>\n\n<p><strong><em></em></strong></p>\n\n<p><strong><em>I bent a little lower </em></strong></p>\n\n<p><strong><em>To take a better look;</em></strong></p>\n\n<p><strong><em>And for a moment I felt,</em></strong></p>\n\n<p><strong><em>Her dark brown hair shook.</em></strong></p>\n\n<p><strong><em></em></strong></p>\n\n<p><strong><em><br></em></strong></p><p><strong><em>As the waves flow gently</em></strong></p>\n\n<p><strong><em>From side to side,</em></strong></p>\n\n<p><strong><em>I see her eyes cast down</em></strong></p>\n\n<p><strong><em>As if, a newlywed bride.</em></strong></p>\n\n<p><strong><em></em></strong></p>\n\n<p><strong><em><br></em></strong></p><p><strong><em>I adore her beauty</em></strong></p>\n\n<p><strong><em>Needless to say;</em></strong></p>\n\n<p><strong><em>I see a plead in her eyes,</em></strong></p>\n\n<p><strong><em>Like she, wanted me to stay.</em></strong></p>\n\n<p><strong><em></em></strong></p>\n\n<p><strong><em><br></em></strong></p><p><strong><em>Something about her,</em></strong></p>\n\n<p><strong><em>I canâ€™t let go;</em></strong></p>\n\n<p><strong><em>The more I see her,</em></strong></p>\n\n<p><strong><em>The more I want to know.</em></strong></p>\n\n<p><strong><em></em></strong></p>\n\n<p><strong><em><br></em></strong></p><p><strong><em>Who are you? Oh lady!</em></strong></p>\n\n<p><strong><em>With pain buried, in your heart.</em></strong></p>\n\n<p><strong><em>I see you long for someone,</em></strong></p>\n\n<p><strong><em>Who is now far apart. </em></strong></p>\n\n<p><strong><em></em></strong></p>', 'Publish to All', '1351527407', 'piclogs/resize_1351525993.jpg', 'lady_in_the_deep'),
(145, 302, 'piclogs/resize_1351527739.jpg', 'Google', 6, 'SECOND CHANCE', '<p><br></p>\n\n<p></p>\n\n<p><em><font face="times new roman">Walking down a broken road</font></em></p>\n\n<p><em><font face="times new roman">I halt at a lonesome stance.</font></em></p>\n\n<p><em><font face="times new roman">Wondering what it would be like</font></em></p>\n\n<p><em><font face="times new roman">If I had, a second chance.</font></em></p><p><em><font face="times new roman"><br></font></em></p>\n\n<p><font face="times new roman"><em></em></font></p>\n\n<p><em><font face="times new roman">Paths that we choose in life,</font></em></p>\n\n<p><em><font face="times new roman">Are often not by our choice;</font></em></p>\n\n<p><em><font face="times new roman">Gifted, as these may come</font></em></p>\n\n<p><em><font face="times new roman">We shed a tear &amp; then rejoice.</font></em></p>\n\n<p><font face="times new roman"><em></em></font></p>\n\n<p><em><font face="times new roman"><br></font></em></p><p><em><font face="times new roman">To stand up for the world,</font></em></p>\n\n<p><em><font face="times new roman">We shall never step back.</font></em></p>\n\n<p><em><font face="times new roman">To stand up for ourselves,</font></em></p>\n\n<p><em><font face="times new roman">Is the awful strength we lack.</font></em></p>\n\n<p><font face="times new roman"><em></em></font></p>\n\n<p><em><font face="times new roman"><br></font></em></p><p><em><font face="times new roman">Whatâ€™s done, is done anyway,</font></em></p>\n\n<p><em><font face="times new roman">Why bother changing it now?</font></em></p>\n\n<p><em><font face="times new roman">Even if I did have a second chance</font></em></p>\n\n<p><em><font face="times new roman">Itâ€™d all be the same somehow ;)</font></em></p>\n\n<p><em></em></p>\n\n<p><em></em></p>', 'Publish to All', '1351527809', 'piclogs/resize_1351527739.jpg', 'second_chance'),
(69, 20, 'piclogs/resize_1351021074.jpg', 'Self', 8, 'Nostalgia', '<font face="comic sans ms">One meets or deals with three kinds of things/people in their life:<br>First which are valued when close to your heart: <b>Family</b><br>Second, which were valued when in the past:<br><b>Foes</b><br>Third, and the most important, the ones which are valued and generally regretted the most when lost: <br><b>Virginity and Friends</b> ;)<br><br>Thanks guys for being an integral part of my life!! :)</font><br>', 'Publish to All', '1351021869', 'piclogs/thumb_1351021074.jpg', 'nostalgia'),
(70, 20, 'piclogs/resize_1351022224.jpg', 'Saswat', 1, 'Angel From Venus ', '<br>There was this girl whom I thought I liked..<br>Who gave me happiness and sorrows alike!<br><br>She wasn''t just&nbsp; a girl, She was an Angel..<br>Angel from Venus, an angel for whom I fell!<br><br>Her eyes were blue, now you may say that''s nothing new..<br>But she was the best, a cut above the rest, and now don''t say Pheww!!<br><br>The story''s just started, long way to go..<br>How I met her, don''t you wanna know??!<br><br>One day, at a mall, during last year''s fall..<br>I went there with a bunch of friends, and Whoaa!!We had a ball..<br><br>Suddenly, something caught my attention, and I turned back,<br>And there was thing angel, dressed to kill in black..<br><br>I approached her, made friends with her, somehow got her number..<br>A red lettered day in my life: That''s 29th November!!<br><br>Wow! She was gorgeous , not to mention tall..<br>Wasn''t I convinced that: Yes!!Shez my gal..!<br><br>How foolish was I that I couldn''t foresee the future..<br>She had a BF, and his name was Richard..!<br><br>She told me he was cute, and was very fair..<br>Tell her I LOVE U!Huh! How could I even dare?!!<br><br>I still like her, I just dunno why!<br>Just can''t give up, wanna give another try...<br><br>I wish I could tell the world a story to believe...<br>There were once TWO Adams and just ONE Eve...!!<br>', 'Publish to All', '1351022849', 'piclogs/thumb_1351022224.jpg', 'angel_from_venus_'),
(71, 43, 'piclogs/resize_1351023265.jpg', 'Rahman', 8, 'Young Rahman', 'Ye un dino ki baat hai..<div>Jab mai Engineering final year me hua karta tha..</div><div><br></div><div>Jaane kyun mai itna udaas tha?</div><div>Semester exams nazdeek the, aisa lagta tha..</div><div><br></div><div>Phir wo haseen pal aaya meri zindagi me,</div><div>naazo se pali meri behen ki shaadi thi december me.</div><div><br></div><div>Pehli baar mere ghar me kisi ki shaadi thi,</div><div>Har ek zimmedaari mujh par hi tiki hui thi.</div><div><br></div><div>Uthaa liya maine saara daaromadar apne par,</div><div>Kuch naa bola mai duniya ko apne hothon ko Sii.</div><div><br></div><div>Dukh hua mujhe bahut kisi apne ka paas na hone par,</div><div>Naa jhuka in bojho se mera sarr.</div><div><br></div><div>karaake Shave aur hair cut maine pehli baar mehenge saloon me,</div><div><br></div><div>Nikal padha vida karne apni behen ki DOLI uske sasural me..</div><div><br></div><div><br></div>', 'Publish to All', '1351023787', 'piclogs/resize_1351023265.jpg', 'young_rahman'),
