(76, 45, 'piclogs/resize_1351027764.jpg', 'Vaio photography', 6, 'Lets be together..Lets move on together.. ', '<p><em><strong>A poem composed by me..!!</strong></em></p><p><em><strong><br></strong></em></p><p><em><strong>Lets be together..Lets move on together</strong></em></p>\n\n<p><em><u></u></em></p>\n\n<p><em><u><font face="comic sans ms">His\nverse:</font></u></em></p>\n\n<p><em><font face="comic sans ms">I met you a\ntime ago</font></em></p>\n\n<p><em><font face="comic sans ms">but that\nfirst moment never goes</font></em></p>\n\n<p><em><font face="comic sans ms">and</font></em></p>\n\n<p><em><font face="comic sans ms">when I see\nyou I think about you</font></em></p>\n\n<p><em><font face="comic sans ms">and when I\nthink about you I dream about you..</font></em></p>\n\n<p><em><font face="comic sans ms">Girl is what\nso spectacular </font></em></p>\n\n<p><em><font face="comic sans ms">When I use\nto hear your voice</font></em></p>\n\n<p><em><font face="comic sans ms">Listening\nthose words of my choice</font></em></p>\n\n<p><em><font face="comic sans ms">You just\ndisappeared from my life</font></em></p>\n\n<p><em><font face="comic sans ms">and never\nappeared back in my life</font></em></p>\n\n<p><em><font face="comic sans ms">every day I\nsearch for you</font></em></p>\n\n<p><em><font face="comic sans ms">while in\nnight</font></em></p>\n\n<p><em><font face="comic sans ms">when I try\nto sleep I dream about you</font></em></p>\n\n<p><em><font face="comic sans ms">and when I\ndream about you I scream about you..</font></em></p>\n\n<p><em><font face="comic sans ms">I see your\npicture hanging in front of my wall</font></em></p>\n\n<p><em><font face="comic sans ms">and use to\ncall</font></em></p>\n\n<p><em><font face="comic sans ms">not to yell\non you but to tell you</font></em></p>\n\n<p><em><font face="comic sans ms">I truly love\nyou and if I truly love you</font></em></p>\n\n<p><em><font face="comic sans ms">I wanna be\nwith you coz if Iâ€™ll be with you</font></em></p>\n\n<p><em><font face="comic sans ms">Iâ€™ll be\nalive another moment with you..</font></em></p>\n\n<p><em><font face="comic sans ms">Think about\nit</font></em></p>\n\n<p><em><font face="comic sans ms">yours only\nfan</font></em></p>\n\n<p><em><font face="comic sans ms">Waiting only\nfor my love, you..</font></em></p>\n\n<p><em><font face="comic sans ms">Lets be\ntogether..!!</font></em></p>\n\n<p> </p>\n\n<p><em><u><font face="comic sans ms">Her\nverse:</font></u></em></p>\n\n<p><em><font face="comic sans ms">What you\nthink you are a poet</font></em></p>\n\n<p><em><font face="comic sans ms">or a\nsongwriter</font></em></p>\n\n<p><em><font face="comic sans ms">you donâ€™t\neven know how to rhyme words</font></em></p>\n\n<p><em><font face="comic sans ms">on\ntypewriter</font></em></p>\n\n<p><em><font face="comic sans ms">I gave my\nbest to you</font></em></p>\n\n<p><em><font face="comic sans ms">but you show\nyour ego in everyway</font></em></p>\n\n<p><em><font face="comic sans ms">I still\nstood there in your way</font></em></p>\n\n<p><em><font face="comic sans ms">your friend\nnormaly, but dear mr.</font></em></p>\n\n<p><em><font face="comic sans ms">you act so\nabnormally</font></em></p>\n\n<p><em><font face="comic sans ms">You made me\nfeel guilty</font></em></p>\n\n<p><em><font face="comic sans ms">and you say\nyou love me</font></em></p>\n\n<p><em><font face="comic sans ms">and when you\nsay love me, you yell on me</font></em></p>\n\n<p><em><font face="comic sans ms">and when you\nyell on me, you say I spell on you..</font></em></p>\n\n<p><em><font face="comic sans ms">yea we met a\nmoment ago..</font></em></p>\n\n<p><em><font face="comic sans ms">but now\nthose days are gone</font></em></p>\n\n<p><em><font face="comic sans ms">This is the\nlast package I am sending</font></em></p>\n\n<p><em><font face="comic sans ms">Now donâ€™t\nthink about me and if you think about me</font></em></p>\n\n<p><em><font face="comic sans ms">Donâ€™t love\nme and if you love me</font></em></p>\n\n<p><em><font face="comic sans ms">Still we can\nnever be together..</font></em></p>\n\n<p><em><font face="comic sans ms">Think about\nit</font></em></p>\n\n<p><em><font face="comic sans ms">Yours so\ncalled love</font></em></p>\n\n<p><em><font face="comic sans ms">lets move on\ntogether..!!</font></em></p>\n\n<p> \n <strong><em><font face="comic sans ms">-VAIO</font></em></strong></p>', 'Publish to All', '1351028020', 'piclogs/resize_1351027764.jpg', 'lets_be_together_lets_move_on_together_'),
