(104, 147, 'piclogs/resize_1351105258.jpg', 'www.allifeel.wordpress.com', 6, 'Love Lost at First Sight', '<p>I have never had the privilege of using the status â€˜Committedâ€™ in Facebook, Orkut or even in reality. I had never fallen in love as I had my own way of choosing the right one for spending my lovely life. I decided internally that I would fall in love, only with a woman who at first sight turns me on, makes me forget myself, and rejuvenates my sleeping mind. I also felt that a bulb would glow brightly over my head like an â€˜AAHAAâ€™ factor as said in the movie â€˜Mozhiâ€™ when I meet Ms.Perfect. I was completely depressed about not getting the right girl and even felt that I would end up with a status â€˜Retired man- Single and lookingâ€™. My life was uneventful and I went on with my daily schedule from home to work and vice versa.</p><p>(Few days Laterâ€¦â€¦â€¦â€¦)</p><p>I was just leaving office at 9.30pm after a long tiring day at work and thatâ€™s when my friend Shhylesh told me that he had fallen in love with the girl he had been crazy about for a very long time. I congratulated him with the whole of my heart and thought for a moment that â€˜even a dumb fellow like him could get a girl of his choiceâ€™ and why not me.</p><p>I was completely tired after the dayâ€™s work and riding back home in the traffic at night was a curse. The whole mind and body were pleading for rest as they had been tested with extreme conditions on that day. The roads leading to my house are the busiest in the city and the volume of traffic on that road never eased at any time of the day. The signals on these roads take a long time to clear and I was racing my bike to avoid as many signals as possible. I stopped my bike with a thud, when the car in front of me stopped abiding the traffic rules. I tried escaping, but was forced to stop at the signal which was one of the longest periodical traffic clearance systems taking 5 minutes for each direction.</p><p>I turned my bike off and was just looking around like everyone else on the road. My tired eyes started scanning something, tiredness perished mentally and physically, something turned me on and I was almost on the night flight trip to Venus. I could see a bright bulb glowing above my head when I saw a blue wave passing me, near the signal and moving towards the bus stop.<br><br></p><p>I got convinced that she was my girl and was looking at her with my heartâ€™s content. She was wearing a Peacock blue synthetic sari and was as fresh as a flower with her silky hair flowing like waves on the sculptured back of hers. The chain and the ear rings with black gems and the lovely pencil heal which she wore to protect her doll like legs made her look gorgeous and seductive too. Overall, she was perfect in every way and every asset of hers (I meant her smile and her dimple) drew my attention towards her.</p><p>She was getting me mad and I felt that was the shortest time in which one could fall for a woman. I forced myself not to wink as I preferred to use every second looking at her. After a few minutes of telepathic transmissions from my side, she looked at me with her penetrating eyes decorated with kaajal and I was turned on for the first time in my life.</p><p>The time was running much faster than it normally did. I had only 5 minutes left on the signal and she understood that I was not going to take my eyes off her. It could have been normal for such beautiful women to be looked at, by guys like me standing at the signal. She did look at me with some kind of reciprocation and I thought that I might have triggered a glowing bulb over her head for the same reason it glowed over my head when I saw her. Both our eyes were fixed at each other and the signal got cleared.</p><p>I was in a dilemma on how to proceed with such a situation. A battle of thoughts was going on in my mind as I crossed the signal slowly looking at each other. I thought that this was something which I have been waiting for a very long time and decided not to let an opportunity go to the drains. After a lot of thought, I stopped my bike at the far end of the bus stop not intending to take the risk of telling her directly about how I felt about her. I just convinced myself saying that she would come looking for me if she felt the same and was looking at her from the rear view mirror.</p><p>She looked on both the sides and started walking towards me. â€œObjects in the mirror are closer than they appearâ€ and I was looking at her from the mirror. She was closing down near me and was standing close to my left, giving me the shock of my life. She waited for all people to disperse and looked at me with the same seductive eyes and the killing smile. I was looking at her with a lot of expectation and thatâ€™s when her sweet voice whispered â€œSaw you looking at me. Interestedâ€¦ Rs.2000 per nightâ€.</p><p>I got shocked at such a question and I sped away from her without talking a word to her. I was unfortunate not to get the right girl . I laughed at myself for not giving importance for the bulb which glowed over my head when I saw her.</p><p>It was a red lightâ€¦â€¦â€¦ and there she was from.</p><p>Idhuvum Kadandhupogum<br>maya</p>', 'Publish to All', '1351105576', 'piclogs/resize_1351105258.jpg', 'love_lost_at_first_sight'),
