(108, 9, 'piclogs/resize_1351144983.jpg', 'www.allcomedypics.com', 5, 'Men will be men... or is it?!!', '<p>With a chapter dedicated to women, how can we leave men behind? There are a few things that men can never control - drools, eyeballs, and arousal. Itâ€™s a known fact that women get more attention from men compared to what men get from women. Thatâ€™s the reason this lot is always out in the open ready to exploreâ€¦ women!</p><p><br></p><p>I know this couple who quarrel over petty issues. But all in all they make a sweet couple. Just three months after they got married, the wife started suspecting the husband for infidelity. One day she decided to ask him straight, â€œAre you having an affair? Are you cheating on me and sleeping with someone else?â€ To this, the husband replied, â€œNo, Iâ€™m not. I swear I am faithful to you.â€ The wife didn''t buy what the husband had to say. Finally, the husband broke the news. â€œI didn''t sleep with any other woman as no one was ready to!â€</p><p><br></p><p>Men are desperate by nature. Being desperate is still good but theyâ€™re also impatient. The moment a suave beauty manages to grab their eye-balls (it starts from eye-balls and leads on toâ€¦), the very next moment they picture themselves in bed with her. Itâ€™s that simple for men. The idea of roses, greeting cards, wine, and love songs is just forced on to them.</p><p><br></p><p>People say, itâ€™s better to give men their share of personal space. Itâ€™s a known fact that men love their space. Whatâ€™s unknown is that they love their space with other women.</p><p><br></p><p>The battle of the sexes has been around for ages now. The problem aggravates when they try to understand each other.</p><p><br></p><p>Women think, for men they are mere sex objects, which is not completely hypothetical. But whatâ€™s strange is the fact that men like variety in life, so much that even pornographic collection that they save is regularly updated, which is commendable. Its variety personified. It doesnâ€™t stop at porn. Our imagination also demands variety. Thereâ€™s no repeat telecast of episodes (read sexcapades) in our imagination also. Perhaps, thatâ€™s what keeps us going!</p><p><br></p><p>If breaking virginity was possible in imagination, men would have done it to all the women on this planet.</p><p><br></p><p>Who says faithful men donâ€™t exist? There are so many of them who are faithful. Only difference is, they are faithful to each other. A man is always ready to help another in cases of infidelity. Like the infamous episode of Tiger Woods. In this case he was moving around with different women for years, and all his confidantes were men â€“ his bodyguards, chauffeur, other male staff, etc.</p><p><br>Cleanliness is another aspect that makes men stand apart. For some of them cleanliness is just a myth. From not washing hands after using the loo to cleaning the wax off their ear, thereâ€™s nothing that forms a part of their routine. The reasoning could vary from, â€œThere are germs everywhere. How does washing hands make a difference?â€ to â€œDoes taking a shower everyday make me a better human being than I am?â€</p><p><br></p><p>In fact, we''re completely against cleanliness. Basically, we''re a lazy lot. For instance, we like to iron our shirts only on one side. Also, if you really want to get more example of jobs that are half done, check out the rear side of a guy''s shoes. We basically wear our shoes and quickly use a shoe shine only on the front. And how about the rear side?? Well, who''s going to look there?!!</p><p><br></p><p>Metro-sexual males have come a long way though. Perhaps, they believe in overdoing their bit. I have known people who like to wax their chest, foreheads, hands, arms, etc. I am sure we donâ€™t have to work that hard to not get mistaken for chimpanzees.</p><p><br></p><p>Another view that contradicts the popular belief is that men are lazy. May be this holds good to men around the world. But Indian men certainly are not lazy. The rise in population is a standing example of this. <br><br>Chivalry is a thing of the past. In this age of self-service, men avoid doing anything that women may consider sweet. â€œDo-it-yourselfâ€ is the fad that men go by. But what you need to know isâ€¦ by showing a good amount of chivalry towards women, you will not have to use your hands and do-it-yourself.</p><br>Love for a man is a confused state of mind. To make things worse, for him itâ€™s an engagement with the opposite sex, who is known to complicate things. Thatâ€™s one of the reasons why homosexuals have better prospects of maintaining relationships.', 'Publish to All', '1351145059', 'piclogs/resize_1351144983.jpg', 'men_will_be_men_or_is_it_'),
