(130, 263, 'piclogs/resize_1351269816.jpg', 'self clicked', 11, 'A breakthrough indeed!', '<p></p>\n\n<p>Taxed\nwith the everyday hustle-bustle had left me with no other way out, than to\nescape into serenity. Thatâ€™s precisely what had brought me close to a celestial\nencounter with nature. A short getaway to Almora, had not just rejuvenated my\nsenses but had also left me spellbound. Acknowledged as the Cultural Heart of\nthe Kumaon Region of Uttrakhand, Almora has an enriching history that tags\nalong. </p>\n\n<p></p>\n\n<p>A\nprecedent of an ultimate gateway that leaves you intoxicated, with the essence\nof a milieu that speaks volume. On rolling wheels that also brought along some\nvery annoying motion-sickness, my leisure journey went on. But somehow, with\nall those â€˜Upsâ€™ and â€˜Downsâ€™ (in literal\nterms), the drive came to a halt, and what I met visually surely left me\nwithout complaints.</p>\n\n<p></p>\n\n<p>A\nbreathtaking sunrise, a perfect portico to unwind with a hot cuppa and peace in\nfull reign â€“</p>\n\n<p>What\nelse could you ask for? But this time, it was complete pampering for my senses.\nWith a wardrobe that was a cut away from the boring work-wears and slippers\nthat my feet had forgotten, I was in a state, what felt almost like HEAVEN! For\nonce, I excused myself from being the only muse for the lens. Anyways, with\nnature in its full bloom, posing for me I had no regrets. This mesmerizing stay that lasted for a\ncouple of days had imprinted in my mind, the most cherished moments that Iâ€™ve\nexperienced so far. </p>\n\n<p></p>\n\n<p>With\nthe thoughts of Alomra still doing rounds in my mind, my search for\nbreakthrough continues, as Frost says, <em>â€˜I\nhave miles to go before I sleep.â€™</em></p>', 'Publish to All', '1351269916', 'piclogs/thumb_1351269816.jpg', 'a_breakthrough_indeed_'),
