(132, 24, 'piclogs/resize_1351276883.png', 'Amina Khan', 2, 'The Joy Ride!!', 'It was past midnight,<div>and I was all might...</div><div>Was taken by surprise,</div><div>with no intention of compromise...</div><div>And he took so long,</div><div>that I could have written a song !!!</div><div><br></div><div>We took the risk,</div><div>to ride the road of mist...</div><div>Straight to a place of all by-gone''s,</div><div>which made us look like joker''s with horns...</div><div>But every moment was so worth it,</div><div>would never regret even one single bit...</div>', 'Publish to All', '1351279101', 'piclogs/resize_1351276883.png', 'the_joy_ride_'),
