(138, 45, 'piclogs/resize_1351371329.jpg', 'google', 6, 'Jab tak hai Jaan- Till I am alive..!!', '<p>Realy loved Jab tak hai Jaan poem so tried to frame it in my words...</p><p><br></p><p></p><p><i>Mischievousness in your angel eyes</i></p><p><i> Insolence in your beautiful smile</i></p><p><i>Clumsiness in your unfurl hair</i></p><p><i>I will never forget</i></p><p><i>Till I am aliveâ€¦I am aliveâ€¦</i></p><p></p><p><i>Leaving my hand in mid-way</i></p><p><i>Turning away even your lovely shadow</i></p><p><i>And never turning back</i></p><p><i>I will never forgive</i></p><p><i>Till I am alive..I am aliveâ€¦</i></p><p></p><p><i>Your craziness in dancing in rain</i></p><p><i>Getting annoyed without any reason</i></p><p><i>Your cute and naughty deeds</i></p><p><i>I will always love</i></p><p><i>Till I am alive..I am alive</i></p><p></p><p><i>Fake promises which you made..</i></p><p><i>Fragile dreams shown by you</i></p><p><i>Mercilessly avoiding my prayers</i></p><p><i>I will always hate</i></p><p><i>Till I am alive..I am alive</i></p><p></p><p><i>I will never forget you..</i></p><p><i>I will never forgive you..</i></p><p><i>I will always love youâ€¦</i></p><p><i>I will always hate youâ€¦</i></p><p><i>Till I am alive..I am alive..</i></p><p></p><p><i>I will always remember you..!! </i></p><p><i>-Vaio</i></p>', 'Publish to All', '1351371594', 'piclogs/resize_1351371329.jpg', 'jab_tak_hai_jaan_till_i_am_alive_'),
(139, 290, 'piclogs/resize_1351412941.jpg', 'Self', 7, 'An encounter with nature!', 'This is my first attempt at photography. And here i had landed in this bird sanctuary on my long drive to mysore.&nbsp;<div><br></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;A natural sanctuary with migratory birds from different parts of the world. It was a nature lovers Haven. With so much to see around and a boat ride which was supposedly for 15 minutes in the lake where birds of different kinds even bats were seen hanging on 2 a tree in broad daylight.</div><div><br></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Amongst all the birds flying by this little bird in some corner caught my eye and the camera lens turned towards it. I coulnt help but zoom in to click this picture.&nbsp;</div><div><br></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Well thats how nature is i guess, everythings beautiful only if u have the eye for it.</div><div><br></div>', 'Publish to All', '1351413545', 'piclogs/resize_1351412941.jpg', 'an_encounter_with_nature_'),
(142, 3, 'piclogs/resize_1351502237.jpg', 'WIN', 6, 'Piclog - from a thought to reality!', '<p>It was a usual Saturday morning; a drive to my workplace, the Sun blazing in all its glory, the world moving around swiftly, mounting decibel levels â€“ everything that possibly could take center stage, and thatâ€™s when a thought â€“ a bug â€“ crossed my mindâ€¦ and everything came to a standstill.</p><p><br></p><p>The first word that Iâ€™d used to describe this thought was â€œimpractical!â€ I, quite predictably, locked the thought in an old rusted trunk and pushed it to a remote corner of my mind. At that point in time, it seemed logical to avoid a thought that seemed ludicrous. But I could sense how this bug was trying to escape from that pitch-black ruthless environment. It didnâ€™t really bother me initially. It was a moment of pride; I could get rid of a weed to find the ultimate solace. It was an unmatched moment that could not reflect in a web of a zillion words.</p><p><br></p><p>But somewhere I could still smell the existence of that thought on the active side of my mind. Itâ€™s like marijuana that leaves its remains, a relationship that leaves its pain, a life that leaves its nameâ€¦ for time to come. But I was reluctant to accept the fact that the left-over of a thought is, sometimes, stronger than its mere existence. It was a perception that ruled out common-sense, reality and belief; it was an illusion.</p><p><br></p><p>All this occurred in split seconds. I wasnâ€™t really vindicated. But I, somewhere deep down inside, knew that this is how it was meant to be. Sometimes we end up taking a decision without thinking; we look back to analyze, and feel that weâ€™d have taken a similar call even if we had the luxury of time. Thatâ€™s exactly what happened with this thought, that I felt, didnâ€™t deserve my attention.</p><p><br></p><p>The efforts of the bug to garner the lime-light continued. I felt that there was a war of sorts taking place in my mind. My heart pitched-in to make peace but was overshadowed. I looked back and saw that the bug was settled. I rushed to look for the bug; it was breathless, struggling for life. I reached out to lend my hand and bring it back to life. Thatâ€™s when I realized that the thought could leave me; but I couldnâ€™t. Before I could think further, it took over my world, and now, I was what the thought was â€“ alive.<br><br>This marked the beginning of Piclog - Pictures speak... more!<br><br>&nbsp;</p>', 'Publish to All', '1351502840', 'piclogs/resize_1351502237.jpg', 'piclog_from_a_thought_to_reality_'),
(146, 211, 'piclogs/resize_1351530836.jpg', 'captured ', 8, 'Laughing Buddha', 'Learn to enjoy the way as much as you would enjoy when you reach the destination.â€', 'Publish to All', '1351531387', 'piclogs/resize_1351530836.jpg', 'laughing_buddha'),
(147, 4, 'piclogs/resize_1351538994.jpg', 'Shutterstock', 6, 'Friendship - A beautiful emotion!', '<p></p><p>Friendship is defined in numerous ways by various people but for me its simple - its a beautiful emotion that words cant define but certainly is felt by every living being. To get into details about friendship as a subject; here you go, there are two sets of people, namely;</p><p><span style="font-size: 13px; "><br></span></p><p><span style="font-size: 13px; ">Set A: People who go through life with only a few friends. It seems\nthat some have less than that. They have no one on whom they can call in good\ntimes or bad. There is no one with whom to bounce ideas around, or to talk\nabout deep and troubling subjects. They have no one to call in times of need or\ndifficulty. They are at the mercy of life, standing alone.</span></p>\n\n<p><br></p><p>Set B: Others seem to have a multitude of friends. Wherever they go, people\nknow them, and like to be around them. Should trouble strike, their biggest\nhesitation might be over which friend to call. They know exactly the person\nwith whom to discuss the topics of inquiry and debate. Life is full of\nentertaining and exciting relationships because it is full of friends.</p>\n\n<p><br></p><p>There ought to be a course in school/college on friendship. Of course,\nsome people are perfectly happy to live with fewer friends. They might rather\nhave a few deep and loyal friends, than many superficial ones. Others thrive\nbest when friends are everywhere and numerous. It is not so much the number of\nfriends that is important as is the possession of friends, PERIOD.</p>\n\n<p></p>\n\n<p><br></p><p>Friendship is a blessing, and a friend is the\nchannel through whom great emotional, spiritual, and sometimes even physical\nblessings flow. Friends can cheer us when we are depressed or upset. Friends\ncan challenge us when we allow ourselves to get beyond our reasonable\nboundaries. Only true Friends can motivate us when weâ€™re ready to give in, and they can\nprovide for us when life falls apart. They are there when all is well, and we\nwant someone with whom we can share lifeâ€™s pleasant and memorable moments. We\noften just want them around to have a good time, to laugh, to act silly, to\nenjoy some mutually liked activity. In how many ways have friends enriched our\nlives and made us feel loved, accepted, respected and cared for?&nbsp;</p><p><br></p><p>Well, these days its very difficult to find true friends because you feel everyone around you &nbsp;is trying to get something off you. One needs to be very careful in choosing the right friends and i would say " you will know it from within that someone is your true friend" &amp; god will signify by ringing a bell and lights flashing all over the sky. Funny but true!</p><p><br></p>\n\n<p>It is safe to say that when God created the world and all the majestic\nthings in it, when he streaked the heavens with radiant color and the earth\nwith huge mountains and awe-inspiring canyons, when he painted the plains with\nwaving grasses &amp; he outdid it all by creating true friends. Why not take a\nmoment or two and thank someone today for being a true friend to you?</p><p><br></p><p><span style="font-size: 13px; ">Celebrate Life.. Celebrate Friendship â€“ A bound of that has no boundaries &amp; is made of selfless love!</span></p><p></p>', 'Publish to All', '1351541268', 'piclogs/resize_1351538994.jpg', 'friendship_a_beautiful_emotion_'),
