(149, 28, 'piclogs/resize_1351662471.jpg', 'India', 10, 'India Lovers', 'According to a survey conducted for the<a href="http://www.bbc.co.uk/pressoffice/pressreleases/stories/2011/03_march/07/poll.pdf">BBC World Service</a>by international polling firm GlobeScan<a href="http://www.bbc.co.uk/pressoffice/pressreleases/stories/2011/03_march/07/poll.pdf"></a>, India is now viewed in a much more positive light than it was last year. Of 27 countries polled, 17 lean positive, four lean negative and six are divided. Left, tourists walked along an empty street beside Dal Lake in Srinagar, Jammu &amp; Kashmir, Oct. 5, 2008.<div><br></div><div>Americans and British are largely positive towards India, but 29% of Americans and 35%of Britons surveyed had negative views on India when it came to world affairs. Left, foreign tourists shop at Janpath market in New Delhi, August 5, 2010.</div>', 'Publish to All', '1351662909', 'piclogs/resize_1351662471.jpg', 'india_lovers'),
(150, 31, 'piclogs/resize_1351705299.jpg', 'Nerado', 4, 'My Latte'' at the chocolate room', '<blockquote><blockquote><div align="justify"><font face="arial">Having a scrumptious coffee with the cup of tcr tastes awesome, with refreshing music and a touch of elegant ambiance on Monday evening.</font><br><br><font face="arial">And it''s my own cup to refresh from the Monday stress.</font><br><font face="arial">Off course with free WiFi makes the day well.</font><br><br><div align="left"><b><font face="arial">Photo taken at <a target="_blank" title="" href="http://www.facebook.com/tcrKarkhana">The Chocolate Room Karkhana</a></font></b><br></div><div align="justify"><br></div><br><font face="arial">A latte is a coffee drink made with espresso and steamed milk. When used in English, the word is also sometimes spelled lattÃ© or lattÃ¨â€”the diacritical mark being added as a hyperforeignism. Northern Europe and Scandinavia have traditionally used the term ''CafÃ© au lait'' for espresso &amp; milk, although in the US this term is used for brewed coffee and scalded milk. In France, ''caffÃ¨ Latte'' is mostly known from American coffee chains; a combination of espresso and steamed milk equivalent to a ''latte'' is in French called Grand CrÃ¨me and in German ''Milchkaffee'' or ''Melange''.</font><br></div></blockquote></blockquote>', 'Publish to All', '1351706710', 'piclogs/resize_1351705299.jpg', 'my_latte_at_the_chocolate_room'),
(151, 31, 'piclogs/resize_1351706792.jpg', 'Nerado', 4, 'My Mocha Exotica at Buzz Xprs', '<h5>I have kept my hand in the Discovery/Creation of this new Smoothie "Mocha Exotica" at <a href="https://www.facebook.com/buzzxprs">Buzz Xprs</a>.</h5><br><br><br>A smoothie (alternatively spelled smoothy) is a blended and sometimes sweetened beverage made from fresh fruit (fruit smoothie) and in special cases can contain chocolate or peanut butter. In addition to fruit, many smoothies include crushed ice, frozen fruit, honey or contain syrup and ice ingredients.They have a milkshake-like consistency that is thicker than slush drinks. They can also contain milk, yogurt or ice cream. Smoothies are often marketed to health-conscious people, and some restaurants offer add-ins such as soy milk, whey powder, green tea, herbal supplements, or nutritional supplement mixes. Smoothies became widely available in the United States in the late 1960s when ice cream vendors and health food stores began selling them. By the 1990s and 2000s, smoothies became available at mainstream cafÃ©s and coffee shops and in pre-bottled versions at supermarkets all over the world.<br>', 'Publish to All', '1351707086', 'piclogs/thumb_1351706792.jpg', 'my_mocha_exotica_at_buzz_xprs'),
(152, 290, 'piclogs/resize_1351791748.jpg', 'self', 7, 'An Unstarry Night...', '<font face="helvetica">I was walking out the door when the moon that was in all its glory caught my eye and i just had to grab the camera and click snaps of it.</font><div><font face="helvetica"><br></font></div><div><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp;Though, there was nothing so special about it yet the moon looked all glorified in the unstarry night. And we think a star filled night is what looks beautiful and catches our attention.</font></div><div><font face="helvetica"><br></font></div><div><font face="helvetica">Well nights can also be fun depending on the people around and whom we decide to spend it with. Night outs are one of the most fun things youngsters ought to have. They also turn amazingly memorable with friends and inclusive of all the fun.</font></div><div><font face="helvetica"><br></font></div><div><font face="helvetica">Also the party culture banks on the night to relief people of their stress and let their hair down in various ways to de-stress themselves.</font></div><div><font face="helvetica"><br></font></div><div><font face="helvetica">Night is so much of a relief when we decide to go upstairs and just enjoy the silent breeze and the amazing weather all alone or with songs put on in the otherwise silent time in our 24 hours of a day!.</font></div><div><font face="helvetica"><br></font></div><div><font face="helvetica">So there is actually so much more to a night rather than just sleeping!.</font></div><div><font face="helvetica"><br></font></div>', 'Publish to All', '1351792362', 'piclogs/resize_1351791748.jpg', 'an_unstarry_night_'),
(153, 8, 'piclogs/resize_1351792978.jpg', 'Raj Mohapatra', 7, 'I was there', 'This the first pic that am uploading from my trip to Koraput district, Orissa.<br>I wanted to write and share my experience about the place, the people and everything that I felt however as most of you know am bad in putting words together to form a politically correct sentence therefore, here is the pic that gives the feel of what I felt .<div><br></div><div>I am&nbsp;struggling and think will give up soon :p&nbsp;</div><div>expressing once feeling through writing is a talent that i am not gifted with ... that why i express it through my photograph ...</div><div><br></div><div>But thanks to piclog because its motivating me to write in support of my picture..</div>', 'Publish to All', '1351793802', 'piclogs/resize_1351792978.jpg', 'i_was_there'),
(154, 8, 'piclogs/resize_1351793861.jpg', 'Raj Mohapatra', 6, 'The Secret', 'its a dream that makes a difference, Its not difficult to live but the way you want to live is difficult.&nbsp;<div>Ppl ask me what you want to do in your life, and i keep quite thinking what they are expecting to hear...&nbsp;</div><div>See this is the issue when i start writing.. there are so many thoughts flowing that i cant guide the flow of my words... but am still writing because i wanted to share this pic n the thought behind it with you all ... ...&nbsp;</div>', 'Publish to All', '1351796192', 'piclogs/resize_1351793861.jpg', 'the_secret'),
(155, 290, 'piclogs/resize_1351969845.jpg', 'Self', 11, 'A Rather Surprising Beginning!..', '<div style="text-align: left;"><font face="georgia">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; At first when you see this picture what comes to your mind?</font></div><div style="text-align: left;"><font face="georgia"><br></font></div><div style="text-align: left;"><font face="georgia">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Possibilities are... Some historic marvel, a tomb might be with water around, an aquarium or just a beautiful pond some place.</font></div><div style="text-align: left;"><font face="georgia">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</font></div><div style="text-align: left;"><font face="georgia">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;That is what i also had thought until i got to know the story behind this place. This was supposedly the tomb of a Mughal Emperor none other than Shah Jahan as far as i remember.&nbsp;</font></div><div style="text-align: left;"><font face="georgia"><br></font></div><div style="text-align: left;"><font face="georgia">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;And though he built it to be buried here in the heart of what was called the "HEAVEN ON EARTH" and what i believe it is i.e. Kashmir. The king could not be buried here.</font></div><div style="text-align: left;"><font face="georgia"><br></font></div><div style="text-align: left;"><font face="georgia">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;And this is not just an ordinary pond as it seems its the Initiation point of the river JHELUM. The water that is standing still in this round pond like structure actually flows through a park and goes on to become the river &nbsp;Jhelum.</font></div><div style="text-align: left;"><font face="georgia"><br></font></div><div style="text-align: left;"><font face="georgia">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; And as told by the people there and as seen by me the water here seems pretty much standing still which is surprising. And as told by the people there nobody has ever known the exact depth of this particular place.&nbsp;</font></div><div style="text-align: left;"><font face="georgia"><br></font></div><div style="text-align: left;"><font face="georgia">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; The water underneath actually has emerged boiling from the ground and is said to be covered by a plate which was made of several metals unknown till date which actually makes the water appear greenish in this particular area.</font></div><div style="text-align: left;"><font face="georgia"><br></font></div><div style="text-align: left;"><font face="georgia">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Well God surely has got a lot of tricks!... and this one truly amazed me!...Who wud say that THIS is where it all began and ended up to be the river JHELUM as we know today!.</font></div><div style="text-align: left;"><font face="georgia"><br></font></div><div style="text-align: left;"><br></div>', 'Publish to All', '1351970859', 'piclogs/resize_1351969845.jpg', 'a_rather_surprising_beginning_'),
(156, 325, 'piclogs/resize_1351969530.jpg', 'cam shot', 7, 'one way', 'sometimes it seem&nbsp; easy to walk on path ,wondering about your dreams,ambition,wants and&nbsp; secrets .and so busy thinking about them that you don''t notice where you going? and ask yourself where are you going? what do you want now?<br>when you are too busy thinking and don''t put efforts you will not have choices left you will have only one way to go.never know where it leads to ? what it leads to? just keep o walking and walking.<br>gazing at the nature around you the same things with a new perspective.and regretting for that moment you had with you and you just let it go.<br>past can never be undone.so do the right things at right time.and hell with circumstances create your own opportunities...........make way which were said to be impossible and lead your own ONE WAY........................... <br>', 'Publish to All', '1351970960', 'piclogs/resize_1351969530.jpg', 'one_way'),
(157, 48, 'piclogs/resize_1351985669.jpg', 'Albushotel', 14, 'Survival of the Shopaholic.', '<font face="arial">â€œWhoever said that money can''t buy happiness, simply didn''t know where to go shoppingâ€<br>â€• Bo Derek.</font><div><font face="arial"><br></font></div><div><font face="arial">The thought has been very well put into words where it says shopping brings happiness. I would not be wrong to say that , most of the boyfriends would be irritated to see their girl friends doing shopping not only for themselves but also for their near and dear ones and other close friends. Until and unless the girls carry few shopping bags, brimming with items, clothes,make up kits ,it seems it was a wastage of time going for window shopping.</font></div><div><font face="arial"><br></font></div><div><font face="arial">Shopping has the power to relax the most tensed nerves in girl''s mind, who may be sad on the most silliest or biggest of things.If break up happens, it is the most crucial time to be pamper oneself and to stay happy and what can be better than shopping.</font></div><div><font face="arial"><br></font></div><div><font face="arial">Few shopaholics may even feel contended, after buying soaps, facewashes, medicines. perfumes, deodarants which is the highest extent of shopping.</font></div><div><font face="arial"><br></font></div><div><font face="arial">Uber cool ladies staying in big cities,wait for their salaries to arrive to purchase new arrivals.For a girl,shopping existed from the Mahabharata or Ramayan times. Loving oneself to the core is directly proportional to higher levels of shopping.&nbsp;</font></div><div><font face="arial"><br></font></div><div><font face="arial">No matter what happens in life, whether the girls find their love, their love for shopping stands first.</font></div><div><font face="arial"><br></font></div><div><font face="arial">Happy Shopping. :)<br></font><div><font face="arial"><br></font></div><div><font face="arial"><br></font></div></div>', 'Publish to All', '1351988234', 'piclogs/resize_1351985669.jpg', 'survival_of_the_shopaholic_'),
(158, 336, 'piclogs/resize_1352112636.jpg', 'Tina Picard', 8, 'Good Deeds..!! ', '<p style="text-align: justify;"><font face="helvetica">Like every day I left for work</font></p><p style="text-align: justify;"><font face="helvetica">I entered the bus, which stopped with a jerk</font></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica">Walking my way through the pass way I spotted an empty seat</font></p><p style="text-align: justify;"><font face="helvetica">I made myself comfortable while glancing at the busy street </font></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica">Moments later, I saw an elderly man standing close to the door</font></p><p style="text-align: justify;"><font face="helvetica">I offered my seat, as it was little to ask for</font></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica">He thanked me while he walked to the chair</font></p><p style="text-align: justify;"><font face="helvetica">I smiled pleasingly, with a sense of pride in air</font></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica">Standing at the doorway I looked at the window</font></p><p style="text-align: justify;"><font face="helvetica">Remembered the childhood lesson, â€˜you will reap as you sowâ€™</font></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica">I continued listening to music with my head-phones on</font></p><p style="text-align: justify;"><font face="helvetica">Was clutching to the side handle as the bus would shudder because of the digs and stones</font></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica">Minutes later I was lost in the music</font></p><p style="text-align: justify;"><font face="helvetica">As I noticed a lot of people walking to the door in a quick</font></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica">Out of the people lining to get down</font></p><p style="text-align: justify;"><font face="helvetica">The elderly man was the only one without a frown</font></p><p></p><p style="text-align: justify;"><font face="helvetica">He looked at me and smiled</font></p><p style="text-align: justify;"><font face="helvetica">In his shivering voice he uttered, â€˜God bless you my child!â€™</font></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica">I saw him walk down from the bus</font></p><p style="text-align: justify;"><font face="helvetica">A great blessing showered without any fuss</font></p><p></p><p style="text-align: justify;"><font face="helvetica">His words echoed for long</font></p><p style="text-align: justify;"><font face="helvetica">It followed me all along</font></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica">Sometimes doing a good deed costs nothing</font></p><p style="text-align: justify;"><font face="helvetica">But by doing so you win a little bit of everything</font></p><p></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica">Simple incidents sometimes have meaning very steep</font></p><p style="text-align: justify;"><font face="helvetica">As you sow so shall you reap!</font></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica"><br></font></p><p></p><p style="text-align: justify;"><font face="helvetica"> -Neha Agarwal</font></p>', 'Publish to All', '1352113024', 'piclogs/resize_1352112636.jpg', 'good_deeds_'),
(159, 344, 'piclogs/resize_1352120144.jpg', 'ladypatsyschambers.blogspot.com', 6, 'An open letter to a jackass junkie I considered my boyfriend', '<p><font face="helvetica">I don''t know what to address you as. Friend,\nEx-boyfriend, or just someone I knew.</font></p>\n\n<p></p>\n\n<p><font face="helvetica">I thought. I thought a lot before writing this. I have to\nsay everything that I kept inside me all this time just because whenever I\ntried saying things you would interrupt with your own stuff or just divert the\nconversation to an unwanted topic. </font></p>\n\n<p></p>\n\n<p><font face="helvetica">I have written and re-written this letter a thousand\ntimes before actually sending it to you. </font></p>\n\n<p></p>\n\n<p><font face="helvetica">What does a relationship mean to you? Does it mean\nhurting a girl who loves you so much and n number of times till she stops\nbelieving in you and stops believing in love? Does it mean cheating on her with\nsomeone and then keep saying things to\ncover up? Does it mean keeping things from that person until he/she finds out\nfrom somewhere else? Does it mean blaming the other person for what is a sickly\nminute thing and make it into a humongous issue and then blame her for the\nsame? I won''t ever know. Why? because from where I stand and understand you\nhave done all these things to me. Everything. Never once thinking how would I\nfeel. Why? Am I not a human being? Did you think I was so gullible that I will\nbelieve everything you told me without questioning you?</font></p>\n\n<p></p>\n\n<p><font face="helvetica">I accepted you as you were never once trying to change&nbsp;you\nbut help you get out of your sick habit (that''s what it had become) of doing\n"stuff". Was that wrong? Was it my flaw that I didn''t do\n"stuff"? If I had been doing it would you be with me in a manner you\nwere when I met you? Was that a thing?</font></p>\n\n<p></p>\n\n<p><font face="helvetica">I kept getting you stuff with the presumption that you\nwill stop now, you will stop now. But no. It kept going on and on and on. I\nwent against my principles and got you your "stuff", gave you money\n(which i made clear that it wasn''t a good idea). But no. You were so adamant.\nYou knew i was emotionally attached to you and would do anything that you would\nsay. You knew that so well.</font></p>\n\n<p></p>\n\n<p><font face="helvetica">Do you have any idea how disgusting and unrespectful your\nbehaviour was towards me in the past couple of months? God knows why I kept\nhelping you when you kept insulting my love everyday. All of a sudden you just\npushed me out of you life. Threw me out like a tissue. Put me out like garbage.\nHave you ever felt that? You had no right, absolutely NO right to do this and\nbehave in the way you did with me. You didn''t even stand up to your other\nex-girlfriend when she insulted me in front of you when she spoke to me from\nyour phone. So, when did you respect me? Even as a friend?</font></p>\n\n<p></p>\n\n<p><font face="helvetica">All you did was get mad at me and say things and expect&nbsp;me\nto come behind you like a puppy wagging it''s tail. That''s exactly what you did\nin the past few months. I don''t know what I meant to you, I don''t know if i\nshould even believe in the message you sent to my best friend about you caring\nabout me. I really don''t know.</font></p>\n\n<p></p>\n\n<p><font face="helvetica">No one has hurt me this much and these many times as you\nhave. But I still stuck by your side and was there when you needed me. When\neveryone around me told me to leave you I still stuck there saying "No. He\nwill get back. He loves me and I love\nhim. He is a good person." That kept me going. But you even took that hope\naway. You just snatched it right under my nose and left me on the street like I\nwas a nobody. I had become a nobody for you. Absolutely nobody. You won''t ever\nunderstand the pain. The pain of being kicked out of a person''s life who you\nloved so dearly. You won''t. Because you are the one who did it. When were\nyou there when i needed you?</font></p>\n\n<p></p>\n\n<p><font face="helvetica">Even at this moment you must be finding 100''s of flaws\nwith me to defend yourself. But trust me, flaws or not I know what I went\nthrough and He-The Almighty has seen whats happened and who''s done what. You\nbelieve in karma strongly, right? What goes around comes around? Everyone pays\nfor whatever they have done in their life in this one life they''ve got. </font></p>\n\n<p></p>\n\n<p><font face="helvetica">I must appreciate one this though, I never thought I\nwould be able to ever hate you so much. But you made sure that I did. So well.\nI was so careful what to say to you and what not. I tried to make you happy, do\nthings you really like. But what did I get in retrurn? Rejection? Insult?\nBreach of trust?</font></p>\n\n<p></p>\n\n<p><font face="helvetica">I don''t drink, I don''t smoke and i definitely don''t do\ndrugs. I loved someone with a clean heart. I did everything to make things\nright. What did I get?</font></p>\n\n<p></p>\n\n<p><font face="helvetica">I have so many lies of yours saved up that I could print\na book out of it. Really tell me now, if you cared so much about me like you\nsaid till the day you left, how could you even imagine of doing such a cruel\nthing to me?</font></p>\n\n<p></p>\n\n<p><font face="helvetica">I kept saying I understand you need to stop or you are\ngoing to die. But I also kept saying things could have been done in a better\nway. But no! You destroyed everything that came your way and left. Left without\neven looking back once. Left without thinking even for a second how you had\nleft things. I don''t know if you were ever going to sort things out. But I know\none thing, there''s nothing left to be sorted now. Thank you so much. I never\nknew my love was so cheap that you could throw it away just like that. </font></p>\n\n<p></p>\n\n<p><font face="helvetica">You once asked me a question that if you were selfish and\nonly thought about yourself even when you were off stuff. Today i will answer\nit with confidence - YES. You are selfish to an extent to only think about\nyourself. Even when you are clean its only you, you and you.</font></p>\n\n<p></p>\n\n<p><font face="helvetica">You can''t always leave things as they were you know. You\nhave to have a closure. You have to accept that you were wrong and say ''sorry''.\nI accepted i was wrong in some ways. But you? Never. Learn to accept the truth.\nIt is what it is. Learn to respect other people''s hard earned money before you\nspend it on stuff and other things related to that.</font></p>\n\n<p></p>\n\n<p><font face="helvetica">And in the end when I ask for my money back, all you got\nto say is "I have lost this much. Try and understand." How many times\ndo I have to tell you that i DON''T have a father who earns and no one has left\nme a fortune somewhere? Is it that difficult to understand? You will call me a\nnarrow minded person, a money minded person, but I know I am not and I am\nasking what is mine. I had to borrow from others for you and now I have to\nanswer them. I have to return them the amount when I don''t have any. And you\njust left like that. Without even telling me that you were planning to do\nit so quickly. I wonder if being so good to you was right or wrong. </font></p>\n\n<p></p>\n\n<p><font face="helvetica">Same with the book I gave you. I kept asking you to\nreturn it back because it was a gift from someone very close to me. But no! You\nkept saying you are going to take it with you. But at the end what happened? It\nturned out to be another lie. You left it here. Why lie? WHY?</font></p>\n\n<p></p>\n\n<p><font face="helvetica">Every time on my day off you said we would go out, i\nwould be ready waiting for you and all you used to do was say I can''t. Why? No\nreason. Was I an idiot?</font></p>\n\n<p></p>\n\n<p><font face="helvetica">Every time you needed stuff, you remembered me. Was i\nyour procurer? All we spoke about was stuff and things about some one unwanted. This is what all happened in the past 3 months. These are the days\nyou showed me. Continuously talking about someone who made me really\nuncomfortable. I kept telling you, begged you not to talk about her but you\nstill continued.</font></p>\n\n<p></p>\n\n<p><font face="helvetica">You said n number of things to me when I spoke to your\nmother about us. But you never said anything against your current\n"friend" when she wrote to your mother about you two. Why single out\nme? Was I lying? You know I respect your mother a lot. More than you. You\nalways saw me as someone who I wasn''t.</font></p>\n\n<p></p>\n\n<p><font face="helvetica">I am not like you other ex-girlfriend who would keep\ncalling you, messaging you and all. This is one thing I had to do because you\nnever gave me a chance to speak as you were always high and kept interrupting\nevery time I said something or you just kept passing out. There are still a lot\nof things I haven''t covered in this but you''ve got the gist I guess.</font></p>\n\n<p></p>\n\n<p><font face="helvetica">Please, respect relationships and people who love and\ncare about you. Don''t hurt them so much that they start hating you. You mean a\nlot to some of them but you don''t realize it.So, everything that has happened,\neverything that you have done to me I pray never happens even to my\nenemies. </font></p>\n\n<p></p>\n\n<p><font face="helvetica">And yes I want my money back. 23,000. I don''t care what\nyou call me now. You have made things as they are now. You have made me come to\nthis point. You have stop taking advantage of people for your addiction. You\nhave got yourself in this situation, you have to get out of it yourself. Your\naddiction has destroyed this relationship or whatever it was according to you.\nDon''t destroy anything more. </font></p>\n\n<p></p>', 'Publish to All', '1352120786', 'piclogs/resize_1352120144.jpg', 'an_open_letter_to_a_jackass_junkie_i_considered_my_boyfriend');
INSERT INTO `upload_piclog` (`upid`, `uid`, `picture`, `courtesy`, `category_id`, `title`, `write_up`, `publish`, `timestamp`, `thumb`, `piclog_url`) VALUES
(160, 344, 'piclogs/resize_1352120943.jpg', 'deviantart.com', 6, 'And my life came tumbling down..', '<font face="helvetica">This is not an excerpt from any book or a movie script. This is a true story of a girl who was made to face the brutal reality of the other side of life ruled by drugs. Itâ€™s shows the true strength of girl who believes that nothing is greater than true belief in what you want but at the same time her strength to accept the reality as it is which is not easy.<br>â€œThis wonâ€™t happen with me.â€ â€“ One thing everyone of us truly believe. I thought so too for years. Then one day, that thought took a back seat in my life forever.<br>Drugs, drug addicts were never part of any discussions with my friends or family. Never knew anyone who was into all this. But itâ€™s absolutely different now.<br>My life took a sharp turn when my boyfriend told me about his drug addiction. I had met him just a couple of days ago. We shared an excellent rapport and got along really well. I was finally happy and thought everything was going to be just fine when reality threw me down from that ninth cloud i was on. And it threw me how!<br>When he first told me about all this I was just listening and trying my level best to understand the situation because it took a 360 degrees turn from what it was. Thoughts like â€œWhy didnâ€™t he tell me before?â€ or â€œWhat wrong have I done to deserve this?â€ started hovering in my head. But surprisingly I never spoke them out loud.<br>I sat and thought. Thought a lot about this. I had 2 choices, either to take it or leave it. And i wasnâ€™t ready to let go of this beautiful relationship I was in for something like drugs. I believed that we were meant to be together, I will get through this situation and get him out of it too. How? I never knew.<br>He told me everything after this. How he got into it, what all he did, what was it that he was doing at that moment and so on. He told me about the people he used to get the stuff from and how they were caught and how difficult it is to get this stuff here. Brand new to this whole scenario and eager to help him out, I promised him everything in my power.<br> I started by calling everyone on my phone list, friends from the city to friends all over the country to people I hardly spoke to. I did everything to get my hands on some of the â€˜stuffâ€™. But as expected, everyone turned their backs on me. I guess people donâ€™t want to get their hands dirty in these things. And more over I was all alone in this. I couldnâ€™t talk to anyone about it or ask how to go about a particular situation.<br>Then, I got out in the darkness myself. I didnâ€™t know what was I looking for, how to go about it and where to go looking for it? The only thing that was on my mind was to get him out of the misery, the pain and the all that suffering. I saw him go from bad to worse. But, not knowing much about all these things I knew I would fail miserably. Somehow I managed to get just about a few but that was all. I lost.<br>I thought everything was going to get over. I was so tensed and caught up in the situation that my work suffered, my family noticed me getting worse everyday, my friends told me to let go. I felt betrayed and I was very angry. So angry that I said things I would not have even thought of to him. But even after all this, I still had that tiny little faith that said â€˜Hang on! Donâ€™t let go yet.â€™<br>I listened to my conscience and waited in the same miserable condition where I was almost mentally about to die. I saw a ray of hope when I got a message from him saying that he was going to a rehab. I was very happy that he was going to be fine, but more happy that he wasnâ€™t going to suffer anymore. I do thank him for one thing, that he showed immense trust in me and acknowledged my support and the small amount of help that I could extend.<br>A few days in the rehab I told him all the things that happened in the last 2 months he was here and as he was using heroine, he couldnâ€™t remember anything that happened. Some days later he told me he didnâ€™t know when would he come back. I was shattered again. I never showed it to him that how much it hurt me to hear that. I had already spent 3 months not knowing how he was or what happening to him. And trust me itâ€™s not that easy.<br>But ultimately he got back. First 3 weeks he was extremely indifferent towards me. He said he needed time to sort things out. My 3 months of misery got extended by 3 more weeks. Even after being in one city, I never met him or called him in those 3 weeks. The only mode of communication we had was â€“ chat.<br>4<sup>th</sup> week something happened and it was not good. I came to know that when he got back from rehab he came across the injections he used to do in his room and in did them in the first 2-3 days. Since then he couldnâ€™t sleep. He requested me if I could find a few till he got his sleeping pattern back to normal. First, I didnâ€™t know if I should help because the more I got him, the more deeper he would get into it. But after a long conversation I finally agreed and somehow got the injections.<br>He gave me a deadline saying he wonâ€™t do it after that. This time I knew he was very serious about quitting. So I went ahead and started looking everywhere I could. But deadline went by and now we both would be out searching for the injections. A little later he realized it wonâ€™t stop. And thats when he decided he would go back to rehab again and this time make sure nothing goes wrong.<br>Today, heâ€™s back and things are looking good. What I went through in all these months because of drugs used by someone else is more than enough to last a lifetime with me. In these few months I realised the amount of strength I have, the true friends I had around me who stuck with me in these trying times and my belief in the higher power.<br>To people whose close ones are into drugs, all I would say is be with them and donâ€™t desert them. They will detest all the help you might try extending towards them , but with time theyâ€™ll understand you are just trying to help them. Patience and belief are the two things you cannot afford to lose.<br>But unfortunately I lost my battle and drugs won. I lost him to drugs and indifference that this wretched substances made him. In the end my trust was broken and I was blamed for things. Drugs or not, men are pigs and will remain so. Same old..same old...</font>', 'Publish to All', '1352121248', 'piclogs/thumb_1352120943.jpg', 'and_my_life_came_tumbling_down_'),
(161, 302, 'piclogs/resize_1352127370.jpg', 'Google', 6, 'Vicious Love...', '<div><br></div><div><br></div><font face="comic sans ms"><div><font face="comic sans ms"><br></font></div>Oh! That age with a crazy mind, the world is at your feet and you think your one of a kind. Looking up high, you flaunt your new wings. To feel strong and free, you break all those strings.</font><div><font face="comic sans ms">Its spring everywhere!! just look around.&nbsp;</font></div><div><font face="comic sans ms">Smiling at the sky you turn round and round.&nbsp;</font></div><div><font face="comic sans ms">Dancing away, like a carefree soul, you unknowingly step onto-</font><span style="font-family: ''comic sans ms''; ">the path of coal.</span></div><div><span style="font-family: ''comic sans ms''; "><br></span></div><div><span style="font-family: ''comic sans ms''; ">Blooming roses make you glow.</span></div><div><span style="font-family: ''comic sans ms''; ">Wait for a while and the thorns will show.</span></div><div><span style="font-family: ''comic sans ms''; ">"Oh love my love! You make me feel so complete.."</span></div><div><span style="font-family: ''comic sans ms''; ">&nbsp;</span><font face="comic sans ms">And&nbsp;then my dear, you fall in a ditch so steep....</font></div><div><font face="comic sans ms">&nbsp;<br></font><div><font face="comic sans ms">The world gets dizzy and you look down</font><span style="font-family: ''comic sans ms''; ">.</span></div><div><font face="comic sans ms">Your feet are stuck, they are sinking in the ground.</font></div><div><font face="comic sans ms">It gets darker and darker as you try to get out.</font></div><div><font face="comic sans ms">Your scared, your crying, you scream and shout.</font></div><div><font face="comic sans ms">A cold creepy hand moves over your spine,</font></div><div><font face="comic sans ms">whispering ''don''t worry, with me you''l be fine''.</font></div><div><font face="comic sans ms">Your trembling with fear struggling to see a thing.</font></div><div><font face="comic sans ms">A loud scream and you lost a wing.</font></div><div><font face="comic sans ms">"What do you want??" Screams your heart.....</font></div><div><font face="comic sans ms">"Leave me alone! your tearing me apart!!"</font></div><div><font face="comic sans ms">Stand for yourself and fight your battle.</font></div><div><font face="comic sans ms">Hold your horse, just grab its saddle.</font></div><div><font face="comic sans ms">Break-free now or you will be stuck here forever.</font></div><div><font face="comic sans ms">Realize this dear, its now or never......</font></div><div><font face="comic sans ms"><br></font></div></div>', 'Publish to All', '1352130431', 'piclogs/resize_1352127370.jpg', 'vicious_love_'),
(162, 8, 'piclogs/resize_1352133047.jpg', 'Raj Mohapatra', 8, 'The women of Koraput..', 'Koraput is one of the district of Orissa. Still few places of this district are untouched. But you can feel the touch of love in its hills, rivers, trees and its innocent people.&nbsp;<div>During my project I met some people whose dreams are as bright as sunshine. I could see &nbsp; confidence, self-dependence in their eyes.</div><div>In-spite&nbsp;of endless problems which they face everyday, still you can mark charm in their face as they never focus on problems and overcome challenges to lead a&nbsp;cheerful&nbsp;life.</div>', 'Publish to All', '1352134516', 'piclogs/resize_1352133047.jpg', 'the_women_of_koraput_'),
(163, 4, 'piclogs/resize_1352139920.jpg', 'Shutterstock', 8, 'In remembrance of a great man!', '<p>Without a shadow of a doubt, my grandfather is the single most\ninfluential person in my life. He was more than just my grandfather. He was my\nfather figure, my mentor, and I\\''m proud to say, my friend â€“ someone who I could\nalways bank upon.<br>\n<br>\nAs a child there was no safer place than the security of his lap. I would watch\nhorror movies on TV from behind his easy chair. Noone could dare scould me\nbefore him ! He taught me how to be nice to people, talk and treat everyone\nequal and at the same time live life in oneâ€™s own terms. He was a man of\ncomplete class and his presence used to make people around so secure. He had\nsuch a disciplined lifestyle that anyone would dream of. People in the entire\ncommunity used to seek help from him and he never disappointed anyone. Everyone\nleaves from our home with a big smile. The kind of respect he still holds\namongst the community people and his peers is truly remarkable. He was one amongst\nvery few who commanded respect for a person he was.<br>\n<br>\nHe was warm, loving, firm and straightforward. He had a way of accepting\nwhatever came his way with no more than a shrug. His deep faith carried him\nthrough what life had to offer. One of seven children, he came out of his village,\ndid his graduation with great drive and determination but he never forgot his\nroots. He used take all of us to his village once in a year for a massive\ncelebration and people worshipped him there. There are so many families which\nis now having a good living because of him. </p>\n\n<p>He loves watching cricket and playing cards. He was a master in\neverything he did. Post his retirement, he ventured into the Hotel industry,\nstarted a small vegetarian hotel and then started branches across and made it a\nsteady business for the entire family now. <br>\n<br>\nHe pampered me like there is nothing impossible in this planet. Everything I dreamt\nof used to be mine. He understood my silence and my anger equally and dealt\nwith it till I was 17. I could never imagine life without him. </p>\n\n<p>It\\''s as if he just woke up one morning and decided it was \\''time\\''.\nHe became ill and within a few months this amazing man, with hands and a heart\nlarger than life itself, passed away. Father of three, grandfather of six,\ngreat-grandfather of one, friend of countless individuals, this remarkable man\ntouched all of our lives. </p><p><br></p><p>I see him everyday and feel him around whenever im happy or in trouble, i know he is up there watching the drama that\\''s happening!</p><p><br></p><p>I miss you, i so wish that i could erase this NOV week from the entire calendar!!!!</p>', 'Publish to All', '1352140992', 'piclogs/resize_1352139920.jpg', 'in_remembrance_of_a_great_man_'),
(165, 336, 'piclogs/resize_1352193429.jpg', 'Google', 6, 'Are You All Really the same', '<div style="text-align: justify;"><span style="font-family: verdana; ">Are you all really the same?</span></div><div style="text-align: justify;"><font face="verdana">Is this really only a game?</font></div><div style="text-align: justify;"><font face="verdana">So much heard, a lot more seen</font></div><div style="text-align: justify;"><font face="verdana">Why is it only one thing for which you are keen?</font></div><div style="text-align: justify;"><font face="verdana"><br></font></div><div style="text-align: justify;"><font face="verdana">Donâ€™t emotions matter to you at all?</font></div><div style="text-align: justify;"><font face="verdana">How are you so selfish, that you only want to be kicked on your balls</font></div><div style="text-align: justify;"><font face="verdana">You say that you do care for me</font></div><div style="text-align: justify;"><font face="verdana">But when my heart cries, can you see?</font></div><div><div style="text-align: justify;"><font face="verdana"><br></font></div><font face="verdana"><div style="text-align: justify;">Are you all really the same?</div></font></div><div style="text-align: justify;"><font face="verdana">Is getting laid with me only your aim?</font></div><div style="text-align: justify;"><font face="verdana">You say that you love me so you have the right to do so</font></div><div style="text-align: justify;"><font face="verdana">But if you love me then we will have a long way to go</font></div><div style="text-align: justify;"><font face="verdana">You knew my mindset, hence i asked you to wait</font></div><div style="text-align: justify;"><font face="verdana">But you were so selfish, that you crashed all the gates</font></div><div style="text-align: justify;"><font face="verdana">I kept howling, but you heard nothing</font></div><div style="text-align: justify;"><font face="verdana">Now i wish i were stronger to stop everything</font></div><div style="text-align: justify;"><font face="verdana">You crossed all your boundaries and destroyed me completely</font></div><div style="text-align: justify;"><font face="verdana">â€œits ohkâ€, you said so bluntly</font></div><div style="text-align: justify;"><font face="verdana">Now i realize i was such a fool</font></div><div style="text-align: justify;"><font face="verdana">You think its all right and so cool</font></div><div><div style="text-align: justify;"><font face="verdana"><br></font></div><font face="verdana"><div style="text-align: justify;">Are you all really the same?</div></font></div><div style="text-align: justify;"><font face="verdana">You did and you left, but my heart still bears your name</font></div><div style="text-align: justify;"><font face="verdana">You said â€œtrust meâ€ i wont let you down</font></div><div style="text-align: justify;"><font face="verdana">â€œbelieve meâ€, i wont let you drown</font></div><div style="text-align: justify;"><font face="verdana">But my world was washed away by you</font></div><div style="text-align: justify;"><font face="verdana">I still wonder, what was your motive what did you do?</font></div><div><div style="text-align: justify;"><font face="verdana"><br></font></div><font face="verdana"><div style="text-align: justify;">Are you all really the same?</div></font></div><div style="text-align: justify;"><font face="verdana">The wounds still hurt, it still pains</font></div><div style="text-align: justify;"><font face="verdana">I wonder if i will ever forget that day..!!</font></div><div style="text-align: justify;"><font face="verdana">When you left me and went your own way..!!</font></div><div style="text-align: justify;"><font face="verdana">It was only you whom i loved the most</font></div><div style="text-align: justify;"><font face="verdana">But you left me stranded on the alienated coast</font></div><div><div style="text-align: justify;"><font face="verdana"><br></font></div><font face="verdana"><div style="text-align: justify;">Are you all really the same?</div><div style="text-align: justify;">If all this was really a plan</div></font></div><div style="text-align: justify;"><font face="verdana">Then come, tell me bastard and be a man....!!!</font></div>', 'Publish to All', '1352193650', 'piclogs/resize_1352193429.jpg', 'are_you_all_really_the_same'),
(166, 336, 'piclogs/resize_1352193819.jpg', 'Google', 6, 'You lucky B*st*rd..!', 'I leave you behind the college gate<div>But i stand on the other side and wait</div><div>Wish i could hold on to you forever</div><div>Or i wish i would have met you never<br><br></div><div>The decision is a tough one</div><div>I have had enough, i am done</div><div>I wonder if i love you or not</div><div>Its a long mind maze where i am caught</div><div><br></div><div>I wish a little earlier you would have said</div><div>I would have done everything, even laid dead</div><div>But you got very late in saying that you feel too</div><div>I just wanna say that f*** you</div><div><br>I assumed that i forgive n forgot</div><div>But i will never forget the difficult situations that i alone fought</div><div>I wish you would have been a little more considerate</div><div>You had your fun, whereas it was me who paid<br><br></div><div>The wounds will heal for sure</div><div>But the scars you leave will have no cure</div><div>You had your reasons for what you did</div><div>But i got fooled like a stupid, innocent kid</div><div><br>Now i am in a new world</div><div>I will not come back no matter how much you hurled</div><div>I hope now you know how i felt</div><div>Sleepless nights i have spent, when all night i wept<br><br></div><div>You gave me a lot of pain</div><div>Can i ask... you a**hole....what did you gain?</div><div>I gave you all the love i had</div><div>I did everything i could, i had gone mad</div><div><br>But, stay away...as i am mad no longer</div><div>I was very weak earlier, but thanks to you i am much stronger</div><div>Your words or actions have no impact on me</div><div>The new me is here for you to see</div><div><br>I am sure i deserve better and will get the best</div><div>I have proved that i am a winner, by passing the entire difficult test</div><div>No longer will you enjoy at my cost</div><div>You will now learn as now itâ€™s you who have lost</div><div><br>Have fun you lucky b*st*rd</div><div>You were fortunate to have me as icing on the custard...!!</div>', 'Publish to All', '1352194168', 'piclogs/resize_1352193819.jpg', 'you_lucky_b_st_rd_'),
(167, 353, 'piclogs/resize_1352204372.jpg', 'AJ (Myself lol)', 7, 'Nature''s beauty', 'I glanced at it and couldn''t resist seeing it <br>again and again,<br>A fine evening in my college after all the<br>classes were dismissed,<br>Just me and my friend were admiring and almost<br>getting drenched in the rain<br><br><br>It was such a wonderful moment that it got<br>my whole attention,<br>I took a snap of it and kept it safe!<br><br>One cannot help but marvel at the intricate design of a single leaf, Or \nthe roar of a great waterfall. <br><br>Time spent in nature is time spent \nrealizing that you don''t know it all and that you never will.\n<br><br><br>Every season has its special beauty and autumn is no exception.<br><br>Watching\n the trees turn from a uniform green to all varieties of gold, yellow \nand red is a spectacular experience. <br><br>One can almost be blinded by the \nfiery brilliance. How can it be that all this beauty is sign of death \nand decay? <br><br>With all this beauty there is a certain sadness in knowing \nthat the changing colors foreshadow the arrival of a long cold winter.<br>', 'Publish to All', '1352204969', 'piclogs/resize_1352204372.jpg', 'nature_s_beauty'),
(168, 9, 'piclogs/resize_1352297316.jpg', 'Simanth Lenkha', 6, 'Relationships, mirage and more...', '<p>With the makeover buzz all around, and so many people vying for it, relationships have also got a makeover. In our earlier generations, people refrained from even touching a woman before marriage. This changed with time, and every generation got more pre-marital benefits than the previous one. And as the graph from the previous generations suggests, coming generations will not have to get into the hassles of marriage. Sex will be all out in the open. This makes me jealous of my son even before he is born!</p><p><br></p><p>Relationships are difficult to understand. Be it father-son, husband-wife or any other. Sometimes one wonders how certain relationships work. For instance, it could be the relationship between a shopkeeper and a customer. The shopkeeper hates the customer for bargaining and the customer hates the shopkeeper for over-pricing. But they retain the relationship with each other, and continue be cordial. Perhaps, they need each other? Similarly, there could also be some interesting real-life examples in our neighbourhood.</p><p><br></p><p>In life we also come across some peculiar relationships. We try to think of reasons why these two souls are together. Is it love, lust, money, or lack of options? Well, whatever the reason, in some cases the togetherness is remarkable. But why do some marriages end up in divorce? There could be a lot of reasons for that:</p><p><br></p><p>Thereâ€™s more fun in travelling towards a destination than reaching one (Unfortunately, men realize the importance of the journey after reaching the destination)</p><p></p><ul><li><br></li><li>Some people can burn their new Mercedes to illegally grab someoneâ€™s old small car. And men love to practice this art and get caught!</li><li><br></li><li>Alimony is an easy way to buy that sparkling solitaire</li><li><br></li><li>Because even lawyers have wives who wish to buy that precious solitaire!</li><li><br></li><li>To prove that thereâ€™s life after death!</li></ul><p></p><p></p><p><br></p><p>The concept of arranged marriage is totally insane. The to-be life partners do not know each other. They, rather their family, decide on them being partners for life. But what makes some arranged marriages work for years? In such cases, marriage is the beginning of a relationship between two souls. The first few years are spent only in understanding the partner. And by the time they realize their mistake, they are in their first spell of old age. At this stage, they wouldnâ€™t want to get into the agitation of separation. The society also plays a crucial role in them being together.</p><p>The moment thereâ€™s news about a couple being part of a strained relationship, our gossipmongers start doing over-time. Then thereâ€™s also an element of laziness involved; lazy to get separated in old age. The availability of the right partner (if they actually exist), post divorce, also works as a hindrance in the coupleâ€™s separation. Consequently, they end up being the perfect example of the famous oxymoron called happily together; either they can be happy or together.</p><p><br></p><p>What plays the biggest role in the success of any relationship?</p><p><br></p><p>Of course, itâ€™s mirage. Itâ€™s the illusion that keeps most relationships going. But apart from keeping the relationships going, the mirage also does a lot of good to us. At times even without our knowledge:</p><p></p><p><br></p><p>The illusion that your wife loves you, only you! (Because of this illusion, you keep your wife happy, and your maid happier!)</p><p><br></p><p>That your husband is out for some official work. (Because of this illusion, you keep yourself happy, and your husband alive!)</p><p><br></p><p>That your father has written most part of his wealth in your name. (This way you end-up taking care of your ailing father, and the rest of the family. At least until the Will is out in the open.)</p><p><br></p><p>As promised, your car mechanic has actually replaced all the old parts of the car with new ones. (Because of this illusion, you escape life imprisonment that you would have gotten into, after knowing the truth &amp; killing the mechanic.)</p>', 'Publish to All', '1352297459', 'piclogs/thumb_1352297316.jpg', 'relationships_mirage_and_more_'),
(172, 9, 'piclogs/resize_1352873646.jpg', 'www.inc.com', 5, 'The phobia of joblessness!!!', '<p>The fear of being jobless is one of my greatest fears. And there have been quite a few instances where I had to come face to face with this fear. In fact this happens in every job that I take up. In six years of my career, Iâ€™ve been more jobless than employed. Now, itâ€™s more than a phobia; itâ€™s a way of life.</p><p><br></p><p>I am accustomed to quitting jobs so often that you\\''ll find one document always ready with me - my resignation letter. Iâ€˜ve got it in different formats and styles. A typed soft copy is in the drafts of my email, a hard copy in my car, another copy in my laptop case, and a hand-written copy in my diary. Another benefit of quitting so often is that I have improved on my skills of writing a resignation letter. Now, Iâ€™m so good at writing resignation letters that most colleagues ask me to write it for them. In fact, I plan to take this up as a business opportunity, and start charging them for every letter I write. If people today consider me to be a decent writer, it\\''s only because of my experience in writing this document.</p><p><br></p><p>For me, being jobless might be a way of life but for many itâ€™s a great fear. A fear thatâ€™s difficult to overcome. But how does it feel when you know that you\\''re soon going to lose your job? Well, personally I feel being jobless is an achievement; not many people can do that. Unfortunately, Iâ€™m the only one who thinks so. I feel itâ€™s the society that injects this fear into unemployed people. Ironically, when youâ€™re employed, no one bothers to know where youâ€™re working or how much you are earning. But the moment you are jobless, these questions follow you like your shadow. The phobia of being jobless however starts from the day you start assuming that youâ€™re not going to last in your current organization for long. The assumption slowly transforms into a firm belief. And the final nail in the coffin is when you actually get an official intimation from you immediate boss that your services are not a value-addition to the organization. Hence, youâ€™d have to leave. One of my ex-bosses had a nice way to put this across to me. He said, â€œYouâ€™ve been working too hard from so many days. I think you should take a sabbatical!!â€</p><p><br></p><p>Come to think of it, the <em>fear</em> of being jobless, is a lot more than <em>actually</em> being jobless. With me the issue is not about getting another job. Itâ€™s my mind that wanders thinking of ways to while away my time when am doing nothing. I have mastered the art of doing nothing to an extent where I continue to do that even when am employed. One day I was discussing with my senior, how important my contribution to the organization was. â€œThis place doesnâ€™t value my contribution. I think I should not come to work for a few days. Only then these people will understand my worth.â€ To which my senior replied, â€œDon\\''t even think of doing that.â€ In a commanding tone I asked, â€œWhy?â€ To which he replied, â€œIf you donâ€™t come to work for a few days, people will get to know that they can manage things better when youâ€™re not around. Also, that it works to the organizationâ€™s advantage.â€</p><p><br></p><p>Another fear thatâ€™s related to the fear of being jobless is the fear of being broke. But for me, itâ€™s my friends who face the effects of me being jobless, and live in this fear. Their monthly budget shoots up. The effect is so strong that it actually travels and creeps into their love lives. They cook up stories to avoid their dates. If you think theyâ€™re highly accommodating, youâ€™re mistaken; I am demanding. The situation now isâ€¦ they pray for my employment more than I do. They look out for various job opportunities for me. Sometimes, even if am employed at that point in time. Itâ€™s like hoping for the best and preparing for the worst.</p><br>The first thing to find its place in a to-be-jobless or a currently jobless personâ€™s mind is frustration. I know a couple whose marriage was at stake when the husband was terminated. Frustration prevailed in him, as he would be locked up at home the entire day, and the wife would return late in the night. Frustration paved the way for insecurity, suspicion, self-pity, and finally, a role-reversal. The husband would then ask his wife questions that generally women ask. Where was she? What took her so long? Is she into an extra-marital affair? Is she seeking a divorce? The wife decided to answer only the last question; the answer was positive! <br><br>In a scenario like this where the husband is behaving like a woman, divorce is inevitable. As we all know two women (because a man behaving like a woman is as good, rather as bad, as a woman) canâ€™t live peacefully under one roof.', 'Publish to All', '1352873720', 'piclogs/resize_1352873646.jpg', 'the_phobia_of_joblessness'),
(171, 290, 'piclogs/resize_1352631826.jpg', 'Google', 6, 'Broken Yet Intact!!...', '&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; We have been broken a lot of times, tested a lot of times, played upon with a lot of times and also have been given importance , respect, support at the same time. <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;What is it that most leads to such situations? Its TRUST! the word which has so much more to it than what it seems.<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;We had started trusting since we were born. Then it was our parents whom we trusted no matter what. Be it a scary thing or support needed when we first learnt riding a bicycle we trusted them with all of it. And knew no matter what they will be there!.<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;As we grew we got to see the world getting into schools, colleges making friends putting your trust in them. Hoping them to be along whenever you would need them . Though not everyone stood up to it but it has always been a good run and also an experience that made you learn something.<br> Life is all about experiences broken trust or not either ways you get to experience a lot of things. You tend to see things beyond the appearance.<br> Trust if broken by one person is the only thing that still stays intact. Because when trust is broken we still dont just leave trusting anyone instead on the other side trust someone with everything. It stays broken yet intact!.<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Its a deep word though but then everyone has their own opinion to it. I would say TRUST wisely!....even if not its a good experience to become a good person!.', 'Publish to All', '1352631911', 'piclogs/resize_1352631826.jpg', 'broken_yet_intact_'),
(173, 7, 'piclogs/resize_1353095015.jpg', 'Shutter stock', 6, 'My Diwali', '<p>Every year, I look forward\nto Diwali as my big fat joint family comes together to light up our home with\nlove and laughter. Candles, lights, fireworks, family, laughter,\ncelebration, freedom are all words that represent Diwali for me. There is\nso much joy, love, and warmth during this festival! It gives the heart a\nsense of warmth and pride. I still remember the stories my grandmother\nwould tell me. In each legend, myth and story of Diwali, lies the\nsignificance of the victory of good over evil; and it is with each Diwali that this\nsimple truth finds new reason and hope. From darkness to light, that allows us\nto do good deeds, that brings us closer to divinity. During Diwali, lights\nilluminate every corner of my home and the scent of burning diyas hangs in the\nair combined with the sounds of fire-crackers, togetherness and hope.</p>', 'Publish to All', '1353095160', 'piclogs/thumb_1353095015.jpg', 'my_diwali'),
(174, 367, 'piclogs/resize_1353277033.jpg', 'www.vectorstock.com', 5, 'How do men think without their brains?', '<p><font>A young lady I am extremely fond of and hugely respect, recently \ninsinuated that men essentially think from their groin and rarely if ever \nexercise their brain.</font></p><p><font><br></font></p>\n<p><font>While on expressing surprise, the lady did admonish me and told \nme to take things â€˜lightâ€™, I still feel a wee bit affronted.</font></p><p><font><br></font></p>\n<p><font>I find it hard to imagine that the world is full of men who walk \naround with the sole purpose of mentally stripping women in their quest for \nsexual gratification. And I think many men stare at women in their finery only \nwith the connoisseursâ€™ eye and appreciate the raw beauty of her form and face \nand also her fashion sense.</font></p><p><font><br></font></p>\n<p><font>Not for a moment am I denying that nudity has its own appeal and \nnot for a second do I propagate the theory that only well built men and women \ncan carry off their nudity aesthetically. But at a generalisation that all men \nare â€˜pricksâ€™ I do balk.</font></p>\n<p><font>Similarly I am sure most of my sane women friends decide on \ntheir point of view without staring at the naughty bulge in our \npants.</font></p><p><font><br></font></p>\n<p><font>That said and done, I do laugh at jokes that talk of men \npointing in particular directions without using their hands and women nodding \ntheir acceptance by simply shaking theirâ€¦But thatâ€™s in jest. In a more sober \nworld I still feel that brains have to be respected and groins \nprotected.</font></p><p><font><br></font></p>\n<p><font>And women should dress for themselves, their friends and for the \nrandomness of mankind (not randyness mind you) and menâ€¦well they will be men, \nand dress carelessly and imagine that it is in their casualness that they will \nfind their uber chic.</font></p>\n<p><font>So finally, how do we men thinkâ€¦</font></p>\n<p><font>The groin is out. It went out of fashion with the Neanderthal. \nThe brain is suspect since it is always involved in an extra brainular affair \nbetween its right side and left. That leaves very little space to accommodate \nthe thinking function.</font></p><p><font><br></font></p>\n<p><font>The only zone that seems to be free to take up the challenge is \nthe stomach. Think about itâ€¦when we are deep in thought, donâ€™t we rub our \nbellies? When we feel a hunger for the company of the opposite sex doesnâ€™t our \nstomach gurgle? It does, donâ€™t it?</font></p><p><font><br></font></p>\n<p><font>So thatâ€™s the new image of the really brainy guyâ€¦no longer is it \na large forehead facilitated by a receding hairline but it is the size of the \nbelly. The size of the overhang. And so on.</font></p><p><font><br></font></p>\n<p><font>The ancient Hindus must have known thisâ€¦or else why did they \nindulge in â€˜Pait ka Poojaâ€™â€¦</font></p>', 'Publish to All', '1353277403', 'piclogs/resize_1353277033.jpg', 'how_do_men_think_without_their_brains_'),
(175, 290, 'piclogs/resize_1353405169.jpg', 'Google', 6, 'A Blessing in Disguise!....', '<font face="arial">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;"Friends", the word that gets a million moments and memories back to our minds. The time spent and probably the best part of our lives.&nbsp;</font><div><font face="arial"><br></font></div><div><font face="arial">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;At first we hesitate then we imitate next it mitigates and at last we dissipate. That''s what i feel is the friendship cycle. But not in all cases. Because sometimes its meant to be. No matter what!. And that''s the best part.</font></div><div><font face="arial"><br></font></div><div><font face="arial">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;I still remember how we all started as friends and had all the fun in the world!. Though we had nothing to do we had all the time in the world to talk about things and couldn''t be stopped. And when the life''s become busy we have a lot to do yet so less to talk about.</font></div><div><font face="arial"><br></font></div><div><font face="arial">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; We share things, experiences and time with friends which probably cant be shared even with our parents or siblings at times. It is an integral part of our lives which cannot be left out.</font></div><div><font face="arial"><br></font></div><div><font face="arial">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Friends are a blessing. A person could not have asked for more than a trustworthy and a very good friend next to him/her.</font></div><div><font face="arial">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</font></div><div><font face="arial">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; No matter sometimes friends stay but the friendship is swept away with time. But then it leaves us with a sense of who the deserving one was and who would leave us when we need them!.Who would be there for us no matter what and who would be left out making excuses!.</font></div><div><font face="arial"><br></font></div><div><font face="arial">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;No matter how far people move away from your life no matter how busy they might be in their own lives!...but friends will always be there!..</font></div><div><font face="arial"><br></font></div><div><font face="arial">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; So treasure what you have for you as a friend and life can be all the more a better experience and fun !!...</font></div>', 'Publish to All', '1353406046', 'piclogs/resize_1353405169.jpg', 'a_blessing_in_disguise_'),
(176, 198, 'piclogs/resize_1353506978.jpg', 'Bhartendu Vimal Joshi', 7, 'Beautiful Flower', 'This beautiful violet flower was at Baijnath Temple which is just 2 kms. From my home, It is a beautiful place for a tour. &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; ', 'Publish to All', '1353507230', 'piclogs/resize_1353506978.jpg', 'beautifulflower'),
(214, 417, 'piclogs/resize_1360055317.jpg', 'sahejit', 9, 'wild fox ', '<p><br>a wild fox I saw in a air field ... was walking with that attitude ..ahah lucky to get that sorta snap&nbsp; this without being chased ahah thnx to my 70-300mm ...hope u enjoy this pic many more coming ;) hahah ......................... plz post your comments and plz like :D ...btw im onli a 14&nbsp;year old photographer :D ................. so ur likes nd follows would give me lot of inspiration :D ......stay tuned for more pics lyk these !! .......................................this pic has been taken by a canon 1100D </p>', 'Publish to All', '1360055645', 'piclogs/resize_1360055317.jpg', 'wild_fox_'),
(215, 417, 'piclogs/resize_1360055716.jpg', 'sahejit groove taneja', 9, 'rottweiler ', '<br>A Rottweiler&nbsp; looking as powerful as ever as majestic as ever as fun loving as ever as faithful as ever ! a Rottweiler&nbsp; just lazing around on a hot sunny day ............looks just soooo bold! well as they say dogs are mans best friend that is soo true ! hmmm ....... hope u lyk this image <br>please like and follow me :D I am a budding photographer ....btw I am only 14 years old soo :D yea !&nbsp;&nbsp; <br>&nbsp;&nbsp; this image has been taken by a canon 1100D with a 70-300 tamron lens mounted <br>sahejit groove taneja :D', 'Publish to All', '1360056058', 'piclogs/resize_1360055716.jpg', 'rottweiler_'),
(225, 427, 'piclogs/resize_1361831540.jpg', 'Naruto Manga', 13, 'Sasuke - Naruto', 'The Will Of Fire', 'Publish to None', '1361831540', 'piclogs/resize_1361831540.jpg', 'sasuke_naruto'),
(178, 3, 'piclogs/resize_1353574901.jpg', 'Self', 3, 'Business Sense - Back-to-basics!', 'The tender coconut seller knows the tricks of the trade better than some self proclaimed Entrepreneurs. He demonstrates a perfect sense of the 4Ps of Marketing â€“ Product, Price, Place and Promotion. <br><br>With the temperature soaring, heâ€™s got the perfect Product to beat the heat. With a Price point thatâ€™s low, it promises great value to potential customers. <br><br>A perfect Place at an uptown locale â€“ Jubilee Hills, Road # 36 (Hyderabad), gives him great visibility. <br><br>The Product (tender coconut) is stacked and displayed all around him. <br><br>The usage of colour Red is perfect for grabbing optimum attention of the target audience, in terms of the Promotion. His sales, of course, are sky-rocketing keeping the investment-revenue ration in mind.<br><br>A perfect example of marketing and advertising (Promotion), he along with many other vendors, clearly reiterate that itâ€™s the subject matter which is of utmost importance;subject matter that comes from getting the basics right, subject matter that comes from experiencing the trade right from the ground level.', 'Publish to All', '1353576430', 'piclogs/resize_1353574901.jpg', 'business_sense_back_to_basics_'),
(179, 1, 'piclogs/resize_1353687963.jpg', 'Ravikanth Katkam', 7, '32000 year old Idol of Narasimha (Lord Vishnuâ€™s Avatar) found in Germany', '<div style="text-align: justify;">Many news about prehistoric founds and their possible meaning reached the world in the last decades. One of them, found in South Germany, puts scientist around the world in amazement. The centerpiece is the â€œlion manâ€, an idol that is made from the tusk of a mammoth in the form of a human body with a lion head. Amazingly itis dated back 32,000 years from now.</div><div><div style="text-align: justify;"><br></div><div style="text-align: justify;">This discovery brought a lot of attention in the archaeological circles in Europe. In Excavations around 1930-35 at the Lonetal area near Ulm, German scientist already found an immense cave system with lots of prehistoric artifacts in it.</div><div style="text-align: justify;"><br></div><div style="text-align: justify;">First, only representations of birds, horses, turtles and even single lions where found but not a morphological combination of men and animal. Naturally the â€œlion manâ€ was quite outstanding and unique. It became also clear during the later examinations that the â€œlion-menâ€ was used for ritual purposes, unlike the other items which seemed to have accompanied the dead and so on.</div><div style="text-align: justify;"><br></div><div style="text-align: justify;">The Idol was found exactly at the place in the cave where day and night meet, about 20 meters away from the entrance and buried 1,20 meter deep under the ground. Many parts of the figure were broken and where found a little away in this area. Therefore it took some time to finish the work of completing and reconstructing the figure and to see it as a whole.</div><div style="text-align: justify;"><br></div><div style="text-align: justify;">Idol of Lord Narasimha</div><div style="text-align: justify;">From the viewpoint of Vedic culture of ancient India, Lord Vishnu appeared in a divine human form with a lion face to protect his devotee and to stop religiousness. A description of a standing idol form of this lord is found in the agama silpa shastra and is called â€œkevala narasimhaâ€. In India still many ancient temples exist, where deities of Sri Narasimha Bhagavan are worshiped, often at special locations like on high mountain peaks or in caves.</div><div style="text-align: justify;"><br></div></div><div><div style="text-align: justify;">Many ancient, highly developed cultures had some kind of idols or pictures of lions with a human face or torso. A purely ritualistic Relic, like for example the Sphinx of gizeh or the Egyptian goddess of war sekhmetm, with a lion head, or Mithra, the Sun god of Persia, with a lion face, the Assyrian Gate Guardians of Babylon or the Etruscan lion with wings at the entrance of the Temple mountain at Troy are well known examples for this.</div><div style="text-align: justify;"><br></div></div><div><div style="text-align: justify;">An now this amazing discovery in Lonetal in a deep cave which is directed to north east towards the little river lone. Extraordinary is also the exact position of the found of the lion-man. It immediately reminded me of the ancient story from the Puranas, known to all devotees of LordVishnu, where Hiranyakashipu, the great demon, achieved nearly immortality by the blessings of Brahma. This demon asked for the boon that he could not be killed by a beast or man, nor in the sky or on earth, not inside or outside a house, not in the day or in the night, not with weapons or by hand and so on. Lord Vishnu then appeared out of a column to kill this demon. But to fulfill the boon Brahma gave, he appeared at dusk and killed him on the doorsteps of his palace with his sharp nails.</div><div style="text-align: justify;"><br></div></div><div style="text-align: justify;">It is off course difficult or maybe impossible to finally judge if this idol was a part of a global Vedic civilization but nonetheless our visit of the exhibition, where one can see the figure in a cave like hall, and our later trip to the original place of discovery where very breathtaking and mystical and made us meditate deeply about our predecessors and ancient times long ago where god was present directly on earth, or later in his idol form in many temples all around the world.</div>', 'Publish to All', '1353688105', 'piclogs/thumb_1353687963.jpg', '32000_year_old_idol_of_narasimha_lord_vishnu_s_avatar_found_in_germany');
