(180, 314, 'piclogs/resize_1354283373.jpg', 'shirdi sai baba sansthan shirdi', 12, 'SHIRDI SAI BABA', '<p><strong>Sai Baba of Shirdi</strong> (Unknown â€“ October 15, 1918), also known as <strong>Shirdi ke Sai Baba</strong> (<a href="http://en.wikipedia.org/wiki/Marathi_language" title="Marathi language">Marathi</a>: à¤¶à¤¿à¤°à¥à¤¡à¥€à¤šà¥‡ à¤¶à¥à¤°à¥€ à¤¸à¤¾à¤ˆà¤¬à¤¾à¤¬à¤¾, Tamil: à®·à¯€à®°à®Ÿà®¿ à®šà®¾à®¯à®¿ à®ªà®¾à®ªà®¾, <a href="http://en.wikipedia.org/wiki/Urdu" title="Urdu">Urdu</a>: Ø´Ø±Ø¯ÛŒ Ø³Ø§Ø¦ÛŒÚº Ø¨Ø§Ø¨Ø§â€Ž), was an <a href="http://en.wikipedia.org/wiki/India" title="India">Indian</a> <a href="http://en.wikipedia.org/wiki/Guru" title="Guru">guru</a>, <a href="http://en.wikipedia.org/wiki/Yogi" title="Yogi">yogi</a>, and <a href="http://en.wikipedia.org/wiki/Fakir" title="Fakir">fakir</a> who is regarded by his <a href="http://en.wikipedia.org/wiki/Hindu" title="Hindu">Hindu</a> and <a href="http://en.wikipedia.org/wiki/Muslim" title="Muslim">Muslim</a>devotees as a saint. Many Hindu devotees â€” including <a href="http://en.wikipedia.org/wiki/Hemadpant" title="Hemadpant">Hemadpant</a>, who wrote the famous <em>Shri Sai Satcharitra</em> â€” consider him an <a href="http://en.wikipedia.org/wiki/Incarnation" title="Incarnation">incarnation</a> of Lord <a href="http://en.wikipedia.org/wiki/Krishna" title="Krishna">Krishna</a><sup><a href="http://en.wikipedia.org/wiki/Sai_Baba_of_Shirdi#cite_note-Sai_Satcharitra_in_English-1">[1]</a></sup> while other devotees consider him as an incarnation of Lord <a href="http://en.wikipedia.org/wiki/Dattatreya" title="Dattatreya">Dattatreya</a>. Many devotees believe that he was a <a href="http://en.wikipedia.org/wiki/Satguru" title="Satguru">Satguru</a>, an enlightened Sufi <a href="http://en.wikipedia.org/wiki/Pir_(Sufism)" title="Pir (sufism)">Pir</a>, or a <a href="http://en.wikipedia.org/wiki/Qutb" title="Qutb">Qutub</a>. No verifiable information is available regarding Sai Baba''s birth and place of birth.</p><p>Sai Baba''s real name is unknown. The name "Sai" was given to him upon his arrival at <a href="http://en.wikipedia.org/wiki/Shirdi" title="Shirdi">Shirdi</a>, a town in the west Indian state of <a href="http://en.wikipedia.org/wiki/Maharashtra" title="Maharashtra">Maharashtra</a>. Mahalsapati, a local temple priest, recognized him as a Muslim saint and greeted him with the words ''Ya Sai!'', meaning ''Welcome Sai!''. <em>Sai</em> or <em>Sayi</em> is a <a href="http://en.wikipedia.org/wiki/Persian_language" title="Persian language">Persian</a> title given to <a href="http://en.wikipedia.org/wiki/Sufi" title="Sufi">Sufi</a> saints, meaning ''poor one''.<sup><a href="http://en.wikipedia.org/wiki/Sai_Baba_of_Shirdi#cite_note-2">[2]</a></sup> The honorific "Baba" means "father; grandfather; old man; sir" in <a href="http://en.wikipedia.org/wiki/Indo-Aryan_languages" title="Indo-Aryan languages">Indo-Aryan</a> languages. Thus Sai Baba denotes "holy father", "saintly father" or "poor old man".<sup><a href="http://en.wikipedia.org/wiki/Sai_Baba_of_Shirdi#cite_note-3">[3]</a></sup> However, <em>SÄÄ«</em> may also refer to the <a href="http://en.wikipedia.org/wiki/Sanskrit" title="Sanskrit">Sanskrit</a> term "Sakshat Eshwar" or the <em>divine</em>.</p><p>Sai Baba remains a very popular saint,<sup><a href="http://en.wikipedia.org/wiki/Sai_Baba_of_Shirdi#cite_note-srinivas-4">[4]</a></sup> especially in India, and is worshiped by people around the world. He had no love for perishable things and his sole concern was self-realization. He taught a moral code of love, forgiveness, helping others, charity, contentment, inner peace, and devotion to God and guru. Sai Baba''s teaching combined elements of <a href="http://en.wikipedia.org/wiki/Hinduism" title="Hinduism">Hinduism</a> and <a href="http://en.wikipedia.org/wiki/Islam" title="Islam">Islam</a>: He gave the Hindu name <em>Dwarakamayi</em> to the <a href="http://en.wikipedia.org/wiki/Mosque" title="Mosque">mosque</a> he lived in,<sup><a href="http://en.wikipedia.org/wiki/Sai_Baba_of_Shirdi#cite_note-hoiberg-5">[5]</a></sup> practiced Hindu and Muslim rituals, taught using words and figures that drew from both traditions, and was buried in <a href="http://en.wikipedia.org/wiki/Shirdi" title="Shirdi">Shirdi</a>. One of his well known epigrams, "<em>Sabka Malik Ek</em> " ("One God governs all"), is associated with Islam and Sufism. He always uttered <em>"<a href="http://en.wikipedia.org/wiki/Allah" title="Allah">Allah</a> <a href="http://en.wikipedia.org/wiki/Malik" title="Malik">Malik</a>"</em> ("God is King").<sup><a href="http://en.wikipedia.org/wiki/Sai_Baba_of_Shirdi#cite_note-6">[6]</a></sup></p><p>Some of Sai Baba''s disciples became famous as spiritual figures and saints, such as Mahalsapati, a priest of the <a href="http://en.wikipedia.org/wiki/Khandoba" title="Khandoba">Khandoba</a> temple in Shirdi, and Upasni Maharaj. He was revered by other saints, such as Saint Bidkar Maharaj, Saint Gangagir, Saint Janakidas Maharaj, and Sati Godavari Mataji.<sup><a href="http://en.wikipedia.org/wiki/Sai_Baba_of_Shirdi#cite_note-7">[7]</a></sup><sup><a href="http://en.wikipedia.org/wiki/Sai_Baba_of_Shirdi#cite_note-Dabholkar.2C_Govind_Raghunath_1999-8">[8]</a></sup> Sai Baba referred to several saints as ''my brothers'', especially the disciples of <a href="http://en.wikipedia.org/wiki/Swami_Samarth_Maharaj" title="Swami samarth maharaj">Swami Samartha of Akkalkot</a>.<sup><a href="http://en.wikipedia.org/wiki/Sai_Baba_of_Shirdi#cite_note-Dabholkar.2C_Govind_Raghunath_1999-8">[8]</a></sup></p>', 'Publish to All', '1354283596', 'piclogs/resize_1354283373.jpg', 'shirdi_sai_baba'),
(181, 3, 'piclogs/resize_1354622560.jpg', 'What''s In a Name Creatives', 3, 'The power of creative communication (Case Study)', '<p><strong>Client:</strong> Silk\nRoute (Earlier known as Thai Express)</p>\n\n<p><strong><br>History:</strong> Thai\nExpress - the restaurant was located on the 1<sup>st</sup> floor of a fairly busy\nMall. The only cuisine served however, was authentic Thai. Frequented by food\nconnoisseurs of the city, this place managed to get hold of a niche customer\nbase. But this base was small in number; obviously because of the specialty\ncuisine that was being offered.</p>\n\n<p></p>\n\n<p><strong><br>Next up:</strong> The\nrestaurant moved to the 4<sup>th</sup> floor of the same building. And the\nearlier place was taken over by another restaurant that served Gujarati and\nRajasthani Thali. This gave people the impression that Thai Express was shut.\nThe number of walk-ins dropped. It was decided to add more cuisines and\nre-brand the place.</p>\n\n<p></p>\n\n<strong><br>The\nchallenge:</strong> To\nre-brand the new restaurant with added cuisines and maintaining the fact that the\nThai cuisine being served is still as authentic. Also, to convey the message to\nthe audience that â€œThai Expressâ€ is not really shut; itâ€™s just been re-branded\nwith more cuisine options!<br><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</div>', 'Publish to All', '1354623677', 'piclogs/resize_1354622560.jpg', 'the_power_of_creative_communication_case_study_'),
(182, 1, 'piclogs/resize_1354789831.jpg', 'Hyderabad Traffic Police (FB)', 10, 'Traffic Awareness !', 'Many hero''s turned to zeros doing such feats..Drive safe...save lives....Admin MH !<div><br></div><div>Many hero''s turned to zeros doing such feats..Drive safe...save lives....Admin MH !</div><div><br></div><div>Many hero''s turned to zeros doing such feats..Drive safe...save lives....Admin MH !</div><div><br></div><div>Many hero''s turned to zeros doing such feats..Drive safe...save lives....Admin MH !</div><div><br></div><div>Many hero''s turned to zeros doing such feats..Drive safe...save lives....Admin MH !</div><div><br></div><div>Many hero''s turned to zeros doing such feats..Drive safe...save lives....Admin MH !</div>', 'Publish to All', '1354790010', 'piclogs/resize_1354789831.jpg', 'traffic_awareness_'),
(183, 1, 'piclogs/resize_1354790686.jpg', 'Hyderabad Traffic Police (FB)', 10, 'Spirits remain high even as road accidents decrease ', '(Published in THE HINDU on 30-11-2012)<br><br>No significant dip in number of drunken driving cases<br><br>Even after the year-long enforcement against drunken driving along with the threat of a dayâ€™s imprisonment, there has been no dip in the number of cases registered. On an average, the traffic police catch about 800 motorists for driving intoxicated each month.<br><br>Ideally, there should have been a dip in the number of cases in the last year as this would imply that people are avoiding drunken driving, but the number of cases has not gone down significantly, a police official wryly observes. However, there has been a shift in the areas where people are being caught.<br><br>â€œWhile a majority of cases were booked in areas such as Banjara Hills and Jubilee Hills earlier, the contribution from the rest of the areas has gone up in the last few months significantly,â€ the official said.<br><br>The year-long enforcement has also brought up a few interesting findings. Two-wheeler drivers lead the roost in mixing up their drinks and rides as more than 6,900 were apprehended. They are followed by the 2,839 four-wheeler drivers and 460 auto rickshaw drivers. The police have booked more than 10,000 people during the drive.<br><br>Bulk of offenders caught during the drive fall between the age of 20 and 40 years and most of them were caught with blood alcohol levels (BAC) between 30 mg and 100 mg alcohol per 100 ml blood. According to Motor Vehicle Act, a driver found with BAC of more than 30 mg per 100 ml blood can be booked for drunken driving.<br><br>Statistics also show that a major portion of those caught during the drive were either businessmen or â€˜blue collarâ€™ workers. Private sector employees, software professionals, students and government employees were other major groups involved.<br><br>Anyway, even though the number of people caught for drunken driving has not come down, there has been a significant reduction in the accidents that take place. About 2,651 accidents were recorded in the year 2011, of which 441 were fatal. Till October 2012, only about 2,167 accidents have been recorded, in which 401 lost their lives.<br><br>â€œThere has been a reduction in the number of accidents particularly between 8 p.m. and midnight during the weekends after we started the enforcement,â€ the official observed, a tad bit happy.', 'Publish to All', '1354790727', 'piclogs/resize_1354790686.jpg', 'spirits_remain_high_even_as_road_accidents_decrease_'),
(184, 379, 'piclogs/resize_1355768294.jpg', 'Google', 8, 'Magical Voice', 'Rihanna was born in a parish in Barbados called St. Michael. She lived the life of a normal island girl going to Combermere, a top sixth form school. Rihanna won numerous beauty pageants and performed&nbsp;<a href="http://www.imdb.com/name/nm0001014/">Mariah Carey</a> "Hero" in a school talent show. Her life changed forever when one of her friends introduced her to Evan Rodgers, a producer from New York who was in Barbados for a vacation with his wife, who is a native. Rodgers arranged for her to go to New York to meet&nbsp;<a href="http://www.imdb.com/name/nm0419650/">Jay-Z</a>, CEO of Def Jam Records. He heard her sing and knew she was going to be incredibly successful. She was 16 when she was signed to Def Jam. Since then, she''s amassed phenomenal success.', 'Publish to All', '1355769567', 'piclogs/resize_1355768294.jpg', 'magical_voice'),
(185, 96, 'piclogs/resize_1355769844.jpg', 'google', 13, 'And this is magical!', '<p><strong>Kareena Kapoor</strong> (<small>pronounced</small><a href="http://en.wikipedia.org/wiki/Wikipedia:IPA_for_Hindi_and_Urdu" title="Wikipedia:IPA for hindi and urdu">[kÉ™ËˆriËnaË kÉ™ËˆpuËr]</a>; born 21 September 1980), also known as <strong>Kareena Kapoor Khan</strong>, is an Indian actress who appears in <a href="http://en.wikipedia.org/wiki/Bollywood" title="Bollywood">Bollywood</a> films. During her career Kapoor has been noted for her performances in a range of <a href="http://en.wikipedia.org/wiki/Film_genre" title="Film genre">film genres</a>, from contemporary <a href="http://en.wikipedia.org/wiki/Romance_film" title="Romance film">romantic dramas</a> to <a href="http://en.wikipedia.org/wiki/Comedy" title="Comedy">comedies</a>, <a href="http://en.wikipedia.org/wiki/Period_film" title="Period film">period films</a> to major Bollywood productions and less-publicised <a href="http://en.wikipedia.org/wiki/Independent_film" title="Independent film">independent films</a>.<sup><a href="http://en.wikipedia.org/wiki/Kareena_Kapoor#cite_note-Journey-1">[1]</a></sup><sup><a href="http://en.wikipedia.org/wiki/Kareena_Kapoor#cite_note-2">[2]</a></sup></p><p>Born into a family where her parents, <a href="http://en.wikipedia.org/wiki/Randhir_Kapoor" title="Randhir kapoor">Randhir Kapoor</a> and <a href="http://en.wikipedia.org/wiki/Babita" title="Babita">Babita</a>, and elder sister <a href="http://en.wikipedia.org/wiki/Karisma_Kapoor" title="Karisma kapoor">Karisma</a> were actors, Kapoor faced the media spotlight at a young age but did not make her acting debut until the 2000 film <em><a href="http://en.wikipedia.org/wiki/Refugee_(film)" title="Refugee (film)">Refugee</a></em>. Her <a href="http://en.wikipedia.org/wiki/Melodrama" title="Melodrama">melodrama</a> <em><a href="http://en.wikipedia.org/wiki/Kabhi_Khushi_Kabhie_Gham..." title="Kabhi khushi kabhie gham...">Kabhi Khushi Kabhie Gham...</a></em>became India''s highest-grossing film in the overseas market in 2001, and is one of her greatest commercial successes to date. After receiving negative reviews for a series of repetitive roles, Kapoor accepted more demanding parts to avoid being <a href="http://en.wikipedia.org/wiki/Typecasting_(acting)" title="Typecasting (acting)">typecast</a> and was recognised by critics for displaying greater versatility as an actress. Her portrayal of a sex worker in <em><a href="http://en.wikipedia.org/wiki/Chameli_(film)" title="Chameli (film)">Chameli</a></em> (2004) proved to be the turning point in her career, and she was later noted for her performances in the critically acclaimed films <em><a href="http://en.wikipedia.org/wiki/Dev_(film)" title="Dev (film)">Dev</a></em> (2004) and <em><a href="http://en.wikipedia.org/wiki/Omkara_(film)" title="Omkara (film)">Omkara</a></em>(2006). She went on to play the lead female role in the <a href="http://en.wikipedia.org/wiki/Imtiaz_Ali_(director)" title="Imtiaz ali (director)">Imtiaz Ali</a>-directed <a href="http://en.wikipedia.org/wiki/Romantic_comedy_film" title="Romantic comedy film">romantic comedy</a> <em><a href="http://en.wikipedia.org/wiki/Jab_We_Met" title="Jab we met">Jab We Met</a></em> (2007, for which she received the <a href="http://en.wikipedia.org/wiki/Filmfare_Award_for_Best_Actress" title="Filmfare award for best actress">Filmfare Award for Best Actress</a>) and the drama <em><a href="http://en.wikipedia.org/wiki/3_Idiots" title="3 idiots">3 Idiots</a></em> (2009, the <a href="http://en.wikipedia.org/wiki/List_of_highest-grossing_Bollywood_films" title="List of highest-grossing bollywood films">highest-grossing Bollywood film of all time</a>). These accomplishments have established her as a leading actress of Hindi cinema.<sup><a href="http://en.wikipedia.org/wiki/Kareena_Kapoor#cite_note-CNNGo-3">[3]</a></sup><sup><a href="http://en.wikipedia.org/wiki/Kareena_Kapoor#cite_note-Versatility-4">[4]</a></sup></p><br>', 'Publish to Followers', '1355770254', 'piclogs/resize_1355769844.jpg', 'and_this_is_magical_'),
(186, 290, 'piclogs/resize_1356288072.jpg', 'self', 6, 'Creativity at its best!...', '&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<font face="helvetica"> What would be your first thought on seeing a colourful\nbutterfly around. Colourful, Beautiful, lovely etc... well we tend to see only\nwhat we want to. But then a little colourful butterfly shows us that the world\nand everything we know is a blend of different things. Different colours,\ndifferent people, different castes etc.\n\n</font><p><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</font></p><p><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; A\nsociety or the environment around us consists a lot of things itâ€™s like a whole\nworld in itself and like the nature is a blend of a variety of things , people\nranging from ignorant , to angry , persuasive to diplomatic. People have their\nown attitude and their own way of reacting to situations they have their own\ncolours which are portrayed in front of the society and thatâ€™s what we see of\nthem. Like a little butterfly we too have colours of anger, politeness,\nattitude all at the same time!</font></p>\n\n<p><font face="helvetica"><br></font></p><p><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; We do not entirely enjoy the nature or admire\nthe creativity around us. It can truly teach us a lot of things. Itâ€™s like an\nexplanation to everything we see and experience. We see an ant struggling to\ncarry its food even though its way heavier than the creature itself. Thatâ€™s\nhard work and the spirit to never give up. The colours of nature and the forces\nof nature teach us when there is a balance required.</font></p>\n\n<p><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</font></p><p><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; The\ncolours of nature show us how every1 looks the same but is still unique in\ntheir own way and have their own duty to be fulfilled. The creativity teaches\nus to imagine. The silence helps us keep at peace and there is a lot more to\nnature as we know it. Only if we tend to see beyond the usual .</font></p>\n\n<p><font face="helvetica"><br></font></p><p><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; The\nscientists try figuring out how the world was formed and the nature of various\nthings. But the conclusion would be no matter how it was made or how things\nwork itâ€™s the way they were meant to be and itâ€™s in perfect sync with each\nother. No two things collide with each other or cause an obstruction of sorts.\nItâ€™s the perfect design and a way of life for each being in its own place.</font></p>\n\n<p><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</font></p><p><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; You\ncanâ€™t see them defying nature. Every creature does its own thing as per its\nnature in a perfectly organised manner. Thatâ€™s the way itâ€™s been designed and\nis meant to function. Well thatâ€™s creativity and beyond any humans imaginations\ni guess. There are some questions that cannot be answered by scientists. But it still goes on.</font></p>\n\n<p><font face="helvetica">&nbsp; &nbsp;&nbsp;</font></p><p><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; The\nnature if we experience it has everything we experience in our daily life\naround with people. Everything is like a small model of the big world.</font></p>\n\n<p><font face="helvetica"><br></font></p><p><font face="helvetica">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Their\nis a whole world in every small thing!.There is an artistic imagination and an\ninspiration in everything. God has put everything in place and it all shows the\ncreativity and he is the best artist ever known!...So if ever you get time to\nadmire it. And experience the brilliance!...</font></p></div>', 'Publish to All', '1356288366', 'piclogs/resize_1356288072.jpg', 'creativity_at_its_best_'),
(187, 290, 'piclogs/resize_1356292291.jpg', 'google.', 6, 'A Never Ending Lane!', '&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;MEMORIES!. Everyone has them.\nEveryone experiences them in their lives. Its something that comes uninvited\nwith time and stays on for times unknown. People hold on to memories for a\nlifetime. For some itâ€™s a way of living. It is what is left of them, its a hope\nfor survival etc.</div>\n\n<p><br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; We all have memories all good and\nbad. But no matter how many bad memories one has got one good memory can just\nwash its way past them. With every minute that passes by we tend to make\nmemories unseen, and unimagined. They just keep forming. </p>\n\n<p><br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; We rely on them and realise them the\nmost when we are lonely or have moved on in life. Memories with friends are the\nbest times. The period when we study is when we actually learn a lot and also\nexperience a lot be it fun be it sadness or various other expressions. The best\nmemories are the ones with the closest people.</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; An unplanned outing or a planned bunk\nfrom college or school can turn up to become the best memory of your academic\nlife. Itâ€™s a lane that has no dead end and just keeps on expanding with the\npassage of time, life and the people in it. Memories are the best thing that\ncan happen to people. </p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;As told at various occasions â€œPeople change, but the memories donâ€™tâ€\nthey still remain and the people in them too. Itâ€™s something you hold on to at\ntough times to keep you going.</p>\n\n<p><br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; When memories can bring back a\nthousand thoughts and bring a smile on your face they also can shatter you and\nbreak you into tears. We donâ€™t realise having memories or sowing it up in our\nminds until the time we have moved in a different phase of life and all the\npast comes pouring in...in every aspect of life. Just makes u feel all the more\nvulnerable and makes u miss all the good old days and the experiences you had\nin your life.</p>\n\n<p><br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; They form an important part. They\nlet u be what we are in the present. They help form us.&nbsp;Sometimes memories are\nwhat hold us back from doing a thing. And at times they are the ones that push\nus forward to take risks in lives and experience new avenues and have fun and\npave way for even more memories. And when you realise the seed of memories you\nhad sown has already become a huge tree with branches that reach out in every\nphase of your life, hold back your good times and the bad ones, while the good\nones keep you going the bad ones also leave you with experience which is a good\nthing again!.</p>\n\n<p><br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Everyone reading this must be\ngoing through a thousand memories and good or bad. They are a part of your\nlife. They are a part of who we are and what we do the way we do it. Memories i\nsay Make a person!...and can hold them together.!</p>\n\n<p><br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Memory is a never ending\nlane that goes on with every breath until...we stop breathing. So make as many\nas you can those that you remember and can be remembered by the others.!</p>', 'Publish to All', '1356292584', 'piclogs/resize_1356292291.jpg', 'a_never_ending_lane_'),
(188, 290, 'piclogs/resize_1356622042.jpg', 'google', 6, 'Punctual and Virtual.....!!', '&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;We live in an age where No. of Notifications, likes,\ncomments, shares, friends and followers determine the popularity of a person\nrather than the group of friends or the company they have. The world has become\na global village all thanks to the virtual lives people have. Itâ€™s like\neverything a person ever wanted to be can be virtual. Virtual lives have\nevolved over the period.</div>\n\n<p></p>\n\n<p><br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; At\nfirst it was with the beginning of e-mails, then came messengers. Yahoo, then\nMSN, Google, Orkut, then the revolutionary FACEBOOK and TWITTER dominated and\nhandled the virtual lives of about 70% of the world population or atleast most\nof them with an internet access. The avenues to having a virtual life are\ngrowing easier by the day. Making applications for almost all possible devices\nthat can access internet.</p>\n\n<p>&nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Though\npeople stay in touch virtually, it is ruining the social existence of people.\nThe ethics and morale has been revolutionised and indeed is applicable\nvirtually rather than physically. Also staying punctual yet virtual is the most\nhappening thing of peopleâ€™s lives. This\nis being criticised and comprehended at every step by their own selves.</p>\n\n<p><br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Everyone\ncriticises about their privacy being intruded while they themselves update\nevery minute of happening in their lives. Not logging into an ID a day is\nequivalent to missing out on a million dollar deal. While there are also others\nto whom the happenings of a virtual life donâ€™t matter at all as they donâ€™t\nbother to use it.</p>\n\n<p><br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Facebook\nand twitter have surely revolutionised the age of virtually connecting with the\nloved ones and people all around the world. Everyone is aware of facebook and\ntwitter and if colleges and schools are attended or not attendance for such\nvirtual profiles is a must. If noted many would score a 100% attendance.</p>\n\n<p> Its\nalso made people lazy at the same time. &nbsp;&nbsp;</p><p>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Everything we possible could think of\ncan now be ordered online with various payment options making lives all the\nmore easier and people all the more lazier.</p>\n\n<p><br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Social\nmedia and advertising is also on a rise as it is much more easier and\naccessible also reaches the target audience with ease. Thereby paving various\navenues for new business ideas and utilising the benefits of the technology\ncalled internet.</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; REVOLUTIONS\nnowadays also take place virtually. No matter what the reason or whatever the\ntopic. Sharing a picture does it all. Changing statuses, profile pictures,\nsending messages and putting up slogans on walls is the new age revolution.\nWhich hardly proves a point or is discussed and fades away as fast as it had\npicked up? Without actually helping the cause. But then people actually tend to\nbelieve that sharing things on facebook \nis going to save lives and be helpful!.</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;With\ngoogle as the answer to almost anything the burden of thinking is as low as\nminimal. Donâ€™t find anything in books, search it on google. If it doesnâ€™t exist\non google then probably it doesnâ€™t exist at all. Thatâ€™s the place google holds for\nanyone with internet access.</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; So\npunctuality in virtuality is the mantra for the world at the moment. And guess\nit will just keep growing!.</p>', 'Publish to All', '1356622293', 'piclogs/resize_1356622042.jpg', 'punctual_and_virtual_'),
(189, 390, 'piclogs/resize_1357369919.jpg', 'ruptrishna nath photography', 7, 'LOVE !', 'I was walking around a cathedral and was observing the flowers in one of the gardens .. i must say , very deeply ! and then i chanced upon this flower which represents the shape of an "L" . i think its beautiful ! i clicked it and then edited the rest of the alphabets into the picture to make up a "LOVE" !<div>i love this picture !</div>&nbsp;<div>&lt;3 &lt;3 &lt;3 &lt;3 &lt;3&nbsp;&lt;3 &lt;3 &lt;3 &lt;3 &lt;3&nbsp;&lt;3 &lt;3 &lt;3 &lt;3 &lt;3&nbsp;&lt;3 &lt;3 &lt;3 &lt;3 &lt;3&nbsp;&lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3&nbsp;&lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3&nbsp;&lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3&nbsp;&lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3&nbsp;&lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3&nbsp;&lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;3 &lt;