(190, 391, 'piclogs/resize_1357453750.jpg', 'Pulkit..Clicks n Edits', 1, 'Beauty of Mud Moulds ', '<p>"A photographer, a painter, a musician.." Do you think only these can be artist?<br>NO..<br></p><p>These&nbsp;handicraft idols&nbsp;are made by some ARTISTS (mostly Potters)&nbsp;using Clay and Mud and then these are painted.<br>exhibited for sale..</p><p>&nbsp;Handicraft is the art of creating products using raw and indigenous materials.</p><p>&nbsp;</p><p>One can easily imagine how beautiful they look when put together..</p><p>people look at these.. Some buy it.. Some leave after bargaining..</p><p><br>The pic is captured at Jawahar Kala Kendra, Jaipur (Rajasthan).</p>', 'Publish to All', '1357456058', 'piclogs/resize_1357453750.jpg', 'beauty_of_mud_moulds_'),
(191, 391, 'piclogs/resize_1357477221.jpg', 'Pulkit..Clicks n Edits', 1, 'Mercedes - Most common Royalty ', '<font face="trebuchet ms">Mercedes- its a name that all of us have heard..<br>there is hardly anyone who is unaware of the name..<br><br>for a person from a middle class it is the name for which he just have a single thought i.e. MOST EXPENSIVE CAR..<br><br>Well, Here no one would be interested to know about Mercedes as Google is the father of every known and unknown things..<br><br>still I would like to introduce this model from Mercedes. On dated Dec 27, 2012 this car was a point of attraction on the roads of Jaipur, (Rajasthan).<br>Even i search Google and all i could know about this model was its W series from Mercedes.</font><div><font face="trebuchet ms">An estimated and rough time period i for this series was&nbsp;</font><u>1965â€”1972</u></div>&nbsp; &nbsp; &nbsp;and main two cars were W108 and W109<font><br><br>this picture was clicked by me at M.I. Road , Jaipur. and of course it was edited..by me only..</font><div><font face="trebuchet ms"><br></font></div><div><font face="trebuchet ms"><br>If you liked the photography join www.facebook.com/editfun&nbsp;<br><br></font></div>', 'Publish to All', '1357479269', 'piclogs/resize_1357477221.jpg', 'mercedes_most_common_royalty_'),
(192, 391, 'piclogs/resize_1357497408.jpg', 'Pulkit..Clicks n Edits', 11, 'Bhangarh- The haunted place', '<font face="courier new">Country - India</font><div><font face="courier new">State - Rajasthan</font></div><div><font face="courier new">District - Alwar</font></div><div><font face="courier new">Nearest City - Dausa</font></div><div><font face="courier new"><br></font></div><div><font face="courier new">The part of information is copied from Wikipedia :</font></div><div><font face="courier new"><br></font></div><div>Bhangarh is a place between Jaipur and Delhi&nbsp;in Rajasthan state of India known for its ruins. Bhangarh is also a pre-historic site. The most remarkable of its buildings are the temples of&nbsp;<a href="http://en.wikipedia.org/wiki/Gopinath" title="Gopinath">Gopinath</a>,<a href="http://en.wikipedia.org/wiki/Shiva" title="Shiva">Shiva</a> (Someshwar), Mangla Devi, Lavina Devi and<a href="http://en.wikipedia.org/wiki/Keshava" title="Keshava">Keshava</a> Rai. Other buildings include shops along the main road, several&nbsp;<a href="http://en.wikipedia.org/wiki/Haveli" title="Haveli">havelis</a>, a mosque, and a palace.&nbsp;The palace was protected by two inner fortifications across the valley. The town is separated from the plain by ramparts with five gates.</div><div><br></div><div>Bhangarh is among top most haunting places of India.<br><br>People have many stories with them about this place..which are of course full of horror...</div><div><br></div><div>Its about 85 Km from Jaipur.<br><br>Jaipur&gt;Bassi&gt;Dausa&gt;Bhangarh<br><br><br>Join&nbsp;<br>www.facebook.com/editfun</div>', 'Publish to All', '1357497798', 'piclogs/resize_1357497408.jpg', 'bhangarh_the_haunted_place'),
(193, 391, 'piclogs/resize_1357550051.jpg', 'Pulkit..Clicks n Edits', 1, 'Innocent Love', 'Love for people..Love for things..Love for Parents..Love for special one''s and what about love for animals...?<br><br>One thing is very sure..that is :&nbsp;<div><br>If you pick up a starving dog and make him prosperous he will not bite you.<br>this is the principal difference between a MAN and a DOG..<br><br>So if this goes true it means a dog must be trusted more than a man..<br><br>well this picture is clicked at Jaipur (Raj) in some college campus.<br><br>people...<br>its a request to everyone..love animals..</div><div><br></div><div><br></div><div>www.facebook.com/editfun<br><br></div>', 'Publish to All', '1357550298', 'piclogs/resize_1357550051.jpg', 'innocent_love'),
(194, 391, 'piclogs/resize_1357576656.jpg', 'Pulkit..Clicks n Edits', 1, 'pottery', 'Pottery refers to the art or craft of the potter or the manufacture of pottery.<div>-Wikipedia</div><div><br></div><div>I clicked this picture at JKK i.e. Jawahar Kala Kendra, Jaipur (Raj).</div><div><br></div><div>afterwords i edited the pic.</div><div><br></div><div><br></div><div>for my more edited pictures like my page on facebook.</div><div>The link is:</div><div><br></div><div>www.facebook.com/editfun</div>', 'Publish to All', '1357576890', 'piclogs/resize_1357576656.jpg', 'pottery'),
(195, 391, 'piclogs/resize_1357751370.jpg', 'Pulkit..Clicks n Edits', 10, 'Nature- A hidden Strength', 'The sketch is made by me in year 2008.<br><br>I chose title " Nature- A hidden strength"<br><br>Show your awareness and suggest more titles<div><br></div><div><br></div><div><br></div><div><br></div><div>www.facebook.com/editfun</div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</div>', 'Publish to All', '1357751488', 'piclogs/resize_1357751370.jpg', 'nature_a_hidden_strength'),
(196, 391, 'piclogs/resize_1357962901.jpg', 'Pulkit..Clicks Edits n Creations', 6, 'Poverty and Fest', '<font face="georgia">The picture is clicked by me in Jaipur (Rajasthan) on 14 Jan 2012 on the special occasion of "Makar Sankrat" A huge <u>Kite Festival.</u><br><br>At one side We..the people of India fly unlimited kites, celebrate with friends n family, have fun of the sweets and so more BUT at the other side these kids..waiting for a kite..so that they can sell them and earn 2-5 Rs per kite..<br><br><br>A small thing in just hearing but a big issue if to go in deep...<br><br><br>May god bring joy and happiness in their life too..<br><br><br><br>Wishing you all a Happy Makar Sankranti...</font><div><font face="georgia"><br></font></div><div><font face="georgia">"Fly Kites but Let even the birds also fly"</font></div>', 'Publish to All', '1357963266', 'piclogs/resize_1357962901.jpg', 'poverty_and_fest'),
(197, 228, 'piclogs/resize_1357978498.jpg', 'Nimit Pershad', 6, 'The Double Standards of Men', '<p><font>\n\n</font><font>\n\n</font>Recently\nthere has been a huge noise and you can feel things changing in the country. A\ngirl gets raped in a moving bus and the whole country now realizes what its\nfuture holds. Finally people have woken up. This is not the first time such a\nthing has happened nor was it the last. But the reaction of people is what\nmakes us believe that we can change the rules if we want to.<font>\n\n</font></p><p>&nbsp;</p><p>As\nmuch as I feel bad listening and reading about her story, it feel much worse looking\nat the reactions of the people who are expected to protect us.</p><p>&nbsp;</p><font>\n\n</font><p>The\npresidentâ€™s son calls women â€œDented and Paintedâ€, a minister from Madhya\nPradesh says â€œWomen should not cross Laxman Rekhaâ€, a spiritual leader says â€œThe\ngirl being raped should have called the rapist Bhaiya and he would have let her\ngoâ€. It doesnâ€™t end accusing women, the ministers further continue to abuse the\ncountry; a minister addressing a rally in Assam says â€œRapes occur in Urban\nIndia and not Rural Indiaâ€, another minister from Maharastra accuses people\nfrom Bihar region for the increase in rapes.</p><p>&nbsp;</p><font>\n\n</font><p>If\nthese ministers reflect the country and the way the country thinks, it is for\nthem to change their mindset for the whole country to change. If they cannot\nhelp or support women, they should not even pretend to do so. Expecting a young\ngeneration of leaders to understand and support also failed. </p><p>&nbsp;</p><font>\n\n</font><p>It\nmakes me think if the ministers who make such comments, are doing so only\nbecause they know they will get a free publicity or do they actually feel this\nway. In either case, it is wrong for them not only to say such things, but also\nto think in such a direction. These are the ministers who always talk about\ngender equality and indiscrimination who now accuse the women. This shows that\nwe have a long way to go before the women of our country can walk alone on the\nstreets without fear even late in the night. </p><p>&nbsp;</p><font>\n\n</font><p>Everyone\nhas their own views on this topic and their own ways of showing anger. I have\nmine. And I hope this reaction does not change till we see a change in the\nregulation. We need to stand up and scream for what is right instead of being\ninspired by a recent advertisement which says â€œLetâ€™s sit down for a coffee and\ntalkâ€, hope we never â€œSit Downâ€.</p><p>&nbsp;</p><font>\n\n</font><p>The\nreason for me to write this blog in spite of everyone having views on it is to\nkeep myself reminding time and again that we need to learn to respect women and\nhave a fear before doing anything wrong. A quote by Amitabh Bachchan would sum\nup the complete conversation; </p><p>&nbsp;</p><font>\n\n</font><p><strong><em>â€œ</em></strong><strong><em>Bharat the country is my Mother...</em></strong></p><font>\n\n</font><p><strong><em>Forget about me, become at least the recognised worthy\nface of your Mother..!!"</em></strong></p><font>\n\n</font><p><strong></strong>&nbsp;</p><p><strong></strong>&nbsp;</p><font>\n\n</font><p align="center"><strong>à¤­à¤¾à¤°à¤¤ à¤¦à¥‡à¤¶ à¤¹à¤®à¤¾à¤°à¥€ à¤®à¤¾à¤¤à¤¾ à¤¹à¥ˆ,<br>\nà¤®à¥‡à¤°à¥€ à¤›à¥‹à¤¡à¤¼à¥‹, à¤…à¤ªà¤¨à¥€ à¤®à¤¾à¤¤à¤¾ à¤•à¥€ à¤¤à¥‹ à¤ªà¤¹à¤šà¤¾à¤¨ à¤¬à¤¨à¥‹ !!</strong></p><p align="center"><strong></strong>&nbsp;</p><p align="center">&nbsp;</p><font>\n\n</font>', 'Publish to All', '1357978799', 'piclogs/resize_1357978498.jpg', 'the_double_standards_of_men'),
(198, 391, 'piclogs/resize_1358015752.jpg', 'Pulkit..Clicks Edits n Creations', 6, 'F.r.!.E.N.D.$', 'Friends-A word that connect many people to your mind..<div><br>Many thoughts, many views, many people..<br>some close, some very close, some Just Friend.<div><br></div><div>Still this word is one of the most important things that must exist positively in one''s life..</div><div><br></div><div>they sometime make life easy and sometime difficult..</div><div><br></div><div>If we have not spoken to strangers then there would not be any friend in our life..</div><div><br></div><div><br></div><div>the picture is clicked by me at Bhangarh, Rajasthan and is dedicated to my friends..</div><div><br></div><div>Life is incomplete without you guys..<br><br><br><br><br></div></div>', 'Publish to All', '1358016107', 'piclogs/resize_1358015752.jpg', 'f_r_e_n_d_'),
(199, 3, 'piclogs/resize_1358152884.jpg', 'Rajive Dhavan', 3, 'The Tug of War â€“ creativity Vs. creativiTEA', '<p>A Media House, or an advertising agency for that matter, is\nalways surrounded by questions that are the result of a Brand ownerâ€™s\napprehensions â€“ Are they making enough money to play a long inning? Do they\nhave a team thatâ€™s capable enough to churn out some amazing creative\ncommunication solutions? Do they care for my money? Are they a part of my team?\nso on and so forth. Some questions are justified; others are reflections of a brand\nownerâ€™s personality!</p>\n\n<p><br></p><p>They say, you see the world as an extension of yourself. But\nwhen you lack of domain knowledge and top it up with a point of view thatâ€™s a\nresult of wearing rose-coloured glasses, youâ€™re clearly disillusioned to move\ntowards a disaster.</p>\n\n<p><br></p><p>Brands are like people; they seek a lot of attention and\ncare; especially from those who understand them. When brand owners pretend to\nknow everything about everything (including brand management), theyâ€™re moving\ntowards a world thatâ€™s just a result of their limited understanding; a world\nthatâ€™s unreal. Unfortunately, most of these brand owners never make attempts to\nget a reality check done. And what could be the reason? Well, it could be\nanything ranging from fear to embarrassment to inferiority complex to lack of domain\nknowledge to arrogance. Whatever the reason, at the end of the day, itâ€™s always\nthe brand that takes a hit.</p>\n\n<p><br></p><p>The question at a Media House, however, always boils down to\na thin line where a brand ownerâ€™s understanding is either â€œI want it my wayâ€ or â€œLetâ€™s do it the right wayâ€. Unfortunately,\nthe former hardly vindicates the latter. The Tug-of-war between the unrealistic\ndemands of a brand owner (read client) and the realistic approach of brand\ncustodians (read Media House) continues till the threshold; until everything\ncomes to a standstill. Unfortunately, even these situations donâ€™t work as an\neye-opener; and the brutal attempts to tarnish a brand continue in the name of creative\ninputs from brand owners. The moment brand custodians show some resistance to\nthese inputs, things begin to soar.</p>\n\n<p><br></p><p>The old rule says â€“ â€œThe brand owner (Client) is always\nright!â€ But over the years, this rule has been trashed due to some very good\nexamples of how a brand ownerâ€™s involvement becomes sheer interference, leading\nto situations that are uncalled for.</p><div><br></div>\n\nThe verdict however, is that if creativity was\neveryoneâ€™s cup of tea, it would be spelt as creative-TEA!<div><br></div><div><br></div>', 'Publish to All', '1358153868', 'piclogs/resize_1358152884.jpg', 'the_tug_of_war_creativity_vs_creativitea'),
(200, 391, 'piclogs/resize_1358183285.jpg', 'Pulkit', 1, 'Combinations', 'Nature and Sky..<div><br></div><div>The most beautiful thing on the whole planet..<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</div><div><span style="font-size: medium;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></div><div><span style="font-size: medium;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></div><div><span style="font-size: medium;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;www.facebook.com/editfun</span></div><div><br></div><div><br></div>', 'Publish to All', '1358183636', 'piclogs/resize_1358183285.jpg', 'combinations'),
(201, 391, 'piclogs/resize_1358306709.jpg', 'Pulkit..Clicks n Edits', 3, 'Clicks n Edits', 'This photo have been clicked by me and then edited.<br>My most of the photos are not just for photography but for editing purpose.<div><br></div><div><br></div><div>if you like the work please follow me on Facebook.</div><div>The link to my page <u>Clicks Edits n Creations </u>is&nbsp;</div><div><br></div><div>www.facebook.com/editfun<br><div><br></div></div><div><br></div><div><br></div><div>Wishes</div><div>Pulkit &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</div>', 'Publish to All', '1358307035', 'piclogs/resize_1358306709.jpg', 'clicks_n_edits'),
(202, 391, 'piclogs/resize_1358759076.jpg', 'Pulkit..Clicks n Edits', 11, 'Jaipur - more than a Pink City', '<font face="comic sans ms"><strong>Albert Hall Museum</strong> is a museum in Jaipur, Rajasthan state of <strong>India.</strong>It is the oldest museum of the state and functions as the State museum of Rajasthan. The building is situated in <a href="http://en.wikipedia.org/wiki/Ram_Niwas_Garden" title="Ram niwas garden">Ram Niwas Garden</a> outside the city wall opposite New gate and is a fine example of <a href="http://en.wikipedia.org/wiki/Indo-Saracenic_architecture" title="Indo-Saracenic architecture">Indo-Saracenic architecture</a>. The building was designed by Sir <a href="http://en.wikipedia.org/wiki/Samuel_Swinton_Jacob" title="Samuel swinton jacob">Samuel Swinton Jacob</a> and was opened as public museum in 1887. It is also called the Government Central Museum.&nbsp;Maharajah&nbsp;<a href="http://en.wikipedia.org/wiki/Ram_Singh" title="Ram singh">Ram Singh</a> initially wanted this building to be a town hall, but his successor, Madho Singh II, decided it should be a museum for the art of Jaipur and included as part of the new Ram Nivas Garden. The museum has a rich collection of&nbsp;artifacts&nbsp;like paintings, carpets, ivory, stone, metal sculptures,&nbsp;colorful&nbsp;crystal works etc.It is named after&nbsp;<a href="http://en.wikipedia.org/wiki/King_Edward_VII" title="King edward vii">King Edward VII</a> (Albert Edward), during whose visit to the city as the&nbsp;<a href="http://en.wikipedia.org/wiki/Prince_of_Wales" title="Prince of wales">Prince of Wales</a>, its foundation stone was laid on 6 February 1876.</font><div><font face="comic sans ms"><strong><br></strong></font></div><div><font face="comic sans ms"><strong>At present there is a 2300-year-old Egyptian mummy at the Albert Hall museum in Jaipur.<br><br><br>Most of the matter is copied from Wikipedia.</strong><strong><br></strong><strong><br></strong>Photo was clicked by me in Jaipur.</font></div>', 'Publish to All', '1358759084', 'piclogs/resize_1358759076.jpg', 'jaipur_more_than_a_pink_city');
