(203, 391, 'piclogs/resize_1358913650.jpg', 'Pulkit..Clicks n Edits', 7, 'Nature-at its beauty', 'Flowers, Leaves, Grass, Trees, Water, Hills and so many things ...<br><br>How beautiful our nature is..<div><br></div><div>everything has its own importance. its own beauty.<br><br></div><div>and flowers...!!&nbsp;</div><div>&nbsp;</div><div>May be the most amazing and most beautiful thing on earth.&nbsp;</div><div>Different varieties..<br><br>different purpose...</div><div><br></div><div>As like Red roses for our valentine , yellow for friends and so on..!!</div><div><br></div><div><br></div><div><br></div><div>Photo was clicked by me in Ajmer, Rajasthan.</div><div><br></div>', 'Publish to All', '1358913941', 'piclogs/resize_1358913650.jpg', 'nature_at_its_beauty'),
(204, 391, 'piclogs/resize_1359026806.jpg', 'Pulkit..Clicks n Edits', 9, 'KING - inside a Cage', '<font face="helvetica">Lion..The king of Jungle.</font><div><font face="helvetica"><br></font></div><div><font face="helvetica">We all have visited Zoo at least once in our life.&nbsp;<br>Any of you who have not made fun of this KING there?<br>Showing him tongue and copying his roar is the most common thing we do.<br><br>But the condition is this KING should be behind some bars where we know he is helpless and cant even touch us.<br><br>But what if when he is just in front of you without any cage or bars....??<br><br>Scary..right?<br>No one even want to imagine this condition..<br><br>That''s the originality of this king.<br><br>Respect animals</font></div><div><font face="helvetica"><br></font></div><div><font face="helvetica"><br></font></div><div><font face="helvetica"><br></font></div><div><font face="helvetica"><br></font></div><div><font face="helvetica">Photo clicked by me at Jaipur Zoo.</font></div><div><font face="helvetica"><br></font></div>', 'Publish to All', '1359027175', 'piclogs/resize_1359026806.jpg', 'king_inside_a_cage'),
(205, 391, 'piclogs/resize_1359218626.jpg', 'Pulkit..Clicks n Edits', 7, 'The love of A father for his Son..', 'Love..<br><br>Love between two people<div>Love between a couple</div><div>Love for some friend</div><div>Love for pets</div><div>Love for anything, anyone..</div><div><br></div><div>But the most special n trust worthy love in the world is LOVE OF PARENTS FOR THEIR CHILDREN..</div><div><br></div><div><br></div><div>This pic is not an artificial one..The natural love between these two was captured at Albert Hall, Jaipur.</div><div><br></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</div><div><br></div><div><br></div>', 'Publish to All', '1359218902', 'piclogs/resize_1359218626.jpg', 'the_love_of_a_father_for_his_son_'),
(206, 299, 'piclogs/resize_1359350111.jpg', 'Atanu Bose', 6, 'Welcome', 'I welcome thee<div>Through the thousand doors</div><div>Through hundred centuries &amp; many more</div><div>Through dark fog &amp; withered floor</div><div>I knew you''d come for sure!</div><div><br></div><div>Ages went by awaiting you</div><div>Through bright&nbsp;sunshine&nbsp;&amp; dismal blue</div><div>But that you''d come back too</div><div>For sure I knew!</div><div><br></div><div>Let the doors be opened apart</div><div>Let the music fill the heart</div><div>Let all the celebrations start</div><div>As here''s an end to a part!</div>', 'Publish to All', '1359351077', 'piclogs/resize_1359350111.jpg', 'welcome'),
(207, 4, 'piclogs/resize_1359658862.jpg', 'Raj Mohapatra', 6, 'Perception & Reality!', '<p><font face="helvetica"><b><i>Weâ€™ve all heard the saying â€œperception is reality,â€ but is it true? Does perception\nnever, rarely, sometimes, or always equal reality? While I long ago reached the\nconclusion perception does in fact matter, it may not be for the reasons\nyou might think. I have found the majority of people tend to get\nstuck up with regard to perception â€“ they understand their own\nperceptions, but are quite often either ignorant or intolerant of otherâ€™s\nperceptions. Hereâ€™s the thing â€“ the most important item\nto understand is success as a leader has very little to do\nwith your perceptions, but rather it has everything to do with the perception\nof others.</i></b></font></p>\n\n<p><font face="helvetica"><b><i>Let me be clear â€“ Iâ€™m not suggesting you ignore your perceptions,\nsubordinate your perceptions, or change your perceptions, but I am strongly\nsuggesting you take the time to both be aware of, and understand the\nperceptions of others. What Iâ€™ve just told has nothing to\nwith compromising your values or being religious.</i></b></font></p>\n\n<p><font face="helvetica"><b><i>Letâ€™s start the analysis by examining the definitional differences\nbetween â€œperceptionâ€ and â€œrealityâ€:</i></b></font></p>\n\n<p><font face="helvetica"><b><i>Perception Defined: a perception is a\nbelief, theory, hypothesis, feeling, appearance, opinion, observation, insight,\nawareness, or sensitivity. It may or may not constitute reality, and\ninitial perceptions often change with the passing of time, the changing of\ncircumstances, or the receipt of additional information.</i></b></font></p>\n\n<p><font face="helvetica"><b><i>Reality Defined: Reality\nis certain, authentic, actual, true, and factual. True reality\nis undeniable, (factually) indisputable, and not subject to debate\n(rationalization).</i></b></font></p>\n\n<p><font face="helvetica"><b><i>Attitudes, perspectives, and\npositions can in many cases be born out by facts. However they can also be\nlittle more than emotional or philosophical beliefs that are far from factual\nstatements. The best example I can give is to ask you to revisit the image\nabove â€“ Is the glass half empty, or is it half full? My answer is yes. You see\nboth answers are correct, both answers are a matter\nof perception, and to my points made earlier, both answers are very\ntelling. If youâ€™ll allow me to take a deeper dive on this illustration\nyouâ€™ll start to see why understanding otherâ€™s perceptions are critically\nimportant. Letâ€™s look at how different individuals might view the glass:</i></b></font></p>\n\n<p><font face="helvetica"><b><i>The Optimist: The glass is half full.</i></b></font></p>\n\n<p><font face="helvetica"><b><i>The Pessimist: The glass is half empty.</i></b></font></p>\n\n<p><font face="helvetica"><b><i>The Salesperson: How much water would you like your\nglass to hold?</i></b></font></p>\n\n<p><font face="helvetica"><b><i>The Accountant: Does the glass really need all that\nwater?</i></b></font></p><p><i><b><span style="font-family: helvetica; font-size: medium;">&nbsp;</span>The Philosopher: If nobody looks at the glass, whoâ€™s\nto say whether itâ€™s half full or half empty?</b></i></p>\n\n<i><b>The Politician: Letâ€™s take a poll and\nthen Iâ€™ll render my opinion as to how full or empty the glass\n\n</b></i><p><font face="helvetica"><b><i>Those of you more creative than I could likely come up with a much\nlonger list, but I think this exercise makes the point that understanding\notherâ€™s perceptions is a critical part of being an effective leader.\nWhatâ€™s interesting to me is most people actually form their perceptions in a\nvery similar fashion. They take inputs (information), process them through a\nvariety of filters (experience, emotions, expectations, moral and philosophical\npositions, etc.), those filters in turn create an output (accurate or\ninaccurate perception), which leads to an action (good or bad decision). Again,\nall of us use a very similar process, we just have access to different types of\ninputs, use different filters, arrive at different perceptions, and therefore\nmake different decisions. Itâ€™s learning to access better quality information\nand/or develop a more refined filtering system that will allow us to have more\naccurate perceptions and create a better understanding.</i></b></font></p>\n\n<p><font face="helvetica"><b><i>The most powerful part of\nunderstanding the process described in the paragraph above is taking the time\nto understand the mechanics of this process as it applies to others â€“\nparticularly those you lead and communicate with on a frequent basis. If you\nunderstand where someone is getting their inputs, and which filters they use in\ncreating their outputs, youâ€™ll be able to better understand and impact their\nperceptions, and ultimately, this will lead to greater influence over their\ndecision making process. This is very simple, but very powerful, and should be\nunderstood by anyone in a leadership position.</i></b></font></p>\n\n<p><font face="helvetica"><b><i>The bottom line is great leaders take the time to understand the various\nconstituencies and spheres of influence they come in contact with. â€œMy way or\nthe highwayâ€ thinking, and/or positional dictatorships rarely create the\nculture and performance demonstrated by winning\norganizations. Whether you agree or disagree is not the point â€“ the point\nis understanding the perceptions of others afford you a source of\nintelligence, a learning opportunity, and the ability to keep lines of\ncommunication open.</i></b></font></p>\n\n<p><font face="helvetica"><b><i>So back to my original question: Does perception never, rarely,\nsometimes, or always equal reality? </i></b></font></p>', 'Publish to All', '1359659321', 'piclogs/resize_1359658862.jpg', 'perception_reality_'),
(216, 391, 'piclogs/resize_1360390367.jpg', 'Pulkit..Clicks n Edits', 1, 'Beauty Drawn', '<font face="trebuchet ms">This sketch was made by me in year 2007.</font><div><font face="trebuchet ms"><br></font></div><div><font face="trebuchet ms"><br></font></div><div><font face="trebuchet ms"><br></font></div><div><font face="trebuchet ms"><br></font></div><div><font face="trebuchet ms"><br></font></div><div><font face="trebuchet ms">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</font></div><div><font face="trebuchet ms"><br></font></div><div><font face="trebuchet ms">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</font></div><div><font face="trebuchet ms">www.facebook.com/editfun</font></div><div><font face="trebuchet ms"><br></font></div><div><font face="trebuchet ms"><br></font></div><div><font face="trebuchet ms"><br></font></div><div><font face="trebuchet ms">Pulkit Jain</font></div>', 'Publish to All', '1360390491', 'piclogs/resize_1360390367.jpg', 'beauty_drawn'),
