(236, 290, 'piclogs/resize_1363793893.jpg', 'Google', 6, 'Travelling & Learning:', '&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "Life Goes on...." this is what is life in short. No matter what else is there to it. It all sumz up to these 3 words. Two things in life we always come across no matter at what stage of life we are in or how much experienced or knowledgeable we stand.<br> <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Life includes a large part of travelling and learning..and ending up living with it. we do not know bt every small thing that comes our way teaches something or the other which at some point of time we use without our knowledge. Learning is a never ending process. people dont have to be scholars to teach. Even a small kid can impart knowledge which is not heard of...thats life with all the lively happenings and all the continuos changes.<br> <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Travelling and experiencing different cultures meeting people we dont know existed and making great relations with them as you come across. Some people actually become an integral and important part of our daily lives and end up in a bond very strong. they are helpful in times of need. Thats how we come across various cultures and people and in the end it all sumz up to an amazing memory which is a part of life and a learning experience as well.<br> <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Thats what life has to offer different colours, different cultures, different people, different foods, different habitats, different environments and learning is a never ending process in all such...this is what life is with all the people and all the memories in it and all the learning that keeps us going and experiencing new things and taking life as it comes by.<br> <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Life comes in all colours and all packages.. people you thought hated you turn out to be best friends and people whom you thought you''d never end up with turn out to be the ones you would like to be seen with always."never judge a book by its cover"<br> <br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;So enjoy life and never stop learning becoz it is a never ending process and it is the thing that helps u be the change you wish to be some day... Keep travelling, keep learning and make memories and live life to the fullest!...</div>', 'Publish to All', '1363794218', 'piclogs/resize_1363793893.jpg', 'travelling_learning_');
